tion on Permalinks Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-permalinks-screen/">Nuorodų struktūros nustatymų dokumentacija</a>','<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Documentation on Privacy Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Privatumo nustatymų dokumentacija</a>','<a href="https://wordpress.org/documentation/article/settings-reading-screen/">Documentation on Reading Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-reading-screen/">Skaitymo nustatymų dokumentacija</a>','<a href="https://wordpress.org/documentation/article/settings-writing-screen/">Documentation on Writing Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-writing-screen/">Rašymo nustatymų dokumentacija</a>','<a href="https://wordpress.org/documentation/article/site-health-screen/">Documentation on Site Health tool</a>'=>'<a href="https://wordpress.org/documentation/article/site-health-screen/">Tinklalapio sveikatos įrankio dokumentacija</a>','<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Documentation on Erase Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Asmeninių duomenų ištrynimo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Documentation on Export Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Asmeninės informacijos eksportavimo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/tools-export-screen/">Documentation on Export</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-screen/">Eksportavimo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/tools-import-screen/">Documentation on Import</a>'=>'<a href="https://wordpress.org/documentation/article/tools-import-screen/">Importavimo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/tools-screen/">Documentation on Tools</a>'=>'<a href="https://wordpress.org/documentation/article/tools-screen/">Įrankių dokumentacija</a>','<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Documentation on Comment Spam</a>'=>'<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Brukalų komentaruose dokumentacija</a>','<a href="https://wordpress.org/documentation/article/users-add-new-screen/">Documentation on Adding New Users</a>'=>'<a href="https://wordpress.org/documentation/article/users-add-new-screen/">Naujų vartotojų pridėjimo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/users-screen/">Documentation on Managing Users</a>'=>'<a href="https://wordpress.org/documentation/article/users-screen/">Vartotojų valdymo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/users-your-profile-screen/">Documentation on User Profiles</a>'=>'<a href="https://wordpress.org/documentation/article/users-your-profile-screen/">Vartotojų profilių dokumentacija</a>','<a href="https://wordpress.org/documentation/article/work-with-themes/">Documentation on Using Themes</a>'=>'<a href="https://wordpress.org/documentation/article/work-with-themes/">Temų naudojimo dokumentacija</a>','<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Documentation on Writing and Editing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Įrašų kūrimo ir redagavimo dokumentacija</a>','<a href="https://wordpress.org/support/forum/multisite/">Support forums</a>'=>'<a href="https://wordpress.org/support/forum/multisite/">Pagalbos forumai (anglų kalba)</a>','<a href="https://wordpress.org/support/forums/">Support forums</a>'=>'<a href="https://wordpress.org/support/forums">Pagalbos forumai (anglų kalba)</a>','<code>_blank</code> &mdash; new window or tab.'=>'<code>_blank</code> &mdash; naujame lange ar kortelėje.','<code>_none</code> &mdash; same window or tab.'=>'<code>_none</code> &mdash; tame pačiame lange ar kortelėje.','<code>_top</code> &mdash; current window or tab, with no frames.'=>'<code>_top</code> &mdash; esamame lange ar kortelėje, be rėmelių (with no frames).','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.'=>'<strong>%s</strong> &mdash; leidžia jums susieti įrašą su paveikslėliu, jo neįterpiant. Bet tik kelios WordPress temos panaudoja šį paveikslėlį (pvz., kaip įrašo piktogramą pradžios puslapyje, kaip individualizuotą antraštės paveikslėlį ir pan.).','<strong><em>Note that password</em></strong> carefully! It is a <em>random</em> password that was generated just for you.'=>'<strong><em>Įsiminkite slaptažodį</em></strong>! Tai <em>atsitiktinis</em> slaptažodis, sugeneruotas būtent jums.','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong>Aktyvumas</strong> &mdash; čia rodomi suplanuoti įrašai, neseniai paskelbti įrašai bei naujausi komentarai su nuorodomis į jų moderavimą.','<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.'=>'<strong>Patarimas:</strong> nepamirškite, jog įjungtos temos redagavimas gali sutrikdyti Jūsų tinklalapio veikimą.','<strong>At a Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.'=>'<strong>Trumpai</strong> &mdash; parodo Jūsų turinio santrauką, bei kokią temą ir WordPress versiją naudojate.','<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.'=>'<strong>Skilčių valdymas</strong> &mdash; paspauskite ant bet kurios skilties pavadinimo, ir ji išsiskleis arba susiskleis. Kai kurios skiltys, kurias prideda įskiepiai, gali turėti nustatymais valdomą turinį, tuomet užėjus ant jų pavadinimo su pele, šalia atsiras nuoroda "Konfigūruoti".','<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.'=>'<strong>Paspaudus rodyklę esančią šalia kiekvieno meniu punkto pavadinimo</strong> atsidarys standartiniai nustatymai meniu punktui. Papildomi nustatymai meniu punktams, tokie kaip nuorodos atidarymo vieta, CSS klasė, nuorodų ryšiai bei aprašymai, yra įjungiami ir išjungiami Ekrano nustatymų skiltyje puslapio viršuje.','<strong>Comments</strong> &mdash; For user comments, Email Address, IP Address, User Agent (Browser/OS), Date/Time, Comment Content, and Content URL.'=>'<strong>Komentarai</strong> &mdash; Vartotojo komentarai, el. pašto adresas, IP adresas, vartotojo agentas (naršyklė / operacinė sistema), data ir laikas, komentaro turinys ir turinio URL.','<strong>Comments</strong> &mdash; WordPress does not delete comments. The software does anonymize (but, again, <em>never</em> publishes) the associated Email Address, IP Address, and User Agent (Browser/OS).'=>'<strong>Komentarai</strong> &mdash; WordPress neištrina komentarų. Programinė įranga nuasmenina (bet, vėlgi, <em>niekada</em> neskelbia) susijusį el. pašto adresą, IP adresą ir vartotojo agentą (naršyklę/OS).','<strong>Community Events Location</strong> &mdash; The IP Address of the user which is used for the Upcoming Community Events shown in the dashboard widget.'=>'<strong>Bendruomenės renginių vieta</strong> &mdash; Vartotojo IP adresas, kuris naudojamas Skydelio valdiklyje rodomiems būsimiems bendruomenės renginiams.','<strong>Community Events Location</strong> &mdash; The IP Address of the user, which populates the Upcoming Community Events dashboard widget with relevant information.'=>'<strong>Bendruomenės renginių vieta</strong> &mdash; Vartotojo IP adresas, kuriuo remiantis pildomas būsimų bendruomenės renginių valdiklis Skydelyje.','<strong>Compatible</strong> with your version of WordPress'=>'<strong>Suderinamas</strong> su Jūsų naudojama WordPress versija','<strong>Connection lost.</strong> Saving has been disabled until you are reconnected.'=>'<strong>Neįmanoma prisijungti prie interneto.</strong> Išsaugojimas neįmanomas, kol vėl neprisijungsite.','<strong>Contribute</strong> to the code, improve the UX, and test the WordPress app.'=>'<strong>Prisidėkite</strong> prie kodo, tobulinkite vartotojo sąsają ir testuokite WordPress programėlę.','<strong>Copy URL</strong> copies the URL for the media file to your clipboard.'=>'<strong>Kopijuoti URL</strong> nukopijuoja failo URL adresą į iškarpinę.','<strong>Create</strong> and improve WordPress educational materials.'=>'<strong>Kurkite</strong> ir tobulinkite WordPress mokomąją medžiagą.','<strong>Curate</strong> submissions or take photos for the Photo Directory.'=>'<strong>Tikrinkite</strong> pateiktus dokumentus arba pateikite nuotraukas nuotraukų katalogui.','<strong>Delete Permanently</strong> will delete the file from the media library (as well as from any posts to which it is currently attached).'=>'<strong>Pašalinti negrįžtamai</strong> failas bus pašalintas iš failų saugyklos (taip pat iš visų įrašų, su kuriais jis šiuo metu yra susietas).','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using bulk actions.'=>'<strong>Trinti</strong> funkcija parodo Jums Vartototų ištrynimo langą, kur patvirtinus tokį norą, Jūs galite visam laikui ištrinti vartotoją iš savo tinklalapio bei kartu ištrinti ir jo sukurtą turinį. Taip pat galite pašalinti iš karto kelis vartotojus, naudojant Masinius veiksmus.','<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.'=>'<strong>Aprašymas</strong> &mdash; paprastai aprašymas niekur neskelbiamas, bet kai kurios temos gali jį parodyti.','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong>Komentarai</strong> &mdash; galite įjungti/išjungti galimybę komentuoti įrašą ir siųsti atgalinius pranešimus. Jei įrašas jau turi komentarų, galite juos moderuoti.','<strong>Download file</strong> downloads the original media file to your device.'=>'<strong>"Atsisiųsti failą</strong>" atsisiųs originalų failą į jūsų įrenginį.','<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.'=>'<strong>Perkėlimas pele</strong> &mdash; norėdami perdėlioti skiltis, paspauskite ant jų pavadinimų pele ir tempkite iki norimos vietos, o tuomet atleiskite pelės klavišą. Tempiant atsiras pilku punktyru apibrėžta zona - tai vieta, į kurią galite padėti tempiamą skilį.','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'<strong>Nutempkite</strong> savo failus į apatinę zoną. Galima tempti kelis failus. ','<strong>Edit</strong> takes you to a simple screen to edit that individual file&#8217;s metadata. You can also reach that screen by clicking on the media file name or thumbnail.'=>'<strong>Redaguoti</strong> perkelia į puslapį, kuriame galite redaguoti konkretaus failo metaduomenis. Šį puslapį taip pat galite pasiekti spustelėję failo pavadinimą arba miniatiūrą.','<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.'=>'<strong>Redaguoti</strong> funkcija perkels Jus į vartotojo profilio redagavimo puslapį. Į tą patį puslapį pateksite ir paspaudę ant vartotojo vardo.','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'Nuoroda <strong>Redaguoti</strong> perkels Jus į įrašo redagavimo puslapį. Į tą patį puslapį pateksite ir paspaudę ant įrašo pavadinimo.','<strong>Edit</strong> videos and add captions to WordPress.tv.'=>'<strong>Redaguokite</strong> vaizdo įrašus ir titrus projekte WordPress.tv.','<strong>Error:</strong> "Table Prefix" can only contain numbers, letters, and underscores.'=>'<strong>KLAIDA:</strong> lentelės priešdėlis gali būti sudarytas tik iš skaičių, raidžių ir pabraukimų.','<strong>Error:</strong> "Table Prefix" is invalid.'=>'<strong>KLAIDA"</strong> netinkamas lentelės priešdėlis.','<strong>Error:</strong> "Table Prefix" must not be empty.'=>'<strong>KLAIDA"</strong> lentelės priešdėlis negali būti tuščias.','<strong>Error:</strong> Could not connect to the server. Please verify the settings are correct.'=>'<strong>Klaida:</strong> Nepavyko prisijungti prie serverio. Patikrinkite, ar nustatymai teisingi.','<strong>Error:</strong> Passwords do not match. Please enter the same password in both password fields.'=>'<strong>KLAIDA:</strong> Slaptažodžiai nesutampa. Įveskite tą patį slaptažodį abejuose laukuose.','<strong>Error:</strong> Passwords may not contain the character "\\".'=>'<strong>Klaida:</strong> Slaptažodyje negali būti „\\” simbolio.','<strong>Error:</strong> Please enter a nickname.'=>'<strong>KLAIDA"</strong> Prašome įvesti vartotojo vardą.','<strong>Error:</strong> Please enter a password.'=>'<strong>Klaida:</strong> Įveskite slaptažodį.','<strong>Error:</strong> Please enter an email address.'=>'<strong>Klaida:</strong> Įveskite el. pašto adresą.','<strong>Error:</strong> The %s options page is not in the allowed options list.'=>'<strong>KLAIDA"</strong> Nustatymų puslapis %s nerastas leidžiamų nustatymų sąraše.','<strong>Error:</strong> The root directory of your site is not <a href="%1$s">writable</a>, so creating a file automatically was not possible. This is the URL rewrite rule you should have in your %2$s file. Create a new file called %2$s in the root directory of your site. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this code into the %2$s file.'=>'<strong>Klaida:</strong> Pagrindinė jūsų tinklalapio direktorija nėra <a href="%1$s">įrašoma</a>, todėl neįmanoma automatiškai sukurti failo. Pateikiame nuorodų perrašymo taisykles, kurios turėtų būti %2$s faile. Sukurkite naują failą pavadinimu %2$s pagrindinėje tinklalapio direktorijoje. Spustelkite ant taisyklių ir paspauskite %3$s (ar %4$s Mac kompiuteriuose) ir pažymėkite jas visas. Tuomet įterpkite šį tekstą į %2$s failą.','<strong>Error:</strong> This email is already registered. Please choose another one.'=>'<strong>KLAIDA"</strong> Šis el. pašto adresas jau užregistruotas, pasirinkite kitą.','<strong>Error:</strong> This plugin <strong>requires a newer version of PHP</strong>.'=>'<strong>Klaida:</strong> Šiam įskiepiui <strong>būtina naujesnė PHP versija</strong>.','<strong>Error:</strong> This plugin <strong>requires a newer version of WordPress</strong>.'=>'<strong>Klaida:</strong> Šiam įskiepiui <strong>būtina naujesnė WordPress versija</strong>.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. These are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all.'=>'<strong>Klaida:</strong> Jūsų %1$s failas nėra <a href="%2$s">įrašomas</a>, todėl jo atnaujinti automatiškai nepavyko. Tai yra mod_rewrite taisyklės, kurios turėtų būti jūsų %1$s faile. Spustelėkite lauką ir paspauskite %3$s (arba %4$s Mac kompiuteryje), kad pasirinktumėte visas.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. This is the URL rewrite rule you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this rule inside of the %5$s element in %1$s file.'=>'<strong>Error:</strong>Jeigu %1$s failas būtų <a href="%2$s">įrašomas</a>, mes galėtume tai padaryti automatiškai, bet kadangi įrašyti negalime, čia yra nuorodų perrašymo taisyklės, kurios turėtų būti %1$s faile. Spustelkite lauką ir paspauskite %3$s (arba %4$s Mac kompiuteryje) jei norite pažymėti viską.  Tuomet įterpkite šį tekstą %5$s elemene %1$s faile.','<strong>Explore</strong> ways to reduce the environmental impact of websites.'=>'<strong>Nagrinėkite</strong> būdus, kaip sumažinti tinklalapių poveikį aplinkai.','<strong>Find</strong> and report bugs in the WordPress core software.'=>'<strong>Suraskite</strong> ir praneškite apie WordPress klaidas.','<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Your theme could enable all or some of 10 possible formats. <a href="https://developer.wordpress.org/advanced-administration/wordpress/post-formats/#supported-formats">Learn more about each post format</a>.'=>'<strong>Formatas</strong> &mdash; įrašo formatai nulemia kaip Jūsų tema atvaizduos konkretų įrašą. Pavyzdžiui, galite paskelbti <em>standartinį</em> įrašą su pavadinimu ir teksto paragrafais, arba trumpą <em>pastabą</em>, kuri neturi pavadinimo ir susideda tik iš nedidelio teksto kiekio. Jūsų tema gali palaikyti visus ar tik kai kuriuos iš 10 galimų formatų, arba juos visus. <a href="https://developer.wordpress.org/advanced-administration/wordpress/post-formats/#supported-formats">Daugiau apie kiekvieną formatą skaitykite Dokumentacijoje</a>.','<strong>Important:</strong> Before updating, please <a href="%1$s">back up your database and files</a>. For help with updates, visit the <a href="%2$s">Updating WordPress</a> documentation page.'=>'<strong>Svarbu:</strong> prieš atnaujinant, būtinai <a href="%1$s">padarykite failų ir duomenų bazės kopijas</a>. Jei reikia pagalbos, aplankykite <a href="%2$s">WordPress atnaujinimo</a> dokumentacijos puslapį.','<strong>Incompatible</strong> with your version of WordPress'=>'<strong>Nesuderinamas</strong> su Jūsų naudojama WordPress versija','<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong>Pastaba</strong> &mdash; Svetainės nuorodos laukas yra retai taisomas, nes tai gali pakenkti svetainės veikimui. Registracijos ir paskutinio atnaujinimo datos yra rodomos. Tinklo administratoriai gali pažymėti svetaines kaip archyvuotas, šiukšlines, ištrintas ar skirtas suaugusiems, pašalinti jas iš viešų sąrašų ir išjungti.','<strong>Lend</strong> your creative imagination to the WordPress UI design.'=>'<strong>Išnaudokite</strong> savo kūrybinę vaizduotę WordPress vartotojo sąsajos dizainui.','<strong>Media</strong> &mdash; A list of URLs for all media file uploads made by the user.'=>'<strong>Media failai</strong> &mdash; Vartotojo įkeltų failų URL sąrašas.','<strong>Media</strong> &mdash; A list of URLs for media files the user uploads.'=>'<strong>Media failai</strong> &mdash; Vartotojo įkeltų failų URL sąrašas.','<strong>Name</strong> &mdash; The name is how it appears on your site.'=>'<strong>Pavadinimas</strong> &mdash; tinklalapyje rodomas elemento pavadinimas.','<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.'=>'<strong>Išdėstymo tvarka</strong> &mdash; puslapiai paprastai išdėstomi pagal abėcėlę, bet galite patys nustatyti išdėstymą priskirdami puslapiams skaičius (pradedant vienetu).','<strong>Organize</strong> or participate in local Meetups and WordCamps.'=>'<strong>Organizuokite</strong> arba dalyvaukite Meetup susitikimuose ir WordCamp konferencijose.','<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.'=>'<strong>Tėvinė kategorija</strong> &mdash; kategorijos, skirtingai nei žymos, gali turėti hierarchiją. Pavyzdžiui, kategorija Džiazas gali turėti sub-kategorijas Bebopas ir Bigbendas. Tačiau tai nėra privaloma. Norėdami sukurti sub-kategoriją, tiesiog pasirinkite kažkurią kategoriją kaip jos tėvinę išskleidžiamame pasirinkimų sąraše.','<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.'=>'<strong>Tėvinis puslapis</strong> &mdash; galite skirstyti puslapius pagal hierarchiją. Pavyzdžiui, jūs galite sukurti puslapį „Apie“ ir jam priskirti puslapius „Gyvenimo istorija“ ir „Mano šuo“. Šiems puslapiams taip pat galite priskirti kitus.','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong>Dėmesio:</strong> Visi jūsų atlikti temų pakeitimai bus prarasti. Jei norite išsaugoti pakeitimus, rekomenduojame naudoti <a href="%s">dukterines temas</a>.','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Code. Choose the mode by clicking on the appropriate tab.'=>'<strong>Įrašo redaktorius</strong> &mdash; čia rašykite savo įrašo tekstą. Tai galite padaryti dviem režimais: vaizdiniu ir kodo. Pasirinkite Jums patogesnį būdą paspaudę ant atitinkamos skilties.','<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.'=>'<strong>Peržiūra</strong> parodys, kaip šis juodraštis atrodytų jei jį paskelbtumėte. will show you what your draft post will look like if you publish it. Nuoroda "Peržiūrėti" atidarys šį įrašą Jūsų tinklalapyje. Kuri iš šių nurodų bus matoma, priklauso nuo įrašo statuso.','<strong>Profile Information</strong> &mdash; user email address, username, display name, nickname, first name, last name, description/bio, and registration date.'=>'<strong>Profilio informacija</strong> &mdash; vartotojo el. pašto adresas, vartotojo vardas, rodomas vardas, slapyvardis, vardas, pavardė, aprašymas / biografija ir registracijos data.','<strong>Promote</strong> the WordPress project to your community.'=>'<strong>Skleiskite žinią</strong> apie WordPress projektą savo bendruomenėje.','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.'=>'<strong>Paskelbti</strong> &mdash; Čia galite pakeisti savo įrašo publikavimo nustatymus. Norėdami pakeisti statusą, matomumą ir paskelbti, spustelėkite „Redaguoti“ nuorodą. Matomumo skiltyje galima nustatyti įrašo apsaugojimą slaptažodžiu arba prilipdyti įrašų sąrašo viršuje (sticky). Apsaugojimo slaptažodžiu funkcija leidžia atskiram įrašui nustatyti slaptažodį, kurį reikia įvesti, norint pamatyti įrašo turinį. Privatumo nustatymas paslepia įrašą nuo visų lankytojų, išskyrus redaktorius ir administratorius. Publikavimo nustatymas leidžia nustatyti praeities ar ateities datą ir laiką, taigi galite suplanuoti įrašą ateičiai, arba paskelbti atgaline data.','<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.'=>'<strong>Greitas juodraštis</strong> &mdash; šioje vietoje galite greitai užsirašyti mintis, kilusias naujam įrašui, ir išsaugoti jas kaip juodraštį. Čia taip pat rodomos nuorodos į 3 naujausius juodraščius.','<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.'=>'<strong>Greitasis redagavimas</strong> suteikia galimybę greitai pakeisti pagrindinę įrašo meta-informaciją, neišeinant iš šio puslapio.','<strong>Random:</strong> Show a different image on each page.'=>'<strong>Atsitiktinis:</strong> Rodyti skirtingą paveikslėlį kiekviename puslapyje.','<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using bulk actions.'=>'<strong>Šalinti</strong> funkcija pašalina vartotoją iš Jūsų tinklalapio. Tačiau jo sukurtas turinys išlieka. Taip pat galite pašalinti iš karto kelis vartotojus, naudojant Masinius veiksmus.','<strong>Requires:</strong> %s'=>'<strong>Reikalauja:</strong> %s','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong>Ekrano nustatymai</strong> &mdash; šiame skirtuke galite pasirinkti, kurios Skydelio skydelio sekcijos bus rodomos.','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.'=>'<strong>Siųsti citatas</strong> &mdash; citatos yra vienas iš būdų parodyti kitiems tinklalapiams, kad savo įrašuose dedate nuorodas į juos. Įveskite URL nuorodą(as), kur norite nusiųsti citatą(as). Jei dedate nuorodas į kitus WordPress tinklalapius, jiems bus automatiškai nusiųstas atgalinis pranešimas, taigi šio laukelio naudoti nereikia.','<strong>Send password reset</strong> sends the user an email with a link to set a new password.'=>'<strong>Siųsti slaptažodžio atkūrimą</strong> vartotojui siunčiamas el. laiškas su nuoroda nustatyti naują slaptažodį.','<strong>Session Tokens</strong> &mdash; User login information, IP Addresses, Expiration Date, User Agent (Browser/OS), and Last Login.'=>'<strong>Sesijos duomenys</strong> &mdash; Vartotojo prisijungimo informacija, IP adresai, galiojimo pabaigos data, vartotojo agentas (naršyklė / OS) ir paskutinis prisijungimas.','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>Nustatymai</strong> &mdash; šiame puslapyje pateikiamas sąrašas visų nustatymų susijusių su šiuo tinklalapiu. Kai kurie iš jų buvo sukurti WordPress, kiti - Jūsų aktyvuotų įskiepių. Pastebėkite, kad kai kurie laukai yra papilkėję ir rodo „Serializuoti duomenys“. Tokių reikšmių negalite redaguoti dėl to, kaip jos yra saugomos duomenų bazėje.','<strong>Share</strong> your knowledge in the WordPress support forums.'=>'<strong>Dalinkitės</strong> savo žiniomis WordPress pagalbos forumuose.','<strong>Site Health Status</strong> &mdash; Informs you of any potential issues that should be addressed to improve the performance or security of your website.'=>'<strong>Tinklalapio sveikatos statusas</strong> &mdash; praneša apie visas potencialias problemas, kurias reikėtų išspręsti siekiant geresnio našumo ir saugumo.','<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'<strong>Nuoroda (Slug)</strong> &mdash; tai interneto adresui pritaikyta pavadinimo versija. Ją paprastai sudaro tik mažosios raidės, skaičiai ir brūkšneliai.','<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.'=>'<strong>Šablonas</strong> &mdash; kai kurios temos turi daugiau nei vieną šabloną su tam tikromis savybėmis. Tokiu atveju galite pasirinkti, kokį išvaizdos šabloną norite naudoti puslapyje.','<strong>Test</strong> new releases and proposed features for the Block Editor.'=>'<strong>Testuokite</strong> naujas blokų redaktoriaus versijas ir siūlomas funkcijas.','<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.'=>'<strong>Tėvinė tema nerasta.</strong> Jei norite naudoti šią potemę, turite įdiegti tėvinę temą %s prieš aktyvuojant potemę.','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong>Temos ir įskiepiai</strong> &mdash; norėdami atnaujinti konkrečią temą arba įskiepį šiame puslapyje, pažymėkite juos varnelėmis, o tuomet <strong>paspauskite ant atitinkamo &#8220;Atnaujinti&#8221; mygtuko</strong>. Norėdami atnaujinti visas temas ir įskiepius iš karto, prieš spaudžiant šį mygtuką, pažymėkite varnelę pačiame sąrašo viršuje - tuomet bus pasirinktos visos temos ir įskiepiai.','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong>Temos</strong> &mdash; ši sritis rodo išvaizdos temas, kurios dar nėra įjungtos visam tinklui. Įjungiant temą šiame meniu ji tampa prieinama konkrečiam tinklalapiui, tačiau nėra aktyvuojama, tik rodoma tinklalapio Išvaizdos meniu. Jei norite jjungti temą visam tinklui, aplankykite <a href="%s">tinklo temų</a> skiltį.','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong>Pavadinimas</strong> &mdash; Įveskite įrašo pavadinimą. Kai tai padarysite, išvysite įrašo pastoviąją nuorodą, kurią galėsite redaguoti.','<strong>Translate</strong> WordPress into your local language.'=>'<strong>Verskite</strong> WordPress į savo kalbą.','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong>Vertimai</strong> &mdash; failai, kuriuose yra WordPress vertimas į Jūsų pasirinktą kalbą, atnaujinami kai tik atsiranda naujos jų versijos. Tačiau jei šie failai Jūsų tinklalapyje seni, Jūs galite <strong>paspausti &#8220;Atnaujinti vertimus&#8221;</strong> mygtuką.','<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.'=>'<strong>Perkelti į šiukšlinę</strong> - pašalina įrašą iš šio sąrašo ir perkelia jį į šiukšlinę, iš kur vėliau galite jį ištrinti galutinai. ','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong>Vartotojai</strong> &mdash; Čia matomi visi su jūsų svetaine susieti vartotojai]. Taip pat galite keisti jų rolę, slaptažodį ar pašalinti juos iš svetainės. Pašalinimas iš svetainės nepašalina vartotojo iš viso tinklo.','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong>Versijoje %1$s</strong> sutvarkyta %2$s klaida.' . "\0" . '<strong>Versijoje %1$s</strong> sutvarkytos %2$s klaidos.' . "\0" . '<strong>Versijoje %1$s</strong> sutvarkyta %2$s klaidų.','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong>Versijoje %1$s</strong> ištaisyta saugumo problema ir pašalinta %2$s klaida.' . "\0" . '<strong>Versijoje %1$s</strong> ištaisyta saugumo problema ir pašalintos %2$s klaidos.' . "\0" . '<strong>Versijoje %1$s</strong> ištaisyta saugumo problema ir pašalinta %2$s klaidų.','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong>Versijoje %1$s</strong> sustiprintas saugumas ir sutvarkyta %2$s klaida.' . "\0" . '<strong>Versijoje %1$s</strong> sustiprintas saugumas ir sutvarkytos %2$s klaidos.' . "\0" . '<strong>Versijoje %1$s</strong> sustiprintas saugumas ir sutvarkyta %2$s klaidų.','<strong>Version %s</strong> addressed one security issue.'=>'<strong>Versija %s</strong> ištaisė vieną saugumo spragą.','<strong>Version %s</strong> addressed some security issues.'=>'<strong>Versijoje %s</strong> ištaisytos kai kurios saugumo problemos.','<strong>View</strong> takes you to a public author archive which lists all the posts published by the user.'=>'<strong>Peržiūrėti</strong> nukreipia į viešą autoriaus archyvą, kuriame pateikiami visi vartotojo paskelbti įrašai.','<strong>View</strong> will take you to a public display page for that file.'=>'<strong>Peržiūrėti</strong> pateksite į viešai rodomą to failo puslapį.','<strong>Warning:</strong> Making changes to active plugins is not recommended.'=>'<strong>Perspėjimas:</strong> nerekomenduojama keisti aktyvaus įskiepio kodą.','<strong>Warning:</strong> This plugin <strong>has not been tested</strong> with your current version of WordPress.'=>'<strong>Dėmesio:</strong> Šis įskiepis <strong>nebuvo ištestuotas</strong> su dabartine jūsų WordPress versija.','<strong>Warning:</strong> these pages should not be the same as your Privacy Policy page!'=>'<strong>Įspėjimas:</strong> šie puslapiai neturėtų būti tokie patys, kaip Jūsų Privatumo politikos puslapis!','<strong>Warning:</strong> these pages should not be the same!'=>'<strong>DĖMESIO:</strong> šie puslapiai negali būti tokie pat!','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>Sveiki</strong> &mdash; čia pateikiamos nurodos, kurios Jums padės atlikti dažniausiai pasitaikiančias užduotis, kuriant naują tinklalapį.','<strong>WordPress Events and News</strong> &mdash; Upcoming events near you as well as the latest news from the official WordPress project and the <a href="%s">WordPress Planet</a>.'=>'<strong>WordPress renginiai ir naujienos</strong> &mdash; Artimiausi renginiai netoli Jūsų bei naujausios oficialios žinios iš WordPress ir <a href="%s">WordPress Planet</a>.','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>WordPress</strong> &mdash; WordPress atnaujinimas yra paprasta vienu mygtuko paspaudimu atliekama procedūra: tiesiog <strong>paspauskite ant &#8220;Atnaujinti dabar&#8221; mygtuko</strong>, kai tik pamatysite, kad yra išleista nauja versija. ','<strong>Write</strong> and submit patches to fix bugs or help build new features.'=>'<strong>Sudarykite</strong> ir pateikite kodo pataisas, kad ištaisytumėte klaidas arba padėtumėte sukurti naujas funkcijas.','<strong>Write</strong> or improve documentation for WordPress.'=>'<strong>Rašykite</strong> arba tobulinkite WordPress dokumentaciją.','A <a href="%s">static page</a> (select below)'=>'<a href="%s">Statinį puslapį</a> (jį pasirinkite žemiau)','A PHP session was created by a %1$s function call. This interferes with REST API and loopback requests. The session should be closed by %2$s before making any HTTP requests.'=>'PHP sesija buvo sukurta %1$s funkcijoje. Tai trukdo REST API. Sesija turėtų būti uždaryta naudojant %2$s prieš darant HTTP užklausas.','A block theme is a theme that uses blocks for all parts of a site including navigation menus, header, content, and site footer. These themes are built for the features that allow you to edit and customize all parts of your site.'=>'Blokus palaikanti tema naudoja blokus visoms tinklalapio dalims, įskaitant meniu, antraštę, poraštę, turinį. Tokios temos sukurtos taip, kad galėtumėte keisti bet kurią tinklalapio dalį.','A comment is held for moderation'=>'Kai komentaras sulaikomas, jį reikia patvirtinti','A new minor update is available for your site. Because minor updates often address security, it&#8217;s important to install them.'=>'Galimas naujas nedidelis atnaujinimas. Šie nedideli atnaujinimai dažnai skirti saugumo klaidoms ištaisyti, todėl svarbu juos įdiegti.','A new version of WordPress is available.'=>'Yra nauja WordPress versija.','A page cache plugin was detected.'=>'Aptiktas puslapio talpyklos (cache) įskiepis.','A page cache plugin was not detected.'=>'Puslapio talpyklos (cache) įskiepis neaptiktas.','A password reset link was emailed to %s.'=>'Slaptažodžio atstatymo nuoroda buvo išsiųsta %s.','A persistent object cache is being used'=>'Naudojama nuolatinė objektų talpykla (cache)','A persistent object cache is not required'=>'Nuolatinė objektų talpykla (cache) nereikalinga','A persistent object cache makes your site&#8217;s database more efficient, resulting in faster load times because WordPress can retrieve your site&#8217;s content and settings much more quickly.'=>'Pastovios objektų talpyklos dėka jūsų tinklapio duomenų bazė tampa labiau efektyvi, todėl puslapiai kraunasi greičiau, nes WordPress gali pasiekti tinklapio turinį ir nustatymus žymiai greičiau.','A plugin has prevented updates by disabling %s.'=>'Įskiepis blokuoja atnaujinimus, išjungdamas %s.','A post ID mismatch has been detected.'=>'Įrašo ID neatitikimas.','A post type mismatch has been detected.'=>'Įrašo tipo neatitikimas.','A previous automatic background update could not occur.'=>'Ankstesnis automatinis atnaujinimas nebuvo įvykdytas.','A previous automatic background update ended with a critical failure, so updates are now disabled.'=>'Ankstesnis automatinis atnaujinimas sukėlė kritinę klaidą, todėl automatiniai atnaujinimai šiuo metu yra išjungti.','A red bar on the left means the comment is waiting for you to moderate it.'=>'Raudonas brūkšnelis kairėje reiškia, kad komantaras laukia peržiūros.','A scheduled event has failed'=>'Suplanuotas veiksmas nebuvo įvykdytas','A scheduled event is late'=>'Suplanuotas veiksmas vėluoja','A test is unavailable'=>'Testo nėra','A valid email address must be given.'=>'Turite pateikti teisingą el.pašto adresą.','About Pages'=>'Apie puslapius','About Yourself'=>'Apie save','About the user'=>'Apie vartotoją','Accessibility Ready'=>'Paruoštos maksimaliam prieinamumui','Accessibility improvements'=>'Prieinamumo patobulinimai','Account Management'=>'Paskyros valdymas','Activate Plugin'=>'Įjungti įskiepį','Activate Plugin &amp; Go to Press This'=>'Aktyvuoti įskiepį ir grįžti į „Press This“','Activate Plugin &amp; Run Importer'=>'Aktyvuoti įskiepį ir paleisti importavimo įrankį','Activate Press This'=>'Aktyvuoti Press This','Active <span class="count">(%s)</span>'=>'Įjungti <span class="count">(%s)</span>' . "\0" . 'Įjungti <span class="count">(%s)</span>' . "\0" . 'Įjungti <span class="count">(%s)</span>','Active Installations:'=>'Aktyvių kopijų:','Active Plugins'=>'Įjungti įskiepiai','Active Theme'=>'Įjungta tema','Active editor'=>'Įjungtas redaktorius','Active plugin installations%s+ Million'=>'Daugiau nei %s milijonas' . "\0" . 'Daugiau nei %s milijonai' . "\0" . 'Daugiau nei %s milijonų','Active plugin installationsLess Than 10'=>'Mažiau nei 10','Activity'=>'Aktyvumas','Add Application Password'=>'Pridėti naują programėlės slaptažodį','Add Comment'=>'Pridėti komentarą','Add Custom Field'=>'Pridėti pasirinktinį lauką','Add Custom Field:'=>'Pridėti pasirinktinį lauką:','Add Data Erasure Request'=>'Nauja duomenų ištrynimo užklausa','Add Data Export Request'=>'Nauja duomenų eksporto užklausa','Add Existing User'=>'Pridėti esamą vartotoją','Add New Site'=>'Pridėti naują tinklalapį','Add Plugin'=>'Pridėti įskiepį','Add Plugins'=>'Pridėti įskiepius','Add Themes'=>'Pridėti temas','Add User'=>'Pridėti vartotoją','Add Widget'=>'Pridėti valdiklį','Add a new page'=>'Naujas puslapis','Add media files from your computer'=>'Failų, esančių kompiuteryje, įkėlimas','Add menu items'=>'Pridėkite meniu punktų','Add menu items from the column on the left.'=>'Pridėkite meniu punktus iš stulpelio kairėje.','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'Pridėkite vieną ar kelis punktus iš karto <strong>pažymėję varnelę šalia kiekvieno ir paspaudę "Pridėti į meniu</strong>','Add the user without sending an email that requires their confirmation'=>'Pridėti vartotoją nesiunčiant jam el.laiško su prašymu patvirtinti jo naująją paskyrą.','Add to: %s'=>'Pridėti į: %s','Add widget: %s'=>'Pridėti valdiklį: %s','Add, organize, and modify individual menu items'=>'Pridėti, perkelti ir pakeisti konkrečius meniu punktus','Added'=>'Pridėta','Adding Categories'=>'Pridedamos kategorijos','Adding Plugins'=>'Pridedami įskiepiai','Adding Tags'=>'Pridedamos žymos','Adding Themes'=>'Pridedamos temos','Additional Capabilities'=>'Papildomos galimybės','Additional information'=>'Papildoma informacija','Additional plugins are required'=>'Reikalingi papildomi įskiepiai','Additional settings'=>'Papildomi nustatymai','Admin Color Scheme'=>'Administravimo aplinka','Administration Email Address'=>'Administratoriaus el.paštas','Administrators have access to all the administration features.'=>'Administratorius turi visas administravimo galimybes.','Advanced caching plugin.'=>'Advanced caching plugin.','After typing in your edits, click Update File.'=>'Atlikę pakeitimus, nepamirškite paspausti „Atnaujinti failą“.','After you&#8217;ve done that, click &#8220;Run the installation&#8221;.'=>'Kai tai padarysite, paspauskite mygtuką "Įdiegti"','After your Privacy Policy page is set, you should edit it.'=>'Nustatę savo privatumo politkos puslapį, redaguokite jo turinį.','All'=>'Visi','All Comments'=>'Visi komentarai','All Settings'=>'Visos nuostatos','All Tabs:'=>'Visos kortelės:','All Types'=>'Visi tipai','All Users'=>'Visi vartotojai','All automatic updates are disabled.'=>'Visi automatiniai atnaujinimai yra išjungti.','All categories'=>'Visos kategorijos','All comment types'=>'Visi komentarų tipai','All content'=>'Visas turinys','All formats'=>'Visi formatai','All image sizes'=>'Visi paveikslėlių dydžiai','All of your WordPress files are writable.'=>'Visi Jūsų WordPress failai gali būti įrašomi.','All right, sparky! You&#8217;ve made it through this part of the installation. WordPress can now communicate with your database. If you are ready, time now to&hellip;'=>'Puiku! Šis instaliavimo etapas baigtas. WordPress jau sujungtas su duomenų baze. Jei esate pasiruošęs, dabar laikas&hellip;','All selected plugins are up to date.'=>'Visi pasirinkti įskiepiai yra naujausios versijos.','All sizes except thumbnail'=>'Visi dydžiai, išskyrus miniatiūrą','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first.'=>'Visi failai, kuriuos įkeliate, yra rodomi Failų saugykloje, naujausi įkelti failai rodomi pirmiau.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first. You can use the Screen Options tab to customize the display of this screen.'=>'Visi failai, kuriuos įkėlėte į Failų Saugyklą, rodomi nuo naujausio. Šio ekrano vaizdą galite keisti naudodami skiltį "Ekrano nustatymai".','All updates have been completed.'=>'Visi atnaujinimai baigti.','Allow'=>'Leisti','Allow <a href="%s">trackbacks and pingbacks</a>'=>'Leisti <a href="%s">atgalines citatas ir atgalines nuorodas</a>','Allow Comments'=>'Leisti komentarus','Allow Pings'=>'Leisti pranešimus','Allow automatic database repair'=>'Leisti automatiškai taisyti duomenų bazę','Allow comments'=>'Leisti komentuoti','Allow link notifications from other blogs (pingbacks and trackbacks) on new posts'=>'Leisti nuorodų pranešimus iš kitų tinklalapių (atgalinius pranešimu ir atgalines nuorodas) naujuose įrašuose','Allow people to submit comments on new posts'=>'Leisti lankytojams komentuoti naujuose įrašuose','Allow search engines to index this site'=>'Leisti paieškos sistemoms indeksuoti šį tinklalapį','Already pinged:'=>'Jau pranešta apie citavimą:','Alt text for the image, e.g. &#8220;The Mona Lisa&#8221;'=>'Tekstas, kuris bus rodomas, jei nepavyks parodyti šio paveikslėlio','Alternately, you can browse the themes that are Popular or Latest. When you find a theme you like, you can preview it or install it.'=>'Taip pat galite naršyti temose, kurios yra Siūlomos, Populiarios arba Naujausios. Kai pamatysite temą, kuri Jums patinka, galite ją peržiūrėti arba instaliuoti.','Always use https when visiting the admin'=>'Kai einate į administravimo sąsają, visada naudokite https','American English'=>'Amerikos anglų kalba','An HTTPS connection is a more secure way of browsing the web. Many services now have HTTPS as a requirement. HTTPS allows you to take advantage of new features that can increase site speed, improve search rankings, and gain the trust of your visitors by helping to protect their online privacy.'=>'HTTPS yra saugesnis būdas naršyti internete. Daugelis paslaugų dabar reikalauja HTTPS. HTTPS leidžia Jums naudotis naujomis funkcijomis, kurios leidžia pagreitinti tinklalapį, pagerinti pozicijas paieškoje ir įgyti lankytojų pasitikėjimą, padedant saugoti jų privatumą internete.','An active PHP session was detected'=>'Rasta aktyvi PHP sesija','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'Iš Jūsų el.pašto adreso gali būti sugeneruotas anonimizuotas duomenų įrašas (angl. hash)  ir pateiktas Gravatar paslaugos teikėjui, norint patikrinti, ar Jūs naudojatės šia paslauga. Gravatar privatumo politika pateikiama čia: https://automattic.com/privacy/. Patvirtinus Jūsų komentarą, Jūsų profilio nuotrauka yra matoma viešai šalia Jūsų komentaro.','An application would like to connect to your account.'=>'Aplikacija norėtų prisijungti prie jūsų paskyros.','An attempt was made, but your site could not be updated automatically.'=>'Jūsų tinklalapio automatiškai atnaujinti nepavyko.','An automated WordPress update has failed to complete - <a href="%s">please attempt the update again now</a>.'=>'An automated WordPress update has failed to complete - <a href="%s">please attempt the update again now</a>.','An automated WordPress update has failed to complete! Please notify the site administrator.'=>'An automated WordPress update has failed to complete! Please notify the site administrator.','An avatar is an image that can be associated with a user across multiple websites. In this area, you can choose to display avatars of users who interact with the site.'=>'Pseudoportretas (avataras) yra paveikslėlis, susietas su vartotoju skirtinguose tinklalapiuose. Čia galite pasirinkti, ar norite rodyti vartotojų pseudoportretus savo tinklalapyje.','An error occurred during the upload process.'=>'Įkėlimo proceso metu įvyko klaida.','An error occurred while processing your header image.'=>'Apdorojant antraštės paveikslėlį įvyko klaida.','An error occurred while updating %1$s: %2$s'=>'Įvyko klaida atnaujinant %1$s: %2$s','An error occurred. Please try again.'=>'Įvyko klaida. Pabandykite dar kartą.','An exporter has improperly used the registration filter.'=>'An exporter has improperly used the registration filter.','An updated version of WordPress is available.'=>'Yra nauja WordPress versija.','Analytics'=>'Statistika','And much more'=>'Ir dar daugiau','Another attempt will be made with the next release.'=>'Kitas bandymas bus atliktas su kita versija.','Another update is currently in progress.'=>'Šiuo metu vyksta kitas atnaujinimas.','Any edits to files from this screen will be reflected on all sites in the network.'=>'Čia esančių failų redagavimas turės įtakos visiems tinkle esantiems tinklalapiuose.','Anyone can register'=>'Visi gali registruotis','Anyone posts a comment'=>'Kai kas nors parašo komentarą','Application Attachment Template'=>'Programėlės failo šablonas','Application Passwords'=>'Aplikacijų slaptažodžiai','Application passwords allow authentication via non-interactive systems, such as XML-RPC or the REST API, without providing your actual password. Application passwords can be easily revoked. They cannot be used for traditional logins to your website.'=>'Aplikacijų slaptažodžiai leidžai auteintifikuoti ne interaktyvioms sistemoms, tokioms kaip XML-RPC ar REST API, neduodant joms tikrojo jūsų paskyros slaptažodžio. Aplikacijų slaptažodžiai yra lengvai atšaukiami ir negali būti naudojami prisijungti prie Jūsų svetainės tradiciniu būdu.','Application passwords grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'Tai duos aplikacijai leidimą prieiti prie  <a href="%1$s">%2$s tinklalapio šioje sistemoje, kur turite prieigos teises</a>.' . "\0" . 'Tai duos aplikacijai leidimą prieiti prie  <a href="%1$s">%2$s tinklalapių šioje sistemoje, kur turite prieigos teises</a>.' . "\0" . 'Tai duos aplikacijai leidimą prieiti prie  <a href="%1$s">%2$s tinklalapių šioje sistemoje, kur turite prieigos teises</a>.','Application passwords grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'Programėlių slaptažodžiai suteikia prieigą prie <a href="%1$s">%2$s tinklalapio tinkle, nes turite superadministratoriaus teises</a>.' . "\0" . 'Programėlių slaptažodžiai suteikia prieigą prie <a href="%1$s">%2$s tinklalapių tinkle, nes turite superadministratoriaus teises</a>.' . "\0" . 'Programėlių slaptažodžiai suteikia prieigą prie <a href="%1$s">%2$s tinklalapių tinkle, nes turite superadministratoriaus teises</a>.','Apply Crop'=>'Apkirpti','Apply Filters'=>'Filtruoti','Apply changes to:'=>'Kam pritaikyti pakeitimus:','Apply your skills or learn new ones.'=>'Pritaikykite savo įgūdžius arba išmokite naujų.','Approve'=>'Patvirtinti','Approve comment'=>'Patvirtinti komentarą','Approve this comment'=>'Patvirtinti komentarą','Approved'=>'Patvirtinti','Are pretty permalinks supported?'=>'Ar palaikomos gražios nuorodos?','Are you sure you want to delete these files and data?'=>'Ar jūs tikrai norite ištrinti šiuos failus ir duomenis?','Are you sure you want to delete these files?'=>'Ar tikrai norite ištrinti šiuos failus?','Are you sure you want to delete this theme?

