Dėkojame! -- WordPress komanda','Background RepeatRepeat'=>'Kartojimas','Background ScrollScroll'=>'Slinktis','Background updated. <a href="%s">Visit your site</a> to see how it looks.'=>'Fonas atnaujintas. <a href="%s">Peržiūrėkite, kaip atrodo jūsų tinklalapis</a>.','Background updates'=>'Automatiniai atnaujinimai','Background updates are not working as expected'=>'Automatiniai atnaujinimai neveikia tinkamai','Background updates are working'=>'Automatiniai atnaujinimai veikia','Background updates ensure that WordPress can auto-update if a security update is released for the version you are currently using.'=>'Automatiniai atnaujinimai užtikrina, kad WordPress gali pats automatiškai atsinaujinti, jei išleidžiamas naujas saugumo atnaujinimas tai versijai, kurią Jūs naudojate.','Background updates may not be working properly'=>'Automatiniai atnaujinimai gali neveikti tinkamai','Be part of a global open source community.'=>'Tapkite pasaulinės atvirojo kodo bendruomenės dalimi.','Be sure to save this in a safe location. You will not be able to retrieve it.'=>'Būtinai saugokite tai saugioje vietoje. Neturėsite galimybės vėl jo gauti.','Be the future of WordPress'=>'Tapkite WordPress ateitimi','Because this is a multisite installation, you may add accounts that already exist on the Network by specifying a username or email, and defining a role. For more options, such as specifying a password, you have to be a Network Administrator and use the hover link under an existing user&#8217;s name to Edit the user profile under Network Admin > All Users.'=>'Kadangi tai multitinklalapio instaliacija, Jūs galite pridėti paskyras kurios jau egzistuoja tinkle, nurodydami vartotojo vardą arba el.paštą arba pasirinkę rolę. Norėdami matyti daugiau nustatymų, kaip pavyzdžiui slaptažodžių pakeitimą, Jūs turite būti Tinklo administratorius, tuomet puslapyje Tinklo Administravimas > Visi vartotojai, užėję pele virš vartotojo vardo, matysite nuorodą Redaguoti.','Before a comment appears'=>'Komentarų paskelbimas viešai','Before getting started'=>'Prieš pradedant','Before you can upload your import file, you will need to fix the following error:'=>'Prieš įkeliant importavimo failą, reikia ištaisyti šią klaidą:','Begin by choosing a theme to edit from the dropdown menu and clicking the Select button. A list then appears of the theme&#8217;s template files. Clicking once on any file name causes the file to appear in the large Editor box.'=>'Pirmiausiai pasirinkite išvaizdos temą, kurią norite redaguoti, ir paspauskite mygtuką „Pasirinkti“. Išvysite įvairius temos failus, spragtelėkite pele ant kurio nors iš jų ir redaguokite.','Below you should enter your database connection details. If you are not sure about these, contact your host.'=>'Laukeliuose žemiau Jūs turite įvesti duomenų bazės duomenis. Jei jų nežinote, ar nesate tikri, reiktų susisiekti su savo tinklalapio prieglobos (hostingo) tiekėju.','Biographical Info'=>'Biografinė informacija','Blank'=>'Tuščias','Block Editor Patterns'=>'Blokų redaktoriaus šablonai','Block Editor Styles'=>'Blokų redaktoriaus stiliai','Block patterns are pre-configured block layouts. Use them to get inspired or create new pages in a flash.'=>'Blokų modeliai - tai iš anksto sukonfigūruoti blokų išdėstymai. Naudokite juos norėdami pasisemti įkvėpimo arba akimirksniu sukurti naujus puslapius.','Block themes'=>'Blokus palaikančios temos','Blog'=>'Tinklaraštis','Blog pages show at most'=>'Tinklaraščio puslapiuose rodoma daugiausiai:','Blogger'=>'Blogger','Both WordPress URL and site URL can start with either %1$s or %2$s. A URL starting with %2$s requires an SSL certificate, so be sure that you have one before changing to %2$s. With %2$s, a padlock will appear next to the address in the browser address bar. Both %2$s and the padlock signal that your site meets some basic security requirements, which can build trust with your visitors and with search engines.'=>'Ir WordPress URL, ir tinklalapio URL gali prasidėti %1$s arba %2$s. URL, prasidedančiam %2$s, reikalingas SSL sertifikatas, todėl prieš keisdami į %2$s įsitikinkite, kad jį turite. Naudojant %2$s, naršyklės adreso eilutėje šalia adreso bus rodoma spynelė. Ir %2$s, ir spynelė reiškia, kad jūsų tinklalapis atitinka tam tikrus pagrindinius saugumo reikalavimus, o tai gali padidinti lankytojų ir paieškos sistemų pasitikėjimą.','Bring back this update'=>'Sugrąžinti šį atnaujinimą','British English'=>'Britų anglų kalba','Broken Themes'=>'Sugadintos temos','Browse Plugins'=>'Naršyti įskiepius','Browse revisions'=>'Peržiūrėti versijas','Browsing %s (active)'=>'Peržiūrimas %s (aktyvus)','Browsing %s (inactive)'=>'Peržiūrimas %s (neaktyvus)','Bulk Edit'=>'Masinis redagavimas','Bulk Select'=>'Masinis pasirinkimas','Bulk actions'=>'Masiniai veiksmai','Button label for a next revisionNext'=>'Kita','Button label for a previous revisionPrevious'=>'Ankstesnis','By %s.'=>'Sukūrė: %s.','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'Standartiškai, WordPress nerenka jokių statistinių duomenų. Tačiau dauguma hostingo tiekėjų renka anonimizuotą statistiką. Taip pat, Jūs galite naudoti WordPress įskiepius kurie teikia statistikos rinkimo paslaugą. Tokiu atveju, turite apie tai surašyti čia.','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'Standartiškai, WordPress nerenka jokių asmeninių duomenų apie lankytojus, o saugo tik duomenis, kuriuos savo paskyroje pateikia registruoti vartotojai. Tačiau kai kurie iš Jūsų naudojamų įskiepių gali rinkti asmeninius duomenis. Jūs turite apie tai informuoti aprašydami šiame skyriuje.','By default WordPress does not share any personal data with anyone.'=>'Standartiškai, WordPress nesidalina jokiais asmeniniais duomenimis su niekuo.','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'Standartiškai, WordPress instaliacijoje nėra kontaktų formos. Jei naudojate kontaktų formos įskiepį, šiame poskyryje aprašykite, kokius asmeninius duomenis išsaugote, kai kas nors užpildo kontaktų formą, ir kiek laiko juos saugote. Pavyzdžiui, galite parašyti, kad kontaktų forma pateiktus duomenis saugote konkretų laiko tarpą dėl klientų aptarnavimo tikslų, tačiau nenaudojate šių duomenų marketingo tikslais.','By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you do not want to send the new user a welcome email.'=>'Pagal numatytus nustatymus, naujiems vartotojams siunčiamas el. laiškas, pranešantis, kad jie buvo pridėti į Jūsų tinklalapį. Šiame laiške taip pat pateikiama slaptažodžio atstatymo nuoroda. Nuimkite šią varnelę, jei nenorite naujiems vartotojams siųsti tokio laiško.','CSS Classes (optional)'=>'CSS klasės (nebūtina)','Can anyone register on this site?'=>'Ar gali bet kas norintis registruotis šiame tinklalapyje?','Can communicate with WordPress.org'=>'Gali prisijungti prie WordPress.org','Cancel Editing'=>'Atšaukti redagavimą','Cancel and go back'=>'Atšaukti ir grįžti','Cancel password change'=>'Atšaukti slaptažodžio pakeitimą','Cannot Authorize Application'=>'Nepavyksta autorizuoti aplikacijos','Cannot load %s.'=>'Nepavyksta įkelti %s.','Cannot load image metadata.'=>'Nepavyksta įkelti paveikslėlio metaduomenų.','Cannot save image metadata.'=>'Nepavyko išsaugoti paveikslėlio metaduomenų.','Cannot send password reset, permission denied.'=>'Negalima išsiųsti slaptažodžio atstatymo, nesuteiktas leidimas.','Capabilities'=>'Galimybės','Categories and Tags Converter'=>'Kategorijų ir žymų konvertavimo įrankis','Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.'=>'Kategorijos pasirinktinai gali būti konvertuojamos į žymas, naudojant <a href="%s">tam skirtą įrankį</a>.','Categories deleted.'=>'Kategorijos ištrintos.','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'Kategorijos yra hierarchiškos, tai reiškia, kad jos gali turėti sub-kategorijas. Žymos nėra hierarchiškos ir negali turėti lygių. Kartais įrašuose pradedama naudoti kategorijos, o po to suvokiama, kad žymos būtų tiksliau (arba atvirkščiai).','Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have children categories for Bebop and Big Band. Totally optional.'=>'Kategorijos, skirtingai nei žymos, gali turėti hierarchiją. Pvz., galite turėti tėvinę kategoriją „Muzika“ ir jai priskirti tokias subkategorijas kaip „Metalas“, „Klasikinė muzika“ ir pan.','Categories:'=>'Kategorijos:','Category Template'=>'Kategorijos šablonas (template)','Category added.'=>'Kategorija pridėta.','Category base'=>'Kategorijų priešdėlis','Category deleted.'=>'Kategorija ištrinta.','Category not added.'=>'Kategorija nepridėta.','Category not updated.'=>'Kategorija neatnaujinta.','Category updated.'=>'Kategorija atnaujinta.','Caution:'=>'Dėmesio:','Change Permalink Structure'=>'Keisti pastoviųjų nuorodų dalių (permalink) struktūrą','Change Site Icon'=>'Pakeisti tiklalapio piktogramą','Change role to&hellip;'=>'Pakeisti rolę į&hellip;','Change your Privacy Policy page'=>'Pakeiskite privatumo politikos puslapį','Changed roles.'=>'Pakeistos rolės.','Changes saved.'=>'Pakeitimai išsaugoti.','Changing to %s'=>'Keičiama į %s','Check again.'=>'Tikrinti dar kartą','Check for updates manually'=>'Neautomatinis naujų versijų tikrinimas','Check secret keys'=>'Patikrinkite slaptuosius raktus','Choose Image'=>'Pasirinkti paveikslėlį','Choose a Background Image'=>'Pasirinkite fono paveiksliuką','Choose a Custom Header'=>'Pasirinkti savo antraštę','Choose a Site Icon'=>'Pasirinkite tiklalapio piktogramą','Choose a file from your computer:'=>'Pasirinkite failą iš kompiuterio:','Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Do not forget to save your changes (Update File) when you are finished.'=>'Žemiau pasirinkite norimą redaguoti įskiepį ir paspauskite mygtuką „Pasirinkti“. Vėliau pasirinkite, kurį įskiepio failą norite redaguoti. Baigę redagavimą nepamirškite paspausti mygtuko „Atnaujinti failą“.','Choose an image from your computer:'=>'Pasirinkite paveikslėlį iš savo kompiuterio:','Choose either a city in the same timezone as you or a %s (Coordinated Universal Time) time offset.'=>'Pasirinkite miestą, kuris yra Jūsų laiko zonoje, arba skirtumą nuo %s (Universaliojo laiko).','Choose the part of the image you want to use as your header.'=>'Pasirinkite paveikslo dalį, kurią norite naudoti savo antraštėje.','Choose the target frame for your link.'=>'Pasirinkite, kaip bus atidaroma ši nuoroda.','Choose what to export'=>'Pasirinkite, ką eksportuoti','Cincinnati'=>'Kaunas','City:'=>'Miestas:','Clear Crop'=>'Tvarkyti apkirpimą','Clear Inactive Widgets'=>'Išvalyti neaktyvius valdiklius','Clear List'=>'Išvalyti sąrašą','Clear current filters'=>'Išvalyti pasirinktus filtrus','Click Customize for the active theme or Live Preview for any other theme to see a live preview'=>'Paspauskite ant "Keisti" aktyv