###SITEURL###','However, it is your responsibility to use those resources correctly, to provide the information that your privacy policy requires, and to keep that information current and accurate.'=>'Tačiau tik Jūs pats esate atsakingas už šių rekomendacijų teisingą panaudojimą, būtinos privatumo politikai informacijos pateikimą bei jos tikslumo ir naujumo palaikymą.','However, your WordPress Address is currently controlled by a PHP constant and therefore cannot be updated. You need to edit your %1$s and remove or update the definitions of %2$s and %3$s.'=>'Tačiau šiuo metu jūsų WordPress adresą nustato PHP konstanta, todėl jo atnaujinti negalima. Turite redaguoti savo %1$s failą ir pašalinti arba atnaujinti %2$s ir %3$s.','I understand'=>'Aš suprantu','I\'m sure I want to permanently delete my site, and I am aware I can never get it back or use %s again.'=>'Aš tikrai noriu negrįžtamai išjungti savo tinklalapį ir man yra žinoma, kad niekada negalėsiu jo atgauti ar vėl naudoti %s.','ID #%1$s: %2$s'=>'ID #%1$s: %2$s','ID #%1$s: %2$s <strong>Sorry, you are not allowed to remove this user.</strong>'=>'Vartotojo ID #%1$s: %2$s <strong>Deja, Jūs negalite pašalinti šio vartotojo.</strong>','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'ID #%1$s: %2$s <strong>Esamas vartotojas nebus ištrintas.</strong>','Identicon (Generated)'=>'Identicon','If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.'=>'Jei failas nepriskirtas jokiam įrašui, tai matysite stulpelyje "Priskirta prie" bei galėsite paspausti ant nuorodos "Priskirti failą" - tuomet atsiras nedidelis atskiras langas kuriame galėsite surasti reikiamą įrašą ir jam priskirti failą.','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'Jei galimas atnaujinimas, įrankių juostoje ir meniu matysite pranešimą apie tai.','If desired, WordPress will automatically alert various services of your new posts.'=>'Jei pageidaujate, WordPress automatiškai praneš įvairiems servisams apie jūsų naujus įrašus.','If for any reason this automatic file creation does not work, do not worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.'=>'Jei dėl kokių nors priežasčių automatinis failo sukūrimas neveikia, nesijaudinkite. Šis procesas tiesiog užpildo konfiguracijos failą informaciją apie jūsų duomenų bazę. Galite tiesiog atsidaryti %1$s failą teksto redaktoriumi, užpildyti reikiama informacija ir išsaugoti jį kaip %2$s.','If something goes wrong with a plugin and you cannot use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.'=>'Jeigu dėl kurio nors įskiepio kiltų problemų ir negalėtumėte naudotis WordPress, ištrinkite arba pervadinkite tą failą %s kataloge ir įskiepis bus automatiškai išjungtas.','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'Jei Jums reikiamas importeris čia nenurodytas, <a href="%s">ieškokite įskiepių kataloge</a>.','If the link is to a person, you can specify your relationship with them using the above form. If you would like to learn more about the idea check out <a href="https://gmpg.org/xfn/">XFN</a>.'=>'Jei nuoroda veda į asmens interneto puslapį, viršuje galite nurodyti ryšį su juo. Jei norite apie tai sužinoti daugiau, pasidomėkite <a href="https://gmpg.org/xfn/">XFN</a>.','If this is a development website, you can <a href="%s">set the environment type accordingly</a> to enable application passwords.'=>'Jei tai yra demo/dev tinklalapis ar aplinka, galite <a href="%s" target="_blank">nustatyti tokį tinklalapio/aplinkos tipą</a> ir įjungti programėlių slaptažodžius.','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'Jei jums būtina tiesiogiai redaguoti įskiepio kodą, būtinai sukurkite įskiepio kopiją kitu vardu ir pasilaikykite originalią versija. Tuo atveju, galėsite įjungti veikiančią kopiją, jei kas nors nutiks.','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'Jei jau turite privatumo politikos puslapį, pasirinkite jį žemiau. Jei neturite, sukurkite.','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'Jei Jūsų veiklos sritis yra reguliuojama valstybės, arba Jums galioja papildomi privatumo įstatymai, galite tokią informaciją pateikti čia.','If you are looking to use the link manager, please install the <a href="%s">Link Manager plugin</a>.'=>'Jei norite naudotis nuorodų valdymo įrankiu, prašome instaliuoti įskiepį <a href="%s">Nuorodų valdymas</a>.','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Eraser tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'Jei nesate tikri, patikrinkite įskiepio dokumentaciją arba susisiekite su įskiepio autoriumi ir sužinokite, ar įskiepis renka duomenis ir ar palaiko duomenų trynimo įrankį. Ši informacija gali būti pateikta <a href="%s">Privatumo politikos vadove</a>.','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Exporter tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'Jei nesate tikri, patikrinkite įskiepio dokumentaciją arba susisiekite su įskiepio autoriumi ir sužinokite, ar įskiepis renka duomenis ir ar palaiko duomenų eksporto įrankį. Ši informacija gali būti pateikta <a href="%s">Privatumo politikos vadove</a>.','If you are still seeing this warning after having tried the actions below, you may need to contact your hosting provider for further assistance.'=>'Jei išbandę toliau nurodytus veiksmus vis dar matote šį įspėjimą, gali tekti kreiptis į prieglobos paslaugų (hosting) teikėją dėl tolesnės pagalbos.','If you change this, an email will be sent at your new address to confirm it. <strong>The new address will not become active until confirmed.</strong>'=>'Jei pakeisite tai, Jums bus išsiųstas el.laiškas į naują el.paštą, kad jį patvirtintumėte. <strong>Naujas el. pašto adresas nebus aktyvuotas, kol jo nepatvirtinsite.</strong>','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'Jei vistik nuspręsite redaguoti kodo failus, būtinai sukurkite įskiepio ar temos kopiją kitu vardu ir pasilaikykite originalią versija. Tuo atveju, galėsite įjungti veikiančią kopiją, jei kas nors nutiks.','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'Trinant nuorodą, ji pašalinama negrįžtamai. Nuorodos kol kas nėra perkeliamos į šiukšlinę.','If you do code, or want to learn how, you can contribute technically in numerous ways:'=>'Jei programuojate arba norite išmokti programuoti, galite prisidėti tokiais būdais:','If you do not remember your credentials, you should contact your web host.'=>'Jei neatsimenate savo duomenų, kreipkitės į talpinimo paslaugų teikėją.','If you do not want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.'=>'Jei nenorite jokio antraštės paveikslėlio, paspauskite mygtuką "Pašalinti antraštės paveikslėlį" pačioje šio puslapio apačioje. Jei norėsite vėliau visgi jį įjungti, tereikės pasirinkti paveikslėlį ir paspausti ant "Išsaugoti pokyčius".','If you do not want to upload your own image, you can use one of these cool headers, or show a random one.'=>'Jei jūs nenorite įkelti savo paveikslėlio, galite pasirinkti vieną iš šių šaunių antraščių arba rodyti atsitiktinę.','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'Jei tinklalapis %s Jums jau nebereikalingas, galite jį ištrinti užpildydami žemiau esančią formą. Kai paspausite <strong>Ištrinti tinklalapį</strong>, Jums bus išsiųstas el. laiškas su nuoroda. Paspauskite tą nuorodą, ir tinklalapis bus ištrintas.','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'Jei redaguojate ar paskelbiate įrašą, Jūsų naršyklėje išsaugomas papildomas slapukas. Šis slapukas nesaugo asmeninių duomenų, tačiau išsaugo įrašo, kurį ką tik redagavote ar paskelbėti, ID. Šis slapukas baigia galioti po 1 dienos.','If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.'=>'Jei kažkas neveikia arba reikia pagalbos, Jums gali padėti savanoriai WordPress.org forume.','If you have a plugin in a .zip format, you may install or update it by uploading it here.'=>'Jei turite į .zip archyvą patalpintą įskiepį, čia galite jį įkelti.','If you have a theme in a .zip format, you may install or update it by uploading it here.'=>'Čia galite įdiegti į .zip archyvą patalpintą išvaizdos temą.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'Jei Jūs turite paskyrą šiame tinklalapyje, arba kada nors rašėte čia komentarą, galite reikalauti gauti duomenų eksporto failą su visais asmeniniais duomenimis, kuriuos mes turime apie Jus, įskaitant ir tuos, kuriuos pats mums pateikėte. Jūs taip pat galite reikalauti, kad mes ištrintume visus mūsų turimus Jūsų asmeninius duomenis. Šie abu reikalavimai negalioja duomenims, kuriuos mes privalome išsaugoti pagal įstatymą administraciniams, teisiniams ar saugumo tikslams.','If you have marked plugins as favorites on WordPress.org, you can browse them here.'=>'Jei esate pasižymėję įskiepius kaip mėgstamiausius WordPress.org kataloge, čia galite juos peržiūrėti.','If you have marked themes as favorites on WordPress.org, you can browse them here.'=>'Jeigu esatę pažymėję temas kaip mėgstamas WordPress.org, čia galite jas peržiūrėti.','If you have not yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started'=>'Jei dar nesukūrėte nei vieno meniu, paspauskite ant <strong>&#8217;sukurti naują meniu&#8217; nuorodos</strong> ir pradėkite','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'WordPress gali importuoti įrašus ir komentarus iš kitų jūsų tinklalapių. Žemiau pasirinkite seniau naudotą sistemą:','If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.'=>'Jei tik norite suprasti, kas rodoma šiame puslapyje, galite peržiūrėti Geriausius ir Populiariausius įskiepius, paspaudę atitinkamas nuorodas puslapio viršuje. Įskiepiai šiuose sąrašuose nuolat atnaujinami.','If you know what you are looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.'=>'Jei tiksliai žinote, ko ieškote, naudokitės Paieškos funkcija. Paieškos ekrane galėsite ieškoti WordPress.org įskiepių kataloge pagal konkretų raktažodį, autorių ar žymą. Taip pat galite ieškoti pasirinkdami iš populiariausių žymų. Kuo didesniu šriftu rodoma žyma, tuo daugiau yra įskiepių, ja pažymėtų.','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'Kai Jūs rašote komentarą šiame tinklalapyje, Jūs galite pasirinkti, ar norite, kad Jūsų vardas, el.paštas ir tinklalapis būtų išsaugotas slapukuose. Taip daroma Jūsų patogumui, kad Jums nereikėtų šių duomenų suvedinėti iš naujo, kiekvieną kartą kai komentuojate. Šie slapukai saugomi vienerius metus.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'Jei parašote komentarą, jo tekstas ir metaduomenys yra saugomi neribotą laiką. Taip daroma todėl, kad galėtume atpažinti ir patvirtinti ateities komentarus automatiškai, vietoje administratoriaus patvirtinimo.','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'Jei norite, čia galite įvesti savo sugalvotas kategorijų ir žymų nuorodų URL struktūras. Pavyzdžiui, jei įvesite, kad Jūsų kategorijų bazinė nuoroda vadinsis <code>tema</code>, Jūsų kategorijų nurodos bus <code>%s/tema/temos-pavadinimas/</code>. Jei šių laukelių nepildysite, bus naudojami numatytieji nustatymai.','If you need to tweak more than your theme&#8217;s CSS, you might want to try <a href="%s">making a child theme</a>.'=>'Jeigu reikia taisyti daugiau nei jūsų išvaizdos temos CSS stilius, pasvarstykite apie <a href="%s">išvaizdos potemės kūrimą</a>.','If you notice &#8220;headers already sent&#8221; messages, problems with syndication feeds or other issues, try deactivating or removing this plugin.'=>'Jei pastebėsite klaidos žinutę &#8220;headers already sent&#8221;, problemas su RSS ar kitokias panašias problemas, pabandykite šį įskiepį išjungti arba pašalinti.','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.'=>'Jei pasirinksite bet kurią struktūrą išskyrus „Paprastą“, jos šablonas su struktūros žymomis (terminai, pažymėti %s simboliais iš abiejų pusių) bus rodomas ties laukeliu „Pasirinktinė“. Ten ją galėsite toliau redaguoti.','If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.'=>'Jei atsidūrėte čia atsitiktinai arba norėjote aplankyti vieną iš savo tinklalapių, štai keletas nurodų, kurios padės rasti tai, ko ieškote.','If you request a password reset, your IP address will be included in the reset email.'=>'Jeigu prašysite atstatyti slaptažodį, Jūsų IP adresas bus įtrauktas į atstatymo el. pašto laišką.','If you temporarily make your %s file writable to generate rewrite rules automatically, do not forget to revert the permissions after the rule has been saved.'=>'Jei laikinai padarysite savo %s failą įrašomą ir leisite sugeneruoti nuorodų taisykles automatiškai, nepamirškite atšaukti leidimą, kai taisyklės bus išsaugotos.','If you temporarily make your site&#8217;s root directory writable to generate the %s file automatically, do not forget to revert the permissions after the file has been created.'=>'Jei laikinai padarysite savo tinklalapio pagrindinį katalogą įrašomą ir leisite sugeneruoti %s failą automatiškai, nepamirškite atšaukti leidimą, kai failas bus sukurtas.','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'Jei įkeliate nuotraukas į tinklalapį, turėtumėte vengti įkelti jas su išsaugotais vietovės duomenimis (EXIF GPS). Tinklalapio lankytojai gali parsisiųsti nuotraukas iš tinklalapio ir iš jų išgauti vietovės duomenis.','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'Jei Jūsų tinklalapis yra komercinis ir Jūs naudojate sudėtingesnius vartotojų duomenų rinkimo ar apdorojimo būdus, privalote tai aprašyti savo privatumo politikoje, papildomai šalia visko, ką rekomenduojame.','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'Jei Jūs turite paskyrą ir prisijungiate mūsų tinklalapyje, mes sukuriame laikiną slapuką, kuriame įrašoma, ar Jūsų naršyklė priima slapukus. Šis slapukas nesaugo jokios asmeninės informacijos ir yra ištrinamas kai uždarote savo naršyklę.','If you want site visitors to be able to register themselves, check the membership box. If you want the site administrator to register every new user, leave the box unchecked. In either case, you can set a default user role for all new users.'=>'Jei norite, kad tinklalapio lankytojai galėtų užsiregistruoti patys, pažymėkite narystės langelį. Jei norite, kad tinklalapio administratorius registruotų kiekvieną naują vartotoją, nepažymėkite šio langelio. Bet kuriuo atveju galite nustatyti numatytąjį vartotojo vaidmenį visiems naujiems vartotojams.','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'Jei norite paversti savo kategorijas į žymas (arba atvirkščiai), naudokite <a href="%s">Kategorijų/Žymų konverterį</a>, kurį rasite skyrelyje "Importas".','If you want to export a handy list of all the information on this page, you can use the button below to copy it to the clipboard. You can then paste it in a text file and save it to your device, or paste it in an email exchange with a support engineer or theme/plugin developer for example.'=>'Jei norite patogiai gauti visą informaciją rodomą šiame puslapyje, galite paspausti mygtuką esantį žemiau, ir viskas bus nukopijuota. Tuomet tiesiog įkelkite (paste) į tekstinį failą ir išsaugokite arba įkelkite (paste) į el. laišką ir nusiųskite, pavyzdžiui, pagalbos specialistui ar temos/įskiepio programuotojui.','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'Jei norite įdiegi įskiepį kurį parsisiuntėte iš kitur, paspauskite ant nurodos "Įkelti" ekrano kairiąjame viršutiniame kampe. Jūs turėsite nurodyti .zip paketą, ir kai jis bus įkeltas, galėsite aktyvuoti įkeltą įskiepį.','If you want to make changes but do not want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.'=>'Jei norite daryti įskiepio pakeitimus, bet nenorite prarasti jų po įskiepio atnaujinimo, pamąstykite apie savo įskiepio sukūrimą. Daugiau informacijos rasite žemiau pateikiamose nuorodose.','If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.'=>'Jei norite panaikinti valdiklį iš tinklalapio valdiklių srities, bet išsaugoti nuostatas vėlesniam naudojimui, nutempkite į sekciją „Neaktyvūs valdikliai“. Galėsite bet kada jį susigrąžinti. Tokia galimybė dažnai praverčia keičiant naudojamą temą.','If you want to run multiple WordPress installations in a single database, change this.'=>'Pakeiskite numatytajį priešdėlį, jei norite vienoje duomenų bazėje saugoti daugiau nei vieno WordPress tinklalapio duomenis.','If you would like to see more plugins to choose from, click on the &#8220;Add Plugin&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they are free!'=>'Jei norite pamatyti didesnį įskiepių pasirinkimą, spustelėkite mygtuką „Pridėti įskiepį“ ir galėsite naršyti ar ieškoti papildomų įskiepių <a href="%s">WordPress.org įskiepių kataloge</a>. Įskiepiai šiame kataloge yra kuriami kitų programuotojų ir yra suderinami su WordPress naudojama licenzija. Ir jie nemokami!','If you would like to see more themes to choose from, click on the &#8220;Add Theme&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they are free!'=>'Jei norite rinktis iš daugiau temų, paspauskite ant &#8220;Pridėti temą&#8221; mygtuko ir galėsite naršyti ar naudotis paieška tarp daugybės temų iš <a href="%s">WordPress.org temų katalogo</a>. Temos šiame kataloge yra sukurtos ir plėtojamos trečiųjų šalių, tačiau jas naudoti leidžia WordPress autorinės teisės. Taip pat, jos yra nemokamos!','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'Jei Jūsų tema turi daugiau nei vieną numatytąją antraštę, arba Jūs įkėlėte daugiau nei vieną antraštės paveikslėlį, galite pasirinkti nustatymą, kai WordPress atsitiktinai parinks vieną iš tų paveikslėlių kiekvieną kartą užėjus į bet kurį Jūsų tinklalapio puslapį. Pažymėkite pasirinkimą "Atsitiktinis" šalia Įkelti paveikslėliai arba Numatytieji paveikslėliai, ir ši funkcija bus įjungta.','If your website provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.'=>'Jei Jūsų tinklalapis teikia paslaugą, kuri vertina Jūsų klientų duomenis ir pagal juos priima sprendimą automatiškai (pavyzdžiui, kredito prašymas) arba apjungia klientų duomenis ir sukuria kiekvienam jų reklaminių interesų profilį - Jūs privalote aprašyti tokius procesus, pateikiant informaciją kaip ši informacija naudojama, kokie sprendimai yra daromi iš apjungtų duomenų ir kokias teises dėl automatiškai priiimtų sprendimų turi vartotojas.','If your website receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.'=>'Jei Jūsų tinklalapis gauna duomenis apie vartotojus iš trečiųjų šalių, įskaitant reklamos tinklus, tai turi būti aprašyta Jūsų privatumo politkos skyriuje, kuriame aprašoma trečiųjų šalių suteikiama informacija.','Image Address'=>'Paveikslėlio adresas','Image Attachment Template'=>'Paveikslėlio failo šablonas','Image Caption'=>'Antraštė','Image Crop Help'=>'Paveikslėlio apkarpymo pagalba','Image File'=>'Paveikslėlio failas','Image Processing Error'=>'Apdorojant paveikslėlį, įvyko klaida','Image Rotation'=>'Paveikslėlių pasukimas','Image Upload Error'=>'Įkeliant paveikslėlį, įvyko klaida','Image could not be processed.'=>'Nepavyko apdoroti paveikslėlio.','Image could not be processed. Please go back and try again.'=>'Paveikslėlio nepavyko užkrauti. Prašome eiti atgal ir pabandyti dar kartą.','Image data does not exist. Please re-upload the image.'=>'Paveikslėlio duomenys neegzistuoja, įkelkite jį iš naujo.','Image metadata is inconsistent.'=>'Image metadata is inconsistent.','Image restored successfully.'=>'Paveikslėlis sėkmingai grąžintas.','Image rotation is not supported by your web host.'=>'Paveikslėlių apvertimo nepalaiko Jūsų tinklalapio prieglaudos (hostingo) tiekėjas.','Image saved'=>'Paveikslėlis išsaugotas','Image sizes'=>'Paveikslėlių dydžiai','ImageMagick supported file formats'=>'ImageMagick palaikomi failų formatai','ImageMagick version number'=>'ImageMagick versijos numeris','ImageMagick version string'=>'ImageMagick versija','Images cannot be scaled to a size larger than the original.'=>'Paveikslėlio negalima padidinti iki didesnio dydžio nei originalas.','Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.'=>'<strong>%1$d &times; %2$d px</strong> paveikslėliai bus naudojami tokie, kokie yra.','Images should be at least %s tall.'=>'Paveikslėliai turėtų būti bent jau %s aukščio.','Images should be at least %s wide.'=>'Paveikslėliai turėtų būti bent jau %s pločio.','Imagick Resource Limits'=>'Imagick limitai','Imagick version'=>'Imagick versija','Import'=>'Importavimas','Import posts &amp; media from Tumblr using their API.'=>'Importuoti įrašus ir media failus iš Tumblr per jų API.','Import posts and comments from a Movable Type or TypePad blog.'=>'Importuoti įrašus ir komentarus iš Movable Type ar TypePad tinklaraščio.','Import posts from LiveJournal using their API.'=>'Importuoti įrašus iš Livejournal naudojant jų API.','Import posts from an RSS feed.'=>'Importuoti įrašus iš RSS srauto.','Import posts, comments, and users from a Blogger blog.'=>'Importuoti įrašus, komentarus ir vartotojus iš Blogger tinklaraščio.','Import posts, pages, comments, custom fields, categories, and tags from a WordPress export file.'=>'Importuoti įrašus, puslapius, komentarus, papildomus laukus, kategorijas ir žymas iš WordPress eksportavimo failo.','Important! Your version of WordPress (%1$s) is no longer supported, you will not receive any security updates for your website. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'Svarbu! Jūsų WordPress versija (%1$s) nepalaikoma ir negauna saugumo atnaujinimų. Jūsų tinklalapis taps saugus tik jei <a href="%2$s">atnaujinsite WordPress į naujausią versiją</a>.','Important! Your version of WordPress (%1$s) will stop receiving security updates in the near future. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'Svarbu! Jūsų WordPress versija (%1$s) ateityje nebus palaikoma ir negaus saugumo atnaujinimų. Jūsų tinklalapis išliks saugus tik jei <a href="%2$s">atnaujinsite WordPress į naujausią versiją</a>.','Important:'=>'Svarbu:','In a few words, explain what this site is about. Example: &#8220;%s.&#8221;'=>'Keliais žodžiais aprašykite, apie ką šis tinklalapis. Pavyzdys: &#8220;%s.&#8221;','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'Aprašydami, kokius asmeninius duomenis renkate, taip pat turite parašyti, kodėl Jūs juos renkate. Šie paaiškinimai turi remtis arba teisiniu pagrindu arba aktyviu sutikimu, kurį davė pats vartotojas.','In all likelihood, these items were supplied to you by your web host. If you do not have this information, then you will need to contact them before you can continue. If you are ready&hellip;'=>'Dažniausiai, šią informaciją suteikia tinklalapio prieglaudos (hostingo) tiekėjas. Jei nežinote šių duomenų, kreipkitės į jį prieš tęsdami. O jei esate pasiruošę&hellip;','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'Daugeliu atvejų, WordPress Jums net nepajaučiant automatiškai instaliuos palaikymo ir saugumo atnaujinimus.','In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.'=>'Ankstesnėse WordPress versijose, visi importeriai buvo integruoti. Vėliau jie buvo paversti į savarankiškus įskiepius, kadangi dauguma vartototojų naudoja juos tik vieną kartą arba retai.','In response to'=>'Atsakymas į','In response to: %s'=>'Atsakymas į: %s','In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and site URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.'=>'Stulpelyje <strong>Autorius</strong> šalia jo vardo, el.pašto bei URL, rodomas ir komentuotojo IP adresas. Paspaudus ant jo, bus parodyti visi komentarai, parašyti iš šio IP adreso.','In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.'=>'<strong>Komentaro</strong> stulpelyje, užvedus pelę ant bet kurio komentaro, bus parodytas meniu, leidžiantis patvirtinti, atsakyti, redaguoti, pažymėti kaip šlamštą, arba ištrinti tą komentarą.','In the <strong>In response to</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.'=>'Stulpelyje <strong>Atsakymas į</strong> matomi trys elementai. Tekstas - tai įrašo, kuriame yra konkretus komentaras, pavadinimas, o nuoroda ant jo veda į to įrašo redagavimą. Nuoroda "Peržiūrėti įrašą" veda į įrašo puslapį tinklalapyje. Mažas apskritimas su numeriuku viduje rodo, kiek patvirtintų komentarų turi šis įrašas. Jei apskritimas pilkas, visi to įrašo komentarai jau moderuoti. Jei mėlynas, šiam įrašui yra neperžiūrėtų komentarų. Paspaudus ant apskritimo, būsite perkeltas į tik šio įrašo komentarų sąrašą.','In the <strong>Submitted on</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.'=>'<strong>Paskelbta</strong> stulpelyje rodoma data ir laikas, kada komentaras buvo atsiųstas. Paspaudus ant jų, būsite nukreipti į komentarą Jūsų svetainėje.','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'Šio puslapio skiltyje Antraštės tekstas galite pasirinkti ar šį tekstą rodyti, ar slėpti. Taip pat galite pasirinkti teksto spalvą naudodami mygtuką "Pasirinkti spalvą" ir tuomet įvedę tinkamą HTML hex vertę, pvz.: &#8220;#ff0000&#8221; raudonai spalvai; arba tiesiog pasirinkę norimą spalvą su specialiu įrankiu.','In the Info tab, you will find all the details about the configuration of your WordPress site, server, and database. There is also an export feature that allows you to copy all of the information about your site to the clipboard, to help solve problems on your site when obtaining support.'=>'Skirtuke "Informacija" rasite išsamią informaciją apie WordPress tinklalapio, serverio ir duomenų bazės konfigūraciją. Taip pat yra eksporto funkcija, leidžianti nukopijuoti visą informaciją apie tinklalapį į iškarpinę, kad būtų lengviau spręsti jo problemas, kai kreipiamasi pagalbos.','In the Status tab, you can see critical information about your WordPress configuration, along with anything else that requires your attention.'=>'Skirtuke "Būsena" galite matyti svarbią informaciją apie WordPress konfigūraciją ir kitą informaciją, į kurią reikia atkreipti dėmesį.','In this section you should explain how long you retain personal data collected or processed by the website. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.'=>'Šiame skyriuje turite paaiškinti, kiek ilgai Jūs saugote asmeninius duomenis, surinktus ar apdorotus šiame tinklalapyje. Nors Jūs ir turėtumėte turėti aiškų laiko apibrėžimą ir priežastį konkrečių duomenų rinkinių laikymui, tokią informaciją pateikti nėra būtina. Pavyzdžiui, Jūs galite parašyti, kad saugote per kontaktų formas pateiktus duomenis 6 mėnesius, statistikos įrašus - metus, o pirkėjų užsakymų duomenis - 10 metų.','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'Šiame skyriuje turite paaiškinti, kokiais būdais saugote savo vartotojų duomenis. Tai gali būti techniniai būdai, kaip šifravimas; saugumo priemonės, kaip dviejų žingsnių autentifikacija; ir kitokie būdai, kaip darbuotojų mokymai apie asmens duomenų apsaugą. Jei esate įvykdę Privatumo poveikio įvertinimą ar kitokias oficialias procedūras, taip pat galite čia apie tai paminėti.','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'Šiame skyriuje turite paaiškinti, kokios procedūros yra vykdomos siekiant apsisaugoti nuo duomenų prieigos pažeidimų (potencialių ir realių), pavyzdžiui, vidinė pranešimų sistema, kontaktų sąrašas, ar atlygis už surastas klaidas.','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'Šiame skyriuje turite paaiškinti, kokias teises turi Jūsų vartotojai tvarkyti savo asmeninius duomenis, ir kaip tomis teisėmis jie gali pasinaudoti.','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'Šiame skyriuje turite surašyti visus atvejus, kai duomenys iš Jūsų tinklalapio persiunčiami už Europos Sąjungos ribų ir aprašyti būdus, kaip tie duomenys yra saugomi, kad apsaugos lygis atitiktų Europos Sąjungos reikalavimus. Minėti atvejai gali būti - Jūsų hostingo tiekėjas, debesijos paslaugų tiekėjas ar kiti trečiųjų paslaugų tiekėjai.','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'Šiame skyriuje turite surašyti visus trečiųjų šalių paslaugų tiekėjus, su kuriais Jūs dalinatės savo vartotojų duomenimis (pavyzdžiui, prekybos partneriai, debesijos paslaugų tiekėjai, mokėjimų tarpininkai), taip pat turite surašyti kokiais duomenimis su jais dalinatės ir kodėl. Jei įmanoma, sudėkite nuorodas į šių tiekėjų privatumo politikas.','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'Šiame poskyryje turite surašyti, kokius asmeninius duomenis renkate iš tinklalapio vartotojų ir lankytojų. Tai gali būti tokie asmeniniai duomenys kaip vardas, el.paštas, asmeniniai paskyros nustatymai, mokėjimų duomenys (pavyzdžiui, pirkimų informacija); ir/arba techniniai duomenys, tokie kaip slapukai (cookies).','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'Šiame poskyryje turite nurodyti savo tinklalapio URL, taip pat įmonę, organizaciją ar asmenį, kuris jį valdo ir jos/jo tikslią kontaktinę informaciją.','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'Šiame skyriuje turite pateikti kontaktus, kuriais reiktų kreiptis dėl asmens duomenų ir kitokiais su privatumu susijusiais klausimais. Jei dėl Jūsų veiklos pobūdžio privalote turėti Duomenų apsaugos pareigūną, čia turite parašyti jo/jos vardą, pavardę ir kontaktus.','In this subsection you should list the cookies your website uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.'=>'Šiame poskyryje turite aprašyti visus slapukus, kuriuos naudoja Jūsų tinklalapis,  įskaitant tuos, kuriuos sukuria Jūsų naudojami įskiepiai, socialinių tinklų integracijos ir statistikos rinkimo įrankiai. Mes aprašėme tik tuos slapukus, kuriuos WordPress sukuria standartiškai.','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'Šiame poskyryje turite surašyti, kokius stebėjimo ir statistikos rinkimo įrankius naudojate, kaip Jūsų vartotojai gali pasirinkti, kad jų duomenys nebūtų įtraukiami į Jūsų statistiką, bei pateikti nuorodą į Jūsų statistikos rinkimo paslaugos teikėjo privatumo politiką.','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'Šiame poskyryje turite surašyti, kokia informacija renkama skelbiant komentarus. Mes jau surašėme duomenis, kuriuos standartiškai renka WordPress.','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'Šiame poskyryje turite surašyti, kokią informaciją gali atskleisti vartotojai, kurie turi galimybę įkelti media failus. Dažniausiai, visi įkeliami failai yra prieinami viešai.','Inactive <span class="count">(%s)</span>'=>'Išjungti <span class="count">(%s)</span>' . "\0" . 'Išjungti <span class="count">(%s)</span>' . "\0" . 'Išjungti <span class="count">(%s)</span>','Inactive Plugins'=>'Išjungti įskiepiai','Inactive Sidebar (not used)'=>'Neaktyvi šoninė srities (nenaudojama)','Inactive Themes'=>'Išjungtos temos','Inactive Widgets'=>'Neaktyvūs valdikliai','Inactive plugins are tempting targets for attackers. If you are not going to use a plugin, you should consider removing it.'=>'Išjungti įskiepiai yra potencialūs programišių taikiniai. Jei nenaudosite šių įskiepių, rekomenduojame juos pašalinti.','Inactive:'=>'Neįjungti:','Incompatible Archive.'=>'Nesuderinamas archyvas.','Individual posts may override these settings. Changes here will only be applied to new posts.'=>'Šis nustatymas gali būti pakeistas konkrečiuose įrašuose. Kai pakeičiate nustatymą čia, jis taikomas tik nuo pakeitimo momento sukurtiems naujiems įrašams.','Industry regulatory disclosure requirements'=>'Reguliuojamų veiklos sričių informacija','Info'=>'Informacija','Information needed'=>'Reikalinga informacija','Insert into Post'=>'Įterpti į įrašą','Insert media from another website'=>'Įkelti failą esantį kitame tinklalapyje','Inserting Media'=>'Įterpti failą','Install Parent Theme'=>'Įdiegti pagrindinę išvaizdos temą','Install Themes'=>'Temų diegimo įrankis','Install WordPress'=>'Įdiegti WordPress','Install the latest version of WordPress'=>'Įdiekite naujausią WordPress versiją','Installation Required'=>'Būtina įdiegti','Installation failed.'=>'Diegimas nepavyko.','Installation package not available.'=>'Diegimo paketas nepasiekiamas.','Installed Plugins'=>'Įdiegti įskiepiai','Installing Plugin: %s'=>'Diegiamas įskiepis: %s','Installing Theme: %s'=>'Diegiama tema: %s','Installing plugin from uploaded file: %s'=>'Diegiamas įskiepis iš įkelto failo: %s','Installing the latest version&#8230;'=>'Diegiama naujausia versija&#8230;','Installing the plugin&#8230;'=>'Diegiamas įskiepis&#8230;','Installing the theme&#8230;'=>'Tema diegiama&#8230;','Installing theme from uploaded file: %s'=>'Diegiama tema iš įkelto archyvo: %s','Installing themes on Multisite can only be done from the Network Admin section.'=>'Multitinklalapyje temos gali būti instaliuojamos tik iš Tinklo administravimo skilties.','Internet Explorer does not give you the best WordPress experience. Switch to Microsoft Edge, or another more modern browser to get the most from your site.'=>'Internet Explorer nesuteikia geriausios WordPress patirties. Jei norite kuo geriau išnaudoti tinklalapio galimybes, pereikite prie Microsoft Edge arba kitos modernesnės naršyklės.','Introduction'=>'Įžanga','Invalid API response code (%d).'=>'Netinkamas API atsako kodas (%d)','Invalid URL format.'=>'Netinkamas URL formatas.','Invalid data provided.'=>'Nurodyti netinkami duomenys.','Invalid data. No selected item.'=>'Netinkami duomenys. Nėra pasirinkto objekto.','Invalid data. The item does not exist.'=>'Netinkami duomenys. Objektas neegzistuoja.','Invalid data. Unknown state.'=>'Netinkami duomenys. Nežinoma būsena.','Invalid data. Unknown type.'=>'Netinkami duomenys. Nežinomas tipas.','Invalid email address in request.'=>'Netinkamas el.pašto adresas užklausoje.','Invalid email address when generating personal data export file.'=>'Netinkamas el.pašto adresas asmeninės informacijos eksporto failo generavimui.','Invalid form submission.'=>'Invalid form submission.','Invalid image URL.'=>'Netinkamas paveikslėlio URL.','Invalid personal data action.'=>'Neteisingas asmens duomenų veiksmas.','Invalid plugin page.'=>'Netinkamas įskiepio puslapis.','Invalid plugin path.'=>'Invalid plugin path.','Invalid request ID when generating personal data export file.'=>'Netinkamas užklausos ID asmeninės informacijos eksporto failo generavimui.','Invalid request ID when merging personal data to export.'=>'Netinkamas užklausos ID sujungiant asmeninius duomenis eksportui.','Invalid request ID when processing personal data to erase.'=>'Netinkamas užklausos ID ruošiant asmeninius duomenis ištrynimui.','Invalid request ID when sending personal data export email.'=>'Netinkamas užklausos ID siunčiant asmeninių duomenų eksporto el.laišką.','Invalid request ID.'=>'Netinkamas  užklausos ID.','Invalid request type.'=>'Netinkamas užklausos tipas.','Invalid translation type.'=>'Netinkamas vertimo tipas.','Invitation email sent to new user. A confirmation link must be clicked before their account is created.'=>'Pakvietimo laiškas išsiųstas naujam vartotojui. Kai bus paspausta ant laiške esančios patvirtinimo nuorodos, paskyra bus sukurta.','Invitation email sent to user. A confirmation link must be clicked for them to be added to your site.'=>'Pakvietimo laiškas nusiųstas vartotojui. Kai tik jis paspaus ant patvirtinimo nuorodos, bus pridėtas prie jūsų tinklalapio.','Is SUHOSIN installed?'=>'Ar įdiegtas SUHOSIN?','Is the Imagick library available?'=>'Ar Imagick biblioteka prieinama?','Is this a multisite?'=>'Ar naudojamas multitinklalapis?','Is this site discouraging search engines?'=>'Ar tinklalapis blokuoja paieškos sistemas?','Is this site using HTTPS?'=>'Ar naudojamas HTTPS?','It is possible for site maintainers to block all, or some, communication to other sites and services. If set up incorrectly, this may prevent plugins and themes from working as intended.'=>'Tinklalapio prižiūrėtojai gali pilnai ar dalinai blokuoti prieigą kitiems tinklalapiams ir paslaugoms. Tačiau jei tai daroma netinkamai, tokie blokavimai gali trukdyti įskiepiams bei temoms veikti tinkamai.','It is up to search engines to honor this request.'=>'Paieškos sistemos pačios sprendžia, ar paisyti šio prašymo.','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'Jūs privalote turėti išsamią privatumo politiką, kuri atitinka visus nacionalius ir tarptautinius reikalavimus, bei nuolat ją atnaujinti ir tikslinti.','It looks like HTTPS is not supported for your website at this point.'=>'Atrodo, kad jūsų tinklalapis šiuo metu nepalaiko HTTPS. ','It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.'=>'Panašu, jog naudojate nesaugią %s versiją. Naudojant pasenusią naršyklės versiją, Jūsų kompiuteris tampa labiau pažeidžiamas. Jei norite pilnavertiškai naudoti WordPress, prašome atnaujinti savo naršyklę.','It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.'=>'Atrodo, kad Jūs naudojate seną %s versiją. Norėdami naudoti WordPress pilnavertiškai, atnaujinkite savo naršyklę.','It was not possible to check your scheduled events'=>'Nepavyko ištestuoti suplanuotų veiksmų','Item deleted.'=>'Elementas ištrintas.','Item not added.'=>'Elementas nepridėtas.','Item not updated.'=>'Elementas neatnaujintas.','Item updated.'=>'Elementas atnaujintas.','Items list'=>'Punktų sąrašas','Items list navigation'=>'Sąrašo navigacija','Join the diverse WordPress contributor community and connect with other people who are passionate about maintaining a free and open web.'=>'Prisijunkite prie įvairialypės WordPress bendruomenės ir bendraukite su kitais žmonėmis, kurie aistringai palaiko laisvą ir atvirą internetą.','Just another %s site'=>'Kol kas tik dar vienas %s tinklalapis','Just another WordPress site'=>'Kol kas tik dar vienas WordPress tinklalapis','Keep this link private'=>'Neviešinti nuorodos','Keeping your site updated is important for security. It also makes the internet a safer place for you and your readers.'=>'Nuolat atnaujinti tinklalapį būtina dėl saugumo. Taip prisidedate prie saugesnio interneto sau ir savo lankytojams.','Key'=>'Raktas','Keyboard users: When you are working in the visual editor, you can use %s to access the toolbar.'=>'Klaviatūros naudotojams: kai dirbate raiškiojoje rašyklėje, galite naudoti %s  norėdami iškviesti įrankių juostą.','Large size'=>'Didelis','Last IP'=>'Paskutinis IP','Last Name'=>'Pavardė','Last Updated:'=>'Atnaujinta:','Last Used'=>'Paskutinis naudojimas','Last checked on %1$s at %2$s.'=>'Paskutinį kartą tikrinta %1$s %2$s','Last edited by %1$s on %2$s at %3$s'=>'Paskutinį kartą redagavo %1$s:  %2$s  %3$s','Last edited on %1$s at %2$s'=>'Paskutinį kartą redaguota %1$s  %2$s','Latest'=>'Naujausia','Lead Developer'=>'Pagrindinis programuotojas','Learn about block themes'=>'Sužinokite daugiau apie blokų temas','Learn how to <a href="%s" class="update-browser-link">browse happy</a>'=>'Sužinokite, kaip <a href="%s" class="update-browser-link">naršyti laimingai</a>','Learn how to configure the Authorization header.'=>'Sužinokite kaip konfigūruoti autorizacijos antraštę.','Learn more about WordPress %s'=>'Sužinokite daugiau apie WordPress %s','Learn more about debugging in WordPress.'=>'Sužinokite daugiau apie WordPress klaidų sprendimą.','Learn more about page cache'=>'Sužinokite daugiau apie puslapio talpyklą (cache)','Learn more about persistent object caching.'=>'Sužinokite daugiau apie pastovią objektų talpyklą.','Learn more about the %s version.'=>'Sužinokite daugiau apie %s versiją.','Learn more about updating PHP'=>'Daugiau informacijos apie PHP atnaujinimą','Learn more about what WordPress requires to run.'=>'Sužinokite daugiau apie tai, ko reikia WordPress veikimui.','Learn more about why you should use HTTPS'=>'Sužinokite daugiau apie tai, kodėl turėtumėte naudoti HTTPS','Left Sidebar'=>'Valdiklių sritis kairėje','Let&#8217;s go!'=>'Važiuojam!','Library'=>'Failų saugykla','Likely direct inclusion of %1$s in order to use %2$s. This is very wrong. Hook the %2$s call into the %3$s action instead.'=>'Panašu į tiesioginį %1$s įtraukimą norint naudoti %2$s. Tai labai negerai. Naudokite %2$s prikabindami savo kodą prie %3$s veiksmo kablio.','Link Image To:'=>'Link Image To:','Link Target'=>'Atidarymo būdas','Link URL'=>'Nuorodos URL','Link added.'=>'Nuoroda pridėta.','Link not found.'=>'Nuoroda nerasta.','Link text, e.g. &#8220;Ransom Demands (PDF)&#8221;'=>'Nuorodos tekstas, pvz., „Išpirkos reikalavimas (PDF)“','Link thumbnails to:'=>'Miniatiūra nukreipia į:','Link to image'=>'Link to image','Links Template'=>'Links Template','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'Ekrano viršuje esančios Įrankių juostos nurodos sujungia Jūsų tinklalapio administravimo ir rodomają sąsajas, bei suteikia galimybę greitai pasiekti savo profilį ir pagalbinę WordPress informaciją.','Links list'=>'Nuorodų sąrašas','Links may be separated into Link Categories; these are different than the categories used on your posts.'=>'Nuorodos gali būti išskirtos į Nuorodų kategorijas - tai yra kitos kategorijos, nei naudojate savo įrašuose.','List of menu items selected for deletion:'=>'Pasirinktų ištrynimui meniu punktų sąrašas:','Live Preview &#8220;%s&#8221;'=>'Peržiūra &#8220;%s&#8221;','LiveJournal'=>'LiveJournal','Loading&hellip;'=>'Kraunama&hellip;','Local time is %s.'=>'Vietinis laikas yra %s.','Location of the uploaded file.'=>'Įkelto failo vieta','Log %s out of all locations.'=>'Atjungia vartotoją %s visuose įrenginiuose.','Log Out Everywhere'=>'Atsijungti visur','Log Out Everywhere Else'=>'Atsijungti visur','Login Name'=>'Prisijungimo vardas','Look Up'=>'Ieškoti','Looking for %1$s in %2$s'=>'Ieškoma: %1$s (%2$s)','Loopback request'=>'Loopback užklausa','Loopback requests are used to run scheduled events, and are also used by the built-in editors for themes and plugins to verify code stability.'=>'Loopback užklausos naudojamos vykdyti suplanuotiems veiksmams, taip pat jas naudoja temų ir įskiepių redaktoriai, tikrindami kodo tinkamumą.','M j, Y @ H:i'=>'M j, Y @ H:i','M jS'=>'M jS','M jS Y'=>'Y M jS','MB (Leave blank for network default)'=>'MB (Palikite tuščią norėdami nustatyti tinklo numatytą)','Mail Server'=>'Pašto serveris','Main Index Template'=>'Main Index Template','Main Page (no parent)'=>'Nepriklausomas puslapis (neturi tėvinio)','Main menu'=>'Pagrindinis meniu','Maintenance Release'=>'Palaikymo versija','Maintenance Releases'=>'Pataisymų laidos','Maintenance and Security Release'=>'Palaikymo ir saugumo versija','Maintenance and Security Releases'=>'Pataisymų ir saugumo laidos','Make this post sticky'=>'Prilipdyti įrašą','Manage Locations'=>'Nustatyti meniu vietas','Manage Uploads'=>'Tvarkyti įkeltus failus','Manage inactive plugins'=>'Valdyti išjungtus įskiepius','Manage with Live Preview'=>'Tvarkyti per gyvą peržiūrą','Manage your plugins'=>'Valdyti įskiepius','Manage your themes'=>'Valdyti temas','Managing Pages'=>'Puslapių valdymas','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'Puslapių valdymas labai panašus į įrašų, o redagavimo ekranas gali būti keičiamas lygiai taip pačiai.','Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.'=>'Nemaža dalis vartotojų pasinaudoja galimybe greičiau redaguoti komentarus naudojant klaviatūros šaukinius. Paspauskite nuorodą šone norėdami sužinoti daugiau.','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Erase Personal Data request should delete data from plugins as well.'=>'Daugelis įskiepių gali rinkti ir kaupti asmeninę informaciją WordPress duomenų bazėje ar nuotolinėje erdvėje. Bet kuri asmeninės informacijos ištrynimo užklausa taip pat turėtų įtraukti duomenis iš įskiepių.','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Export Personal Data request should include data from plugins as well.'=>'Daugelis įskiepių gali rinkti ir kaupti asmeninę informaciją WordPress duomenų bazėje ar nuotolinėje erdvėje. Bet kuri asmeninės informacijos eksportavimo užklausa taip pat turėtų įtraukti duomenis iš įskiepių.','Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.'=>'Jeigu į kurią nors valdiklių sritį nepatalpinsite nei vieno valdiklio, gali būti rodomi numatytieji temos valdikliai. Norėdami turėti tuščią valdiklių sritį, įkelkite į ją tuščią tekstinį valdiklį.','Mark export request for &#8220;%s&#8221; as completed.'=>'Pažymėti &#8220;%s&#8221; eksporto užklausą kaip įvykdytą.','Mark requests as completed'=>'Pažymėti užklausas kaip baigtas','Mark this comment as spam'=>'Pažymėti šį komentarą kaip šlamštą','Max Height'=>'Maksimalus aukštis','Max Width'=>'Maksimalus plotis','Max allowed packet size'=>'Didžiausias leistinas paketo dydis','Max connections number'=>'Maksimalus jungčių skaičius','Max effective file size'=>'Maksimalus failo dydis','Max input time'=>'Max input time','Max size of an uploaded file'=>'Maksimalus įkelto failo dydis','Max size of post data allowed'=>'Maksimalus siunčiamų duomenų kiekis','Maximum Rating'=>'Maksimalus vertinimas','Maximum size: %s'=>'Maksimalus dydis: %s','Media Handling'=>'Failų tvarkymas','Media Settings'=>'Failų nuostatos','Media file attached.'=>'Failas prikabintas.','Media file detached.'=>'Failai atkabinti.','Media file moved to the Trash.'=>'Failas perkeltas į šiukšlinę.','Media file permanently deleted.'=>'Failas ištrintas negrįžtamai.','Media file restored from the Trash.'=>'Failas atkurtas iš šiukšlinės.','Media file updated.'=>'Failas atnaujintas.','Media items list'=>'Medijos failų sąrašas','Media items list navigation'=>'Medijos failų sąrašo navigacija','Median server response time was %1$s milliseconds. It should be less than the recommended %2$s milliseconds threshold.'=>'Serverio atsakymo laiko mediana - %1$s milisekundžių. Ji turėtų būti mažesnė už rekomenduojamą %2$s milisekundžių ribą.','Median server response time was %1$s milliseconds. This is less than the recommended %2$s milliseconds threshold.'=>'Serverio atsakymo laiko mediana - %1$s milisekundžių. Tai mažiau nei rekomenduojama %2$s milisekundžių riba.','Medium size'=>'Vidutinis','Meetups'=>'Meetup\'ai','Membership'=>'Registracija','Menu Management'=>'Meniu valdymas','Menu Order'=>'Meniu rikiuotė','Menu Settings'=>'Meniu nustatymai','Menu item moved to the top'=>'Meniu punktas perkeltas į viršų','Menu item removed'=>'Meniu punktas ištrintas','Menu locations updated.'=>'Meniu lokacija atnaujinta.','Menu order'=>'Meniu išdėstymas','Menu structure'=>'Meniu struktūra','Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%1$s">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, %2$s and %3$s, do), you can learn about adding this support by following the documentation link to the side.'=>'Meniu gali būti rodomi vietose, numatytose Jūsų naudojamoje temoje, taip pat meniu galite rodyti šoninėje srityje, ten įkėlę valdiklį "Meniu" (tai atliekama <a href="%1$s">Valdiklių tvarkymo puslapyje</a>). Jei Jūsų tema nepalaiko meniu kūrimo (numatytosios temos, %2$s ir %3$s, tikrai palaiko), perskaityti kaip tai pakeisti galite specialiame Dokumentacijos puslapyje - nuoroda šone.','Minor Release Lead'=>'Mažosios versijos vadovas','Missed schedule'=>'Pradelstas suplanavimas','Missing Widgets'=>'Trūkstami valdikliai','Missing a temporary folder.'=>'Nerastas laikinasis aplankas.','Missing eraser index.'=>'Missing eraser index.','Missing exporter index.'=>'Trūksta eksporterio indekso.','Missing page index.'=>'Trūksta puslapio indekso.','Moderate Comment'=>'Moderuoti komentarą','Moderating Comments'=>'Tvarkomi komentarai','MonsterID (Generated)'=>'MonsterID','Month and name'=>'Mėnuo ir pavadinimas','More Details'=>'Plačiau','More details.'=>'Daugiau informacijos.','More information about %s'=>'Daugiau informacijos apie %s','Most Recent'=>'Naujausi','Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.'=>'Jei susidursite su kokiomis nors suderinamumo problemomis, pabandykite išjungti visus įskiepius. Gali būti, kad kai kurie iš jų nedera tarpusavyje. Jei tai išspręs problemą, bandykite įjungti įskiepius po vieną ir nustatyti nesuderinamumo šaltinį.','Most themes show the site title at the top of every page, in the title bar of the browser, and as the identifying name for syndicated feeds. Many themes also show the tagline.'=>'Beveik visos temos parodo tinklaraščio pavadinimą kiekviename puslapyje, naršyklės pavadinimo juostoje ir RSS srautuose. Dauguma temų parodo ir tinklaraščio šūkį.','Movable Type and TypePad'=>'Movable Type ir TypePad','Move'=>'Perkelti','Move %s box down'=>'Perkelti %s dėžutę žemyn','Move %s box up'=>'Perkelti %s dėžutę aukštyn','Move &#8220;%s&#8221; to the Trash'=>'Perkelti &#8220;%s&#8221; į šiukšlinę','Move this comment to the Trash'=>'Perkelti komentarą į šiukšlinę','Multisite support is not enabled.'=>'Multinklalapio palaikymas neįjungtas.','Must Use Plugins'=>'Būtini įskiepiai','Must-Use <span class="count">(%s)</span>'=>'Tinklo įskiepiai <span class="count">(%s)</span>' . "\0" . 'Tinklo įskiepiai <span class="count">(%s)</span>' . "\0" . 'Tinklo įskiepiai <span class="count">(%s)</span>','My Network'=>'Mano tinklas','My Site'=>'Mano tinklalapis','Mystery Person'=>'Paslaptingasis','Need help putting together your new Privacy Policy page? <a href="%1$s" %2$s>Check out the privacy policy guide%3$s</a> for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'Reikalinga pagalba sudarant Privatumo Politikos puslapį? <a href="%1$s" %2$s>Peržiūrėkite mūsų rekomendacijas%3$s</a> bei Jūsų naudojamos temos ir įskiepių kūrėjų pateikiamą informaciją.','Need help putting together your new Privacy Policy page? Check out the guide for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'Reikia pagalbos sudarant Jūsų naują Privatumo politikos puslapį? Peržiūrėkite mūsų rekomendacijas, kuriose surašėme, ką reiktų įtraukti, taip pat rekomendacijas gali pateikti ir Jūsų naudojami įskiepiai bei tema.','Need help? Use the Help tab above the screen title.'=>'Reikia pagalbos? Naudokite Pagalbos kortelę viršuje.','Network Active'=>'Tinklas aktyvus','Network Enable'=>'Įjungti tinkle','Network Only'=>'Tik tinklas','Network Setup'=>'Tinklo diegimas','Network count'=>'Tinklų kiekis','New Application Password Name'=>'Naujas aplikacijos slaptažodžio vardas','New Password'=>'Naujas slaptažodis','New User Default Role'=>'Numatytoji rolė naujiems vartotojams','New WordPress Site'=>'Naujas WordPress tinklalapis','New category name'=>'Naujos kategorijos pavadinimas','New custom field name'=>'Naujas pasirinktinio lauko pavadinimas','New dimensions:'=>'Nauji išmatavimai:','New theme activated.'=>'Nauja tema aktyvuota','New translations are available.'=>'Yra vertimų atnaujinimų.','New user created.'=>'Naujas vartotojas sukurtas.','New users are automatically assigned a password, which they can change after logging in. You can view or edit the assigned password by clicking the Show Password button. The username cannot be changed once the user has been added.'=>'Naujiems vartotojams automatiškai sukuriamas slaptažodis, kurį jie gali pakeisti, kai prisijungia prie tinklalapio. Galite peržiūrėti ar pakeisti šį slaptažodį, paspausdami „Rodyti slaptažodį“ mygtuką. Vartotojo vardo negalima pakeisti, kai vartotojas jau pridėtas.','New users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain their password. Check the box if you do not want the user to receive a welcome email.'=>'Nauji vartotojai gaus el.laišką, kuriame bus informuojama, kad jie buvo pridėti kaip šio tinklalapio vartotojai. Tame el.laiške bus nurodytas ir jų prisijungimo slaptažodis. Pažymėkite varnele šioje vietoje, jei nenorėtumėte, kad šis vartotojas gautų tokį laišką.','New version available. <button class="button-link" type="button">Update now</button>'=>'Išleista nauja versija. <button class="button-link" type="button">Atnaujinkite dabar</button>','News'=>'Naujienos','Next steps'=>'Kiti žingsniai','Next theme'=>'Kita tema','Nickname'=>'Slapyvardis','No PHP sessions detected'=>'PHP sesija nerasta','No URL Provided.'=>'URL nepateiktas.','No Update Required'=>'Atnaujinimas nereikalingas','No activity yet!'=>'Kol kas nebuvo atlikta jokių veiksmų','No approved comments'=>'Nėra patvirtintų komentarų','No client caching response headers were detected.'=>'Neaptikta kliento spartinančiųjų atsakymo antraščių.','No comments awaiting moderation.'=>'Patikrinimo laukiančių komentarų nėra.','No comments found in Trash.'=>'Šiukšlinėje komentarų nėra.','No comments found.'=>'Komentarų nerasta.','No comments yet.'=>'Kol kas komentarų nėra.','No description'=>'Nėra aprašymo','No file was uploaded.'=>'Nė vienas failas neįkeltas.','No further action is needed on your part.'=>'Daugiau Jums nieko nereikia daryti.','No importers are available.'=>'Nėra galimų importuotojų.','No information yet&hellip;'=>'Kol kas nėra informacijos&hellip;','No items.'=>'Elementų nėra.','No links found.'=>'Nuorodų nerasta.','No media files found in Trash.'=>'Šiukšlinėje failų nėra.','No media files found.'=>'Failų nerasta.','No pending comments'=>'Nėra laukiančių komentarų','No permalink structure set'=>'Nuolatinių nuorodų struktūra nenustatyta','No plugins are currently available.'=>'Šiuo metu nėra galimų įskiepių.','No plugins found for: %s.'=>'Nerasta įskiepių: %s.','No plugins found.'=>'Įskiepių nerasta','No plugins found. Try a different search.'=>'Įskiepių nerasta. Bandykite kitą paiešką.','No role'=>'Nėra rolės','No scheduled events exist on this site.'=>'Tinklalapyje nėra suplanuotų įvykių.','No thanks, do not remind me again'=>'Dėkoju, daugiau prašau man to nepriminti.','No theme specified.'=>'Nepasirinkta tema.','No themes match your request.'=>'Nėra jūsų užklausą atitinkančių temų.','No users found.'=>'Vartotojų nerasta.','No valid plugins were found.'=>'Nerasta veikiančių įskiepių.','No version control systems were detected.'=>'Nerasta versijų kontrolės sistemų.','No version or author information is available.'=>'Versijos ar autoriaus informacija nepateikta.','No, I do not approve of this connection'=>'Neleidžiu šio prisijungimo.','No, return me to the plugin list'=>'Ne, grąžinkite mane prie įskiepių sąrašo','No-code contribution'=>'Prisidėkite kitais būdais','Not Sticky'=>'Neprilipdytas','Not available'=>'Nėra','Not writable'=>'Nėra įrašymo prieigos','Note that even when set to discourage search engines, your site is still visible on the web and not all search engines adhere to this directive.'=>'Turėkite omenyje, kad net nustačius paieškos sistemų blokavimą, jūsų tinklalapis vistiek yra pasiekiamas internente ir kai kurios paieškos sistemos gali ignoruoti šią direktyvą.','Note that you crop the image by clicking on it (the Crop icon is already selected) and dragging the cropping frame to select the desired part. Then click Save to retain the cropping.'=>'Jei norite apkarpyti paveikslėlį, su pele apibrėžkite norimą jo sritį ir paspauskite virš jo esančią piktogramą „Apkarpyti“. Vėliau paspauskite mygtuką „Išsaugoti“.','Note: As this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with erasure requests. For example, you are also responsible for ensuring that data collected by or stored with the 3rd party services your organization uses gets deleted.'=>'Pastaba: Kadangi šis įrankis renka duomenis tik iš WordPress ir kai kurių įskiepių, jums gali tekti padaryti daugiau, kad įvykdytumėte ištrynimo užklausas. Pavyzdžiui, jūs taip pat esate atsakingi už tai, kad būtų ištrinti duomenys, surinkti ar saugomi pas jūsų organizacijos naudojamų trečiųjų šalių paslaugų teikėjus.','Note: Discouraging search engines does not block access to your site &mdash; it is up to search engines to honor your request.'=>'Pastaba: nė vienas iš šių nustatymų neblokuoja paieškos sistemoms prieigos prie Jūsų tinklalapio; jos pačios sprendžia, ar paisyti Jūsų prašymo.','Note: Neither of these options blocks access to your site &mdash; it is up to search engines to honor your request.'=>'Pastaba: nė vienas iš šių nustatymų neblokuoja paieškos sistemoms prieigos prie Jūsų tinklalapio; jos pačios sprendžia, ar paisyti Jūsų prašymo.','Note: Since this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with export requests. For example, you should also send the requester some of the data collected from or stored with the 3rd party services your organization uses.'=>'Pastaba: Kadangi šis įrankis renka duomenis tik iš WordPress ir kai kurių įskiepių, jums gali tekti padaryti daugiau, kad įvykdytumėte eksporto užklausas. Pavyzdžiui, užklausos siuntėjui taip pat turėtumėte nusiųsti kai kuriuos duomenis, surinktus ar saugomus pas jūsų organizacijos naudojamų trečiųjų šalių paslaugų teikėjus.','Notes'=>'Užrašai','Noteworthy Contributors'=>'Nusipelnę pagalbininkai','Nothing to save, the image has not changed.'=>'Nieko nepakeitėte, taigi nėra ir nieko, ką būtų galima išsaugoti.','Notice:'=>'Pastaba:','Number of Themes found: %d'=>'Rasta temų: %d','Number of items per page:'=>'Kiekis viename puslapyje:','Number/count of itemsCount'=>'Skaičius','Numeric'=>'Skaitinė','On systems with fewer resources, this may lead to server timeouts or resource limits being reached. If you encounter an issue during the update process, please create a support forum topic and reference <strong>Rollback</strong> in the issue title.'=>'Mažiau išteklių turinčiose sistemose serverio darboas gali dažnai sutrikti arba būti pasiektas jo išteklių limitas. Jei atnaujinimo proceso metu susidursite su problema, sukurkite temą pagalbos forume ir jos pavadinime nurodykite <strong>Rollback</strong>.','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'Šiame puslapyje Jūs galite atnaujinti savo WordPress į naujausią versiją, taip pat atnaujinti temas ir įskiepius iš WordPress.org katalogo.','Once generated, your WXR file can be imported by another WordPress site or by another blogging platform able to access this format.'=>'Kai tik WXR bus sukurta, ją iš karto galėsite importuoti į kitą WordPress ar panašią šį formatą palaikančią sistemą.','Once you have generated a list of themes, you can preview and install any of them. Click on the thumbnail of the theme you are interested in previewing. It will open up in a full-screen Preview page to give you a better idea of how that theme will look.'=>'Kai išsirinksite pageidaujamų temų sąrašą, galite peržiūrėti ir instaliuoti bet kurią iš jų. Paspauskite ant sudominusios temos miniatiūros - tuomet bus atidarytas pilno dydžio peržiūros langas, kad pamatytumėte iš arčiau, kaip tema atrodo.','Once you have made your selection, you can adjust it by entering the size in pixels. The minimum selection size is the thumbnail size as set in the Media settings.'=>'Kai jau pasirinksite norimą zoną, galite tikslinti jos dydį, įvesdami išmatavimus pikseliais. Minimalus pasirinktos zonos dydis yra miniatiūros dydis, kuris nurodytas Jūsų Failų nustatymuose.','Once you hit &#8220;Confirm Deletion&#8221;, the user will be permanently removed.'=>'Kai tik paspausite &#8220;Patvirtinti ištrynimą&#8221;, vartotojas visam laikui bus ištrintas.','Once you hit &#8220;Confirm Deletion&#8221;, these users will be permanently removed.'=>'Kai tik paspausite &#8220;Patvirtinti ištrynimą&#8221;, šie vartotojai visam laikui bus ištrinti.','Once you&#8217;ve saved the download file, you can use the Import function in another WordPress installation to import the content from this site.'=>'Kai išsaugosite parsisiųstą failą, pasinaudoję Importo funkciją kitame WordPress tinklalapyje galėsite ten importuoti turinį iš šio tinklalapio.','One Column'=>'Viena skiltis','One of the plugins is invalid.'=>'Vienas iš įskiepių yra netinkamas.','One of the selected users is not a member of this site.'=>'Vienas iš parinktų vartotojų nėra šio tinklalapio narys.','One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.'=>'One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.','One or more plugins failed to load properly.'=>'Vienas ar daugiau įskiepių tinkamai neįsijungė.','One or more recommended modules are missing'=>'Trūksta vieno ar daugiau rekomenduojamų modulių','One or more required modules are missing'=>'Trūksta vieno ar daugiau būtinų modulių','One or more themes failed to load properly.'=>'Viena ar daugiau temų tinkamai neįsijungė.','Only .zip archives may be uploaded.'=>'Galima įkelti tik .zip formatu suarchyvuotus failus.','Only the active theme is available to you. Contact the %s administrator for information about accessing additional themes.'=>'Šiuo metu galite naudoti tik įjungtą temą. Susisiekite su %s administratoriumi, jis informuos apie galimybę naudoti kitokias temas.','Open site editor'=>'Atidarykite tinklalapio redaktorių','Open the Customizer'=>'Į vaizdųjį režimą','Optional'=>'Papildomos nuostatos','Or choose an image from your media library:'=>'Arba pasirinkti paveikslėlį iš failų saugyklos:','Order images by:'=>'Paveikslėlius išdėstyti pagal:','Order:'=>'Išdėstymo tvarka:','Ordered by Comment Date, descending.'=>'Rūšiuojama pagal komentaro datą mažėjančia tvarka.','Organize my uploads into month- and year-based folders'=>'Skirstyti įkeliamus failus į aplankus pagal metus ir mėnesius','Original dimensions %s'=>'Originalūs matmenys %s','Other WordPress News'=>'Kitos WordPress naujienos','Other comment settings'=>'Kitos nuostatos','Other user roles have been changed.'=>'Kitos vartotojų rolės buvo pakeistos.','Other users have been deleted.'=>'Kiti vartotojai buvo ištrinti.','Other users have been removed.'=>'Kiti vartotojai buvo pašalinti.','Our website address is: %s.'=>'Mūsų tinklalapio adresas yra: %s','Outdated SQL server'=>'Pasenusi SQL versija','PG &#8212; Possibly offensive, usually for audiences 13 and above'=>'PG &#8212; Gali būti įžeidžiantys, paprastai skirti 13-os metų ir vyresniems','PHP Default Timezone'=>'PHP numatytoji laiko zona','PHP Extensions'=>'PHP plėtiniai','PHP SAPI'=>'PHP SAPI','PHP Sessions'=>'PHP sesijos','PHP Update Recommended'=>'Rekomenduojama atnaujinti PHP','PHP Update Required'=>'Būtinas PHP atnaujinimas','PHP Version'=>'PHP versija','PHP default timezone is invalid'=>'Netinkama numatytoji PHP laiko zona','PHP default timezone is valid'=>'PHP numatytoji laiko zona yra validi','PHP default timezone was changed after WordPress loading by a %s function call. This interferes with correct calculations of dates and times.'=>'PHP numatytoji laiko juosta buvo pakeista WordPress užsikrovus %s funkcijoje. Tai trukdo teisingai apskaičiuoti datas ir laikus.','PHP default timezone was configured by WordPress on loading. This is necessary for correct calculations of dates and times.'=>'PHP standartinė laiko juosta buvo nustatyta WordPress užkrovimo metu. Tai reikalinga, kad būtų teisingai apskaičiuojama data ir laikas.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance.'=>'PHP yra viena iš programavimo kalbų, naudojamų kuriant WordPress. Naujesnės PHP versijos reguliariai atnaujinamos saugumo požiūriu ir gali padidinti jūsų svetainės našumą.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance. The minimum recommended version of PHP is %s.'=>'PHP yra viena iš programavimo kalbų, naudojamų kuriant WordPress. Naujesnės PHP versijos reguliariai atnaujinamos saugumo požiūriu ir gali padidinti jūsų tinklalapio našumą. Seniausia galima PHP versija yra %s.','PHP max input variables'=>'PHP max input variables','PHP memory limit'=>'PHP memory limit (atminties limitas)','PHP memory limit (only for admin screens)'=>'PHP atminties limitas (tik valdymo ekranams)','PHP modules perform most of the tasks on the server that make your site run. Any changes to these must be made by your server administrator.'=>'PHP moduliai atlieka serveryje veiksmus, dėl kurių veikia Jūsų tinklalapis. Bet kokie pakeitimai šiuose moduliuose turėtų būti atliekami serverio administratoriaus.','PHP post max size'=>'PHP post max size (maksimalus POST užklausos dydis)','PHP sessions created by a %1$s function call may interfere with REST API and loopback requests. An active session should be closed by %2$s before making any HTTP requests.'=>'PHP sesijos sukurtos %1$s funkcijoje gali trukdyti REST API. Uždarykite aktyvią sesiją su %2$s prieš darydami HTTP užklausas.','PHP time limit'=>'PHP time limit (laiko limitas vykdymui)','PHP version'=>'PHP versija','Package not available.'=>'Paketo nėra.','Page'=>'Puslapis','Page cache'=>'Puslapio talpykla (cache)','Page cache enhances the speed and performance of your site by saving and serving static pages instead of calling for a page every time a user visits.'=>'Puslapio talpykla (cache) padidina tinklalapio greitį ir našumą, nes išsaugo ir pateikia statinius puslapius, o ne krauna puslapį iš naujo kiekvieną kartą, kai vartotojas apsilanko.','Page cache is detected and the server response time is good'=>'Puslapio talpykla (cache) aptikta, o serverio atsako laikas yra geras','Page cache is detected but the server response time is still slow'=>'Puslapio talpykla (cache) aptikta, tačiau serverio atsako laikas vis dar lėtas','Page cache is detected by looking for an active page cache plugin as well as making three requests to the homepage and looking for one or more of the following HTTP client caching response headers:'=>'Puslapio talpykla (cache) nustatoma ieškant įjungto puslapio talpyklos įskiepio ir atliekant tris užklausas į pradinį puslapį bei ieškant vienos ar daugiau iš šių HTTP kliento talpyklos atsakymo antraščių:','Page cache is not detected and the server response time is slow'=>'Puslapio talpykla (cache) neaptinkama ir serverio atsako laikas yra lėtas','Page cache is not detected but the server response time is OK'=>'Puslapio talpykla (cache) neaptinkama, bet serverio atsako laikas yra tinkamas','Page draft updated.'=>'Puslapio juodraštis atnaujintas.','Page index cannot be less than one.'=>'Puslapio indeksas negali būti mažesnis nei 1.','Page restored to revision from %s.'=>'Puslapis atstatytas į versiją iš %s.','Page saved.'=>'Puslapis išsaugotas.','Page scheduled for: %s.'=>'Puslapis suplanuotas: %s','Page submitted.'=>'Puslapis nusiųstas.','Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.'=>'Puslapiai yra panašūs į įrašus. Jie turi pavadinimą, tekstą, susijusius metaduomenis, bet jie nėra skirstomi pagal chronologiją, jiems nepriskiriamos kategorijos ar žymos. Užtat puslapiai gali turėti hierarchiją. Galite sukurti vieną tėvinį puslapį ir jam priskirti kitus antrinius puslapius.','Parent Theme'=>'Tėvinė tema','Parent theme'=>'Tėvinė tema','Passed'=>'Sėkmingai','Passed tests'=>'Išlaikyti testai','Password reset link sent.'=>'Slaptažodžio atstatymo nuoroda išsiųsta.','Password reset links sent to %s user.'=>'Slaptažodžio atstatymo nuoroda išsiųsta %s vartotojui.' . "\0" . 'Slaptažodžio atstatymo nuorodos išsiųstos %s vartotojams.' . "\0" . 'Slaptažodžio atstatymo nuorodos išsiųstos %s vartotojui.','Paused <span class="count">(%s)</span>'=>'Sustabdyta <span class="count">(%s)</span>' . "\0" . 'Sustabdyta <span class="count">(%s)</span>' . "\0" . 'Sustabdyta <span class="count">(%s)</span>','Performance'=>'Funkcionavimas','Performance Lead'=>'Našumo vadovas','Performance updates'=>'Našumo atnaujinimai','Permalink Settings'=>'Nuorodų struktūros nuostatos','Permalink structure'=>'Nuolatinių nuorodų struktūra','Permalink structure updated.'=>'Nuorodų struktūra atnaujinta.','Permalink structure updated. Remove write access on %s file now!'=>'Nuorodų struktūra atnaujinta. Dabar jau galite pašalinti įrašymo prieigą %s failui.','Permalinks'=>'Nuorodų struktūra','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'Nuorodos yra pastovūs URL vedantys į Jūsų puslapius ir įrašus, taip pat į kategorijų ir žymų archyvus. Nuoroda yra internetinis adresas, vedantis į konkretų turinį. Kiekvieno įrašo URL turi būti pastovus ir nekeičiamas.','Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.'=>'Nuorodose galima pateikti naudingą informaciją, pavyzdžiui įrašo datą, pavadinimą ir kitus elementus. Galite rinktis iš siūlomų nuorodų formatų arba susikurti savo specifinį formatą.','Permanently delete comment'=>'Ištrinti komentarą negrįžtamai','Persistent object cache'=>'Nuolatinė objektų talpykla (cache)','Personal Data Export'=>'Asmens duomenų eksportas','Personal Data Export for %s'=>'Asmeninių duomenų eksportas vartotojui %s','Personal Options'=>'Asmeninės nuostatos','Personal data is 