pamirškite jo pridėti į kurį nors iš savo tinklalapio meniu.','Please enter a valid menu name.'=>'Įveskite tinkamą meniu pavadinimą.','Please enter your FTP credentials to proceed.'=>'Įveskite savo FTP duomenis, jei norite tęsti.','Please enter your FTP or SSH credentials to proceed.'=>'Įveskite FTP arba SSH duomenis, jei norite tęsti.','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'Prašome įdiegti <a href="%s">Klasikinį redaktorių</a> šio lauko redagavimui.','Please note: Third-party themes and plugins, or custom code, may override WordPress scheduling.'=>'Dėmesio: trečiųjų šalių išvaizdos temos, įskiepiai ar jūsų parašytas kodas gali perrašyti WordPress planavimą.','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'Prašome naudoti <a href="%s">Klasikinį redaktorių</a> šio lauko redagavimui.','Please provide a custom field name.'=>'Nurodykite vartotojo lauko pavadinimą.','Please provide a custom field value.'=>'Nurodykite vartotojo lauko reikšmę.','Please provide a valid username.'=>'Įveskite teisingą vartotojo vardą.','Please provide the following information. Do not worry, you can always change these settings later.'=>'Prieš pradedant, reikia pateikti šiek tiek informacijos. Bet kada vėliau galėsite ją pakeisti.','Please select a file'=>'Pasirinkite failą','Please select an option.'=>'Prašome pasirinkti.','Please select one or more plugins to update.'=>'Pasirinkite vieną ar kelis įskiepius, kuriuos norite atnaujinti.','Please select one or more themes to update.'=>'Pasirinkite vieną ar kelias temas, kurias norite atnaujinti.','Please type your comment text.'=>'Prašome parašyti savo komentaro tekstą','Please update WordPress now'=>'Prašome atnaujinti WordPress dabar','Please update your site at %1$s to WordPress %2$s.'=>'Prašome atnaujinti tinklalapį %1$s į WordPress %2$s.','Plugin'=>'Įskiepis','Plugin Data'=>'Įskiepio informacija','Plugin File Editor'=>'Įskiepio failų redaktorius','Plugin Files'=>'Įskiepių failai','Plugin Homepage &#187;'=>'Įskiepio kūrėjo tinklalapis &#187;','Plugin Installation'=>'Įskiepio diegimas','Plugin InstallerBeta Testing'=>'Beta testavimas','Plugin InstallerFavorites'=>'Mėgstamiausi','Plugin InstallerFeatured'=>'Siūlomi','Plugin InstallerPopular'=>'Populiariausi','Plugin InstallerRecommended'=>'Rekomenduojama','Plugin InstallerTag'=>'Žyma','Plugin Reactivation'=>'Įskiepis vėl įjungiamas','Plugin Versions'=>'Įskiepių versijos','Plugin activated.'=>'Įskiepis įjungtas.','Plugin and theme auto-updates'=>'Įskiepių ir temų automatiniai atnaujinimai','Plugin and theme auto-updates appear to be configured correctly'=>'Įskiepių ir išvaizdos temų automatinis atnaujinimas nustatytias teisingai','Plugin and theme auto-updates ensure that the latest versions are always installed.'=>'Įskiepių ir išvaizdos temų automatinis atnaujinimas užtikrina, kad visuomet turite įdiegtą naujausią versiją.','Plugin and theme temporary backup directories exist but are not writable'=>'Įskiepių ir temų laikinosios atsarginės kopijos direktorijos egzistuoja, bet į jas negalima įrašyti','Plugin and theme temporary backup directory access'=>'Prieiga prie įskiepių ir temų laikinųjų atsarginių kopijų direktorijų','Plugin and theme temporary backup directory is writable'=>'Įskiepio ir temos laikinosios atsarginės kopijos direktorija yra įrašoma','Plugin could not be activated because it triggered a <strong>fatal error</strong>.'=>'Įskiepis negali būti įjungtas, nes sukelia <strong>kritinę klaidą</strong>.','Plugin could not be deleted due to an error: %s'=>'Įskiepis negali būti ištrintas dėl šios klaidos: %s','Plugin could not be deleted.'=>'Įskiepio ištrinti nepavyko.','Plugin could not be resumed because it triggered a <strong>fatal error</strong>.'=>'Įskiepis negali būti įjungtas, nes sukelia <strong>kritinę klaidą</strong>.','Plugin deactivated.'=>'Įskiepis išjungtas.','Plugin downgrade failed.'=>'Įskiepio pasendinti nepavyko.','Plugin downgraded successfully.'=>'Įs