all plugins in the <a href="%s">WordPress Plugin Directory</a> right from here, or upload a plugin in .zip format by clicking the button at the top of this page.'=>'Įskiepiai skirti pakeisti ir išplėsti standartines WordPress funkcijas. Jūs galite automatiškai diegti įskiepius iš <a href="%s">WordPress įskiepių katalogo</a> arba įkelti įskiepį .zip formatu šio puslapio viršuje.','Plugins extend your site&#8217;s functionality with things like contact forms, ecommerce and much more. That means they have deep access to your site, so it&#8217;s vital to keep them up to date.'=>'Įskiepiai prideda tinklalapiui papildomų funkcijų, pavyzdžiui kontaktinė forma, e-komercija ir daug kitų. Dėl to įskiepiai turi itin plačią prieigą prie Jūsų tinklalapio, taigi būtina juos nuolat atnaujinti.','Plugins hook into WordPress to extend its functionality with custom features. Plugins are developed independently from the core WordPress application by thousands of developers all over the world. All plugins in the official <a href="%s">WordPress Plugin Directory</a> are compatible with the license WordPress uses.'=>'Įskiepiai išplečia WordPress galimybes, papildydami jį naujomis funkcijomis. Įskiepius kuria tūkstančiai programuotojų visame pasaulyje, nepriklausomai nuo WordPress branduolio. Visi įskiepiai oficialiame <a href="%s">WordPress įskiepių kataloge</a> yra suderinami su WordPress naudojama licencija.','Plugins list'=>'Įskiepių sąrašas','Plugins list navigation'=>'Įskiepių sąrašo navigacija','Plugins updated successfully.'=>'Įskiepiai sėkmingai atnaujinti.','Policies'=>'Politikos','Popular Plugin'=>'Populiarus įskiepis','Popular tags'=>'Populiarios žymos','Popup Comments'=>'Komentarai iškylančiame lange','Popup Comments Template'=>'Komentarų iškylančiame lange šablonas','Port'=>'Prievadas','Portfolio'=>'Portfolio','Post Formats'=>'Įrašo formatai','Post Via Email'=>'Skelbti įrašus el. paštu','Post draft updated.'=>'Įrašo juodraštis atnaujintas.','Post name'=>'Įrašo pavadinimas','P