trintos.','Primary Site'=>'Pagrindinis tinklalapis','Privacy'=>'Privatumas','Privacy Laws around the world require businesses and online services to delete, anonymize, or forget the data they collect about an individual. The rights those laws enshrine are sometimes called the "Right to be Forgotten".'=>'Privatumo įstatymuose įvairiose pasaulio šalyse reikalaujama, kad įmonės ir interneto paslaugų teikėjai turėtų galimybę ištrinti, anonimizuoti arba "pamiršti" apie asmenį surinktus duomenis. Šios įstatymuose įtvirtintos teisės kartais vadinamos "Teise būti pamirštam".','Privacy Laws around the world require businesses and online services to provide an export of some of the data they collect about an individual, and to deliver that export on request. The rights those laws enshrine are sometimes called the "Right of Data Portability". It allows individuals to obtain and reuse their personal data for their own purposes across different services. It allows them to move, copy or transfer personal data easily from one IT environment to another.'=>'Privatumo įstatymuose skirtingose pasaulio šalyse reikalaujama, kad įmonės ir interneto paslaugų teikėjai turėtų galimybę pateikti kai kurių apie asmenį surinktų duomenų eksportą ir, gavusios prašymą, jį pateiktų. Šiuose įstatymuose įtvirtintos teisės kartais vadinamos "Duomenų perkeliamumo teise". Ji suteikia galimybę asmenims gauti ir pakartotinai naudoti savo asmens duomenis savo tikslais, pas skirtingus paslaugų teikėjus. Ji leidžia jiems lengvai perkelti, kopijuoti ar perkelti asmens duomenis iš vienos IT aplinkos į kitą.','Privacy Policy Guide'=>'Privatumo politikos rekomendacijos','Privacy Policy Page'=>'Privatumo politikos puslapis','Privacy Policy page setting updated successfully. Remember to <a href="%s">update your menus</a>!'=>'Privatumo politikos puslapio nustatymas atnaujintas sėkmingai. Nepamirškite <a href="%s">įdėti jo į meniu</a>!','Privacy Policy page updated successfully.'=>'Privatumo politikos puslapis sėkmi