ėl HTTPS palaikymo Jūsų tinklalapyje susisiekite su savo hostingo paslaugų tiekėju.','Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.'=>'Paspauskite arba užeikite su pele ant bet kurios temos ir paspauskite mygtuką "Reali peržiūra" - tuomet pamatysite tos temos vaizdą savo tinklalapyje ir galėsite keisti jos nustatymus atskirame, pilno dydžio ekrane. Mygtuką "Reali peržiūra" taip pat galite rasti temos infomacinio ekrano apačioje. Bet kuri instaliuota tema gali būti peržiūrima ir keičiama tokiu būdu.','Taxonomy Template'=>'Taksonomijos šablonas','Tech Lead'=>'Techninis vadovas','Template Editing'=>'Šablono redagavimas','Test Lead'=>'Testavimo vadovas','Text Color'=>'Teksto spalva','Thank you for Updating! Please visit the <a href="%s">Upgrade Network</a> page to update all your sites.'=>'Dėkojame, kad atnaujinote! Prašome aplankyti <a href="%s">Tinklo atnaujinimo</a> puslapį ir atnaujinti visus savo tinklalapius.','Thank you for creating with <a href="%s">WordPress</a>.'=>'Ačiū, kad kuriate su <a href="%s">WordPress</a>.','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'Dėkojame, kad naudojotės %s, Jūsų tinklalapis yra ištrintas. Sėkmės ir iki kito susitikimo.','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'Dėkojame. Prašome pasitikrinti savo el.paštą ir paspausti nuorodą laiške gautame iš mūsų. Jūsų tinklalapis nebus ištrintas, kol nepaspausite tos nuorodos.','That user could not be added to this site.'=>'Šis vartotojas negali būti pridėtas prie šio tinklalapio.','That user is already a member of this site.'=>'Šis vartotojas jau yra šio tinklalapio narys.','The "%1$s" value is smaller than "%2$s"'=>'"%1$s" reikšmė yra mažesnė už "%2$s".','The "%s" argument must be a non-empty string.'=>'Argumentas "%s" negali būti tuščias.','The %1$s and %2$s directories exist but are not writable. These directories are used to improve the stability of plugin updates. Please make sure the server has write permissions to these directories.'=>'Direktorijos %1$s ir %2$s egzistuoja, bet į jas negalima įrašyti. Šios direktorijos naudojamos siekiant pagerinti įskiepių atnaujinimų stabilumą. Įsitikinkite, kad serveryje suteiktos šių direktorijų įrašymo teisės.','The %1$s argument must be a non-empty string for %2$s.'=>'Argumentas %1$s neturi būti tuščias %2$s.','The %1$s constant in your %2$s file is no longer needed.'=>'%1$s konstanta Jūsų %2$s faile nebereikalinga.','The %1$s constant is defined as %2$s'=>'Konstanta %1$s turi reikšmę %2$s','The %1$s directive in %2$s determines if uploading files is allowed on your site.'=>'%1$s direktyva %2$s faile nustato ar failų įkėlimas yra galimas jūsų tinklalapyje.','The %1$s directory does not exist, and the server does not have write permissions in %2$s to create it. This directory is used for plugin and theme updates. Please make sure the server has write permissions in %2$s.'=>'Direktorija %1$s neegzistuoja, o serveris neturi rašymo teisių į %2$s, kad jį sukurtų. Ši direktorija naudojama įskiepių ir temų atnaujinimams. Įsitikinkite, kad serveris turi teises rašyti į %2$s.','The %1$s plugin header is deprecated. Use %2$s instead.'=>'Įskiepio %1$s antraštė yra pasenusi. Naudokite %2$s.','The %1$s setting is unregistered. Unregistered settings are deprecated. See <a href="%2$s">documentation on the Settings API</a>.'=>'Nustatymas %1$s yra neregistruotas. Neregistruoti nustatymai yra nebenaudojami. Žr. <a href="%2$s">Nustatymų API</a> dokumentaciją.','The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;'=>'Duomenų bazės lentelėje "%1$s" yra klaidų. Klaidos pranešimas: %2$s. WordPress pabandys sutvarkyti šią lentelę&hellip;','The %s argument must be an array.'=>'Argumentas %s turi būti masyvas.','The %s directory cannot be located.'=>'Direktorijos %s nepavyksta rasti.','The %s directory exists but is not writable. This directory is used for plugin and theme updates. Please make sure the server has write permissions to this directory.'=>'Direkotorija %s egzistuoja, bet į ją negalima rašyti. Ši direktorija naudojama įskiepių ir temų atnaujinimams. Įsitikinkite, kad serveryje yra suteiktos teisės rašyti į šią direktoriją.','The %s directory exists but is not writable. This directory is used to improve the stability of plugin and theme updates. Please make sure the server has write permissions to this directory.'=>'Direktorija %s egzistuoja, bet į ją negalima įrašyti. Ši direktorija naudojama siekiant pagerinti įskiepių ir temų atnaujinimų stabilumą. Įsitikinkite, kad serveryje suteiktos šios direktorijos įrašymo teisės.','The %s directory exists but is not writable. This directory is used to improve the stability of plugin updates. Please make sure the server has write permissions to this directory.'=>'Direkotorija %s egzistuoja, bet į ją negalima rašyti. Ši direktorija naudojama įskiepių atnaujinimų stabilumui pagerinti. Įsitikinkite, kad serveryje yra suteiktos teisės įrašyti į šią direktoriją.','The %s directory exists but is not writable. This directory is used to improve the stability of theme updates. Please make sure the server has write permissions to this directory.'=>'Direktorija %s egzistuoja, bet į ją negalima įrašyti. Ši direktorija naudojama temų atnaujinimų stabilumui pagerinti. Įsitikinkite, kad serveryje yra suteiktos įrašymo į šią direktoriją teisės.','The %s directory used to improve the stability of plugin and theme updates is writable.'=>'Į %s direktoriją, naudojamą įskiepių ir temų atnaujinimų stabilumui pagerinti, galima įrašyti.','The %s filter is enabled.'=>'Filtras %s yra įjungtas.','The %s function has been disabled, some media settings are unavailable because of this.'=>'Funkcija %s yra išjungta, dėl to dalis failų nustatymų yra neprieinama.','The %s importer is invalid or is not installed.'=>'%s importavimo įskiepis yra neteisingas arba neįdiegtas.','The %s post meta must be an array.'=>'%s įrašo meta turi būti masyvas.','The %s stylesheet does not contain a valid theme header.'=>'%s stilių faile nėra tinkamos išvaizdos temos antraštės.','The %s table is already optimized.'=>'%s lentelė jau optimizuota.','The %s table is okay.'=>'Lentelė %s yra tvarkinga.','The 1st Freedom'=>'Pirmoji laisvė','The 2nd Freedom'=>'Antroji laisvė','The 3rd Freedom'=>'Trečioji laisvė','The 4th Freedom'=>'Ketvirtoji laisvė','The <a href="https://wordpress.org/documentation/article/wordpress-glossary/#character-set">character encoding</a> of your site (UTF-8 is recommended)'=>'Jūsų tinklalapio <a href="https://wordpress.org/documentation/article/wordpress-glossary/#character-set"> ženklų koduotė</a> (rekomenduojama UTF-8)','The Authorization header is used by third-party applications you have approved for this site. Without this header, those apps cannot connect to your site.'=>'Autorizavimo antraštė ateina iš trečiųjų šalių aplikacijų, kurias jūs patvirtinate. Be jos šios aplikacijos negali prisijungti prie jūsų tinklalapio.','The Authorization header is working as expected'=>'Autorizavimo antraštė veikia kaip tikėtasi.','The Authorize Application request is not allowed.'=>'Aplikacijos autorizavimo užklausa neleidžiama.','The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.'=>'Sekcijoje „Galimi valdikliai“ pateikiami visi valdikliai, kuriuos šiuo metu galite naudoti. Kai nutempsite kurį nors valdiklį į valdiklių sritį, galėsite konfigūruoti jo nuostatas. Baigę konfigūravimą, nepamirškite paspausti mygtuko „Išsaugoti“. Jei norite panaikinti valdiklį iš valdiklių srities, pasirinkite funkciją „Trinti“.','The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.'=>'Kategorijų/Žymų konverterio nuoroda Jus nukels į Importo puslapį, kuriame šis konverteris įdėtas kaip vienas iš įskiepių, kurį galite instaliuoti. Kai šis įskiepis instaliuotas, paspauskite nuorodą "Aktyvuoti įskiepį ir paleisti importavimo įrankį" - bus atidarytas langas, kuriame galėsite pasirinkti konvertuoti žymas į kategorijas arba atvirkščiai.','The Code mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Code editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.'=>'Kodo režimas leidžia jums įvesti HTML kodą greta savo įrašo teksto. Turėkite omenyje, kad &lt;p&gt; ir &lt;br&gt; žymos yra automatiškai paverčiamos į nukėlimus į kitą eilutę, kai perjungiate redaktorių tarp kodo ir vaizdinio režimo. Kai rašote, vienas nukėlimas į kitą eilutę gali būti panaudojamas vietoj &lt;br&gt; žymos, o du nukėlimai vienas po kito - vietoj pastraipos žymos. Nukėlimai bus paversti į žymas automatiškai.','The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements. The Customizer is intended for use with non-block themes.'=>'Vaizdusis režimas leidžia matyti kaip atrodys atliekami pakeitimai Jūsų tinklalapyje dar jų neišsaugojus. Galite pereiti į kitus tinklalapio puslapius ir peržiūrėti juos būdami šiame režime. Šalia elementų, kurie gali būti keičiami, matysite nuorodas; paspaudus bet kur vaizdžiajame režime jas galima išjungti ir įjungti. Vaizdusis režimas skirtas naudoti su temomis, kurios nepalaiko blokų.','The Dashboard is the first place you will come to every time you log into your site. It is where you will find all your WordPress tools. If you need help, just click the &#8220;Help&#8221; tab above the screen title.'=>'Skydelis yra pirmoji vieta, į kurią pateksite kiekvieną kartą prisijungę prie savo tinklalapio. Čia rasite visus WordPress nustatymus ir įrankius. Jei reikia pagalbos, tiesiog spustelėkite virš ekrano pavadinimo esantį skirtuką &#8220;Pagalba&#8221;.','The Four Freedoms'=>'„Keturios laisvės”','The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.'=>'Papildomi nustatymai leidžia pasirinkti žymų ir kategorijų archyvų nuorodų struktūrą. Pavyzdžiui, vietoje<code>/category/gyvenimas</code> gali būti rodoma <code>/kategorija/gyvenimas</code>.','The PHP version on your server is %1$s, however the new plugin version requires %2$s.'=>'Jūsų PHP versija yra %1$s, tačiau naujajai įskiepio versijai reikia %2$s.','The PHP version on your server is %1$s, however the new theme version requires %2$s.'=>'Jūsų serverio PHP versija yra %1$s, tačiau naujajai temos versijai reikia %2$s.','The PHP version on your server is %1$s, however the uploaded plugin requires %2$s.'=>'Jūsų PHP versija yra %1$s, tačiau įkeltas įskiepis reikalauja %2$s.','The PHP version on your server is %1$s, however the uploaded theme requires %2$s.'=>'Jūsų PHP versija yra %1$s, tačiau įkelta tema reikalauja %2$s.','The Privacy Settings require JavaScript.'=>'Privatumo nustatymams reikalingas JavaScript.','The Privacy screen lets you either build a new privacy-policy page or choose one you already have to show.'=>'Puslpayje "Privatumas" galite sukurti naują privatumo politikos puslapį arba pasirinkti jau esamą puslapį.','The REST API did not behave correctly'=>'REST API veikia neteisingai','The REST API did not process the %s query parameter correctly.'=>'REST API neteisingai perdavė užklausos %s parametrą.','The REST API encountered an error'=>'REST API grąžino klaidą','The REST API encountered an unexpected result'=>'REST API grąžino netikėtą rezultatą','The REST API is available'=>'REST API įjungtas','The REST API is one way that WordPress and other applications communicate with the server. For example, the block editor screen relies on the REST API to display and save your posts and pages.'=>'REST API yra vienas iš būdų kaip WordPress, ir kitokios programos/sistemos, komunikuoja su serveriu. Pavyzdys - blokų redaktorius, kuris REST API pagalba parodo ir išsaugo Jūsų įrašus bei puslapius.','The SQL server is a required piece of software for the database WordPress uses to store all your site&#8217;s content and settings.'=>'SQL yra būtina programinė įranga, ją naudoja WordPress duomenų bazė, kurioje saugomas Jūsų tinklalapio turinys ir nustatymai.','The Site Health check for %1$s has been replaced with %2$s.'=>'Tinklalapio sveikatos patikrinimas %1$s buvo pakeistas į %2$s.','The Site Health check requires JavaScript.'=>'Tinklalapio būklės funkcijai reikalingas JavaScript.','The Theme Installer screen requires JavaScript.'=>'Temų diegimo lange reikalingas JavaScript.','The URL must be served over a secure connection.'=>'URL turi būti pateikiamas per saugų ryšį.','The Walker class named %s does not exist.'=>'Walker klasė pavadinimu %s neegzistuoja.','The WordPress Hosting Team maintains a list of those modules, both recommended and required, in <a href="%1$s" %2$s>the team handbook%3$s</a>.'=>'WordPress hostingo komanda sudarė ir atnaujina tokių modulių sąrašą, tiek rekomenduojamų, tiek privalomų; šis sąrašas pateikiamas  <a href="%1$s" %2$s>hostingo komandos gide%3$s</a>.','The WordPress Team'=>'WordPress komanda','The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.'=>'WordPress komanda pasiruošusi Jums padėti. Persiųskite šį el.laišką į %s ir jie padės Jums užtikrinti, kad Jūsų tinklalapis veiktų tinkamai.','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>'UAB „Lazerių įmonė“ buvo įkurta 1971-iais metais ir nuo to laiko gamina įvairaus tipo lazerius. „Lazerių įmonė“ yra įsikūrusi Kaune, joje dirba apie 2000 fizikos specialistų, kurie kasdien kurie nuostabius produktus, palengvinančius mūsų visų gyvenimą.','The active theme does not support a flexible sized header image.'=>'Įjungta išvaizdos tema nepalaiko lankstaus dydžio antraštės paveikslėlių.','The active theme does not support uploading a custom header image. Please ensure your theme supports custom headers and try again.'=>'Įjungta tema nepalaiko pasirinktinio antraštės paveikslėlio įkėlimo. Įsitikinkite, kad jūsų tema palaiko pasirinktines antraštes, ir pabandykite dar kartą.','The active theme has the following error: "%s".'=>'Dabartinė išvaizdos tema turi tokią klaidą: "%s".','The active theme is broken. Reverting to the default theme.'=>'Aktyvuota tema neveikia. Įjungiama numatytoji tema.','The active theme is displayed highlighted as the first theme.'=>'Įjungta tema rodoma pati pirma ir yra paryškinta.','The admin email verification page will reappear after %s.'=>'Administratoriaus el. pašto adreso patvirtinimo langas bus rodomas po %s.','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'Informacijos, kurią privalote čia pateikti, kiekis priklauso nuo Jūsų vietinių ar nacionalinių įstatymų. Gali būti, kad Jūs privalote pateikti fizinį adresą, registracijos adresą ar Jūsų įmonės/organizacijos registracijos numerį.','The application ID must be a UUID.'=>'Programos ID turi būti UUID.','The application password feature requires HTTPS, which is not enabled on this site.'=>'Programėlių slaptažodžių funkcijai reikia HTTPS, kuris šiame tinklalapyje nėra įjungtas.','The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.'=>'Kraštinių santykis yra ryšys tarp pločio ir aukščio. Jūs galite išsaugoti kraštinių santykį, jei keisdami pasirinktos zonos dydį, laikysite nuspaudę Shift klavišą. Taip pat galite naudoti specialius laukelius ir įvesti juose norimą kraštinių santykį, pvz.: 1:1 (kvadratas), 4:3, 16:9 ir t.t.','The attached file cannot be found.'=>'Susietas failas nerastas.','The authenticity of %s could not be verified as no signature was found.'=>'%s: nepavyko patvirtinti autentiškumo, nes nerastas parašas.','The authenticity of %s could not be verified as signature verification is unavailable on this system.'=>'%s: nepavyko patvirtinti autentiškumo, nes neprieinamas parašo verifikavimas.','The authenticity of %s could not be verified.'=>'%s: nepavyko patvirtinti autentiškumo.','The authorization header is invalid'=>'Autorizavimo antraštė netinkama.','The authorization header is missing'=>'Trūksta autorizavimo antraštės.','The block editor requires JavaScript. Please enable JavaScript in your browser settings, or activate the <a href="%s">Classic Editor plugin</a>.'=>'Blokų redaktoriui būtinas Java