 under version control (%2$s).'=>'Aplankas %1$s galimai yra versijuojamas (%2$s).','The following plugins failed to update:'=>'Šie įskiepiai nebuvo atnaujinti:','The following plugins have new versions available. Check the ones you want to update and then click &#8220;Update Plugins&#8221;.'=>'Yra naujesnės pateiktų įskiepių versijos. Pasirinkite tuos, kuriuos norite atnaujinti, ir spauskite „Atnaujinti įskiepius“.','The following plugins were successfully updated:'=>'Šie įskiepiai sėkmingai atnaujinti:','The following themes are installed but incomplete.'=>'Šios temos yra įdiegtos, bet nepilnos.','The following themes failed to update:'=>'Šios temos nebuvo atnaujintos:','The following themes have new versions available. Check the ones you want to update and then click &#8220;Update Themes&#8221;.'=>'Yra naujesnės pateiktų temų versijos. Pasirinkite tas, kurias norite atnaujinti, ir spauskite „Atnaujinti temas“.','The following themes were successfully updated:'=>'Šios temos sėkmingai atnaujintos:','The following translations failed to update:'=>'Šie vertimai nebuvo atnaujinti:','The following translations were successfully updated:'=>'Šie vertimai sėkmingai atnaujinti:','The fonts directory'=>'Šriftų direktorija','The ftp PHP extension is not available'=>'Ftp PHP plėtinys nepasiekiamas','The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.'=>'Tinklelio išdėstymui Failų saugykloje reikalingas Java Script. <a href="%s">Naudoti sąrašo išdėstymą</a>.','The installer attempted to contact a random hostname (%s) on your domain.'=>'The installer attempted to contact a random hostname (%s) on your domain.','The item you are trying to move to the Trash no longer exists.'=>'Įrašas, kurį norite perkelti į šiukšlinę, jau neegzistuoja.','The item you are trying to restore from the Trash no longer exists.'=>'Įrašas, kurį norite atkurti iš šiukšlinės, jau neegzistuoja.','The language pack is missing either the %1$s, %2$s, or %3$s files.'=>'Kalbos pakete trūksta %1$s, %2$s arba %3$s failų.','The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.'=>'Kairėje esančiame meniu sudėtos nuorodos į visus WordPress administravimo aplinkos puslapius. Sub-punktai parodomi užėjus su pele ant konkretaus punkto. Šis meniu gali būti suskleistas iki siauros juostelės paspaudus ant "Suskleisti meniu" rodyklės pačioje jo apačioje.','The loopback request returned an unexpected http status code, %d, it was not possible to determine if this will prevent features from working as expected.'=>'Loopback užklausa grąžino netinkamą http statuso kodą - %d, todėl negalime nustatyti, ar visos funkcijos veiks tinkamai.','The loopback request to your site completed successfully.'=>'Loopback užklausa į Jūsų tinklalapį sėkmingai įvykdyta.','The loopback request to your site failed, this means features relying on them are not currently working as expected.'=>'Loopback užklausos į Jūsų tinklalapį nepavyko įvykdyti, tai reiškia, kad funkcijos, kurios priklauso nuo tokių užklausų, šiuo metu neveiks tinkamai.','The main WordPress directory'=>'Pagrindinė WordPress direktorija','The menu has been successfully deleted.'=>'Vartotojo meniu ištrintas.','The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.'=>'Meniu skirtas atskirų tinklalapių informacijos taisymui, ypač jei svetainės valdymo sritis yra nepasiekiama.','The menu item has been successfully deleted.'=>'Vartotojo meniu elementas ištrintas.','The menu management box at the top of the screen is used to control which menu is opened in the editor below.'=>'Ekrano viršuje esantis menu pasirinkimo laukas naudojamas nustatyti, kuris meniu bus keičiamas žemiau esančiame redagavimo lauke.','The minimum recommended version of PHP is %s.'=>'Minimali rekomenduojama PHP versija yra %s.','The must use plugins directory'=>'Privalomų įskiepių direktorija','The name of the database you want to use with WordPress.'=>'Duomenų bazės, kurią norite naudoti su WordPress, pavadinimas.','The network already exists.'=>'Tinklas jau egzistuoja.','The new page will include help and suggestions for your privacy policy.'=>'Naujasis puslapis turės specialų teksto šabloną, kuriame pateikiamos rekomendacijos ir pasiūlymai Jūsų privatumo politikos tekstui.','The optional module, %s, is not installed, or has been disabled.'=>'Rekomenduojamas modulis %s yra neįdiegtas arba išjungtas.','The options shown below relate to your server setup. If changes are required, you may need your web host&#8217;s assistance.'=>'Žemiau surašyti nustatymai priklauso nuo Jūsų serverio. Norint juos pakeisti, gali reikėti kreiptis į savo hostingo tiekėją.','The package contains no files.'=>'Pakete nėra failų.','The package could not be installed.'=>'Paketo instaliuoti nepavyko.','The parent theme, <strong>%1$s %2$s</strong>, is currently installed.'=>'Tėvinė tema <strong>%1$s %2$s</strong> yra šiuo metu įdiegta.','The password you chose during installation.'=>'Diegimo metu pasirinktas slaptažodis.','The plugin %1$s has been deactivated due to an error: %2$s'=>'Įskiepis %1$s buvo išjungtas dėl klaidos: %2$s','The plugin cannot be updated due to the following:'=>'Įskiepis negali būti atnaujinta dėl šių priežasčių:','The plugin contains no files.'=>'Įskiepis neturi failų.','The plugin does not have a valid header.'=>'The plugin does not have a valid header.','The plugin generated %d character of <strong>unexpected output</strong> during activation.'=>'Bandant įjungti, šis įskiepis sugeneravo %d simbolį <strong>netikėtos išvesties</strong>.' . "\0" . 'Bandant įjungti, šis įskiepis sugeneravo %d simbolius <strong>netikėtos išvesties</strong>.' . "\0" . 'Bandant įjungti, šis įskiepis sugeneravo %d simbolių <strong>netikėtos išvesties</strong>.','The plugin generated unexpected output.'=>'The plugin generated unexpected output.','The plugin is at the latest version.'=>'Šis įskiepis yra naujausios versijos.','The plugins directory'=>'Įskiepių direktorija','The primary site you chose does not exist.'=>'Tinklalapis, kurį norite nustatyti kaip pagrindinį, neegzistuoja.','The required module, %s, is not installed, or has been disabled.'=>'Būtinas modulis %s yra neįdiegtas arba išjungtas.','The scheduled event, %s, failed to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'Nepavyko atlikti suplanuoto veiksmo %s. Jūsų tinklalapis veikia, tačiau suplanuotų įrašų skelbimas ar automatiniai atnaujinimai gali neveikti tinkamai.','The scheduled event, %s, is late to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'Suplanuotas veiksmas %s vėluoja. Jūsų tinklalapis veikia, tačiau suplanuotų įrašų skelbimas ar automatiniai atnaujinimai gali neveikti tinkamai.','The search for installed plugins will search for terms in their name, description, or author.'=>'Įdiegtų įskiepių paieška atrinks juos pagal raktinius žodžius pavadinime, aprašyme ir autoriaus varde.','The search for installed themes will search for terms in their name, description, author, or tag.'=>'Instaliuotų temų paieška veikia ieškant nurodytų žodžių temos pavadinime, aprašyme, autoriaus varde arba žymose.','The selected plugin has been deleted.'=>'Pasirinktas įskiepis buvo ištrintas.','The selected plugins have been deleted.'=>'Pasirinkti įskiepiai buvo ištrinti.','The setting for %1$s is currently configured as 0, this could cause some problems when trying to upload files through plugin or theme features that rely on various upload methods. It is recommended to configure this setting to a fixed value, ideally matching the value of %2$s, as some upload methods read the value 0 as either unlimited, or disabled.'=>'Nustatymas %1$s šiuo metu turi reikšmę 0, tai gali kelti tam tikrų problemų kai bandoma failus įkelti per įskiepį ar temos nustatymus, kai naudojami įvairūs įkėlimo būdai. Rekomenduojama nustatyti fiksuotą reikšmę, idealiai atitinkančią %2$s reikšmę, nes tam tikri įkėlimo būdai reikšmę 0 priima kaip neribotą, ar išjungtą.','The setting for %1$s is smaller than %2$s, this could cause some problems when trying to upload files.'=>'Nustatyta %1$s reikšmė yra mažesnė nei %2$s, tai gali sukelti problemų įkeliant failus.','The seventh parameter passed to %s should be numeric representing menu position.'=>'Septintasis parametras, perduotas %s turi būti sveikas skaičius nurodantis meniu poziciją.','The site editor requires JavaScript. Please enable JavaScript in your browser settings.'=>'Tinklapio redaktorius reikalauja JavaScript. Įjunkite JavaScript jūsų naršyklės nustatymuose.','The site health check shows information about your WordPress configuration and items that may need your attention.'=>'Tinklalapio būklės patikrinimas parodo svarbiausią informaciją apie Jūsų WordPress konfigūraciją ir pateikia rekomendacijas, į ką reiktų atkreipti dėmesį.','The size cannot be calculated. The directory is not accessible. Usually caused by invalid permissions.'=>'Nepavyko apskaičiuoti dydžio. Direktorija yra neprieinama. Dažniausiai taip įvyksta dėl neteisingų prieigos nustatymų (permissions).','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'Žemiau nurodyti dydžiai yra maksimalūs paveikslėlio, keliamo į Failų saugyklą, išmatavimai pikseliais.','The source and destination are the same.'=>'Šaltinis ir paskirties vieta yra tie patys.','The ssh2 PHP extension is not available'=>'ssh2 PHP plėtinys nepasiekiamas','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'Rekomenduojamas privatumo politikos tekstas buvo pakeistas. Prašome <a href="%s">peržiūrėti rekomendacijas</a> ir atnaujinti savo privatumo politiką.','The template contains a suggestion of sections you most likely will need. Under each section heading, you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.'=>'Čia surašyti skyriai, kuriuos rekomenduojame įtraukti į Privatumo poltiką. Po kiekvieno skyriaus antrašte Jūs rasite trumpą santrauką apie informaciją, kurią turite ten pateikti. Kai kuriuose skyriuose pateikėme siūlomą turinį, tačiau yra ir tokių, kuriuose Jums reikės pačiam surašyti reikiamą informaciją pagal naudojamą temą ir įskiepius.','The temporary backup directory exists but is not writable'=>'Laikina atsarginės kopijos direktorija egzistuoja, bet į ją negalima įrašyti','The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Activate &amp; Publish button above the menu.'=>'Peržiūrima tema yra visiškai dinamiška &mdash; Jūs galite naršyti po skirtingus tinklalapio puslapius ir apžiūrėti, kaip ši tema vaizduoja įrašus, archyvus bei kitų puslapių šablonus. Galimi nustatymai yra skirtingi pagal tai, ką peržiūrima tema palaiko vaizdžiąjame režime. Norėdami išsaugoti naujus nustatymus ir aktyvuoti konkrečią temą vienu paspaudimus, tiesiog spustelėkite ant mygtuko "Išsaugoti ir aktyvuoti".','The theme cannot be updated due to the following:'=>'Išvaizdos tema negali būti atnaujinta dėl šių priežasčių:','The theme contains no files.'=>'Temoje nėra failų.','The theme is at the latest version.'=>'Ši tema yra naujausios versijos.','The theme is missing the %s stylesheet.'=>'Išvaizdos temai trūksta %s stilių failo.','The theme you are currently using is not widget-aware, meaning that it has no sidebars that you are able to change. For information on making your theme widget-aware, please <a href="https://developer.wordpress.org/themes/functionality/widgets/">follow these instructions</a>.'=>'Jūsų naudojama tema neturi nė vienos valdiklių srities, kurią būtų galima naudoti. Jei norite sužinoti, ką reikia padaryti, kad tema turėtų valdiklių sričių, <a href="https://developer.wordpress.org/themes/functionality/widgets/">skaitykite šias instrukcijas</a>.','The themes directory'=>'Temų direktorija','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.'=>'Pavadinimo įvedimo laukas ir įrašo redagavimo vieta yra fiksuoti savo vietose, tačiau visus kitus elementus puslapyje galite sudėlioti kaip Jums patogiau - tiesiog vilkdami pele. Taip pat šiuos elementus galite suskleisti ar vėl išskleisti, paspaudę ant jų pavadinimų. Norėdami matyti daugiau galimų elementų (pvz. Ištrauka, Siųsti atgalines nuorodas, Vartotojo laukai, Diskusija, Slug, Autorius) arba pasirinkti rodymą 1 ar 2 stulpeliais, žiūrėkite skiltį "Ekrano nustatymai".','The tool associates data stored in WordPress with a supplied email address, including profile data and comments.'=>'Įrankis susieja WordPress svetainėje laikomus duomenis naudodamas suteiktą el. pašto adresą, įskaitant profilio duomenis ir komentarus.','The update cannot be installed because WordPress %1$s requires MySQL version %2$s or higher. You are running version %3$s.'=>'Atnaujinimas negali būti įdiegtas, nes WordPress %1$s sistemos darbui reikia %2$s ar naujesnės MySQL versijos. Jūs naudojate MySQL %3$s.','The update cannot be installed because WordPress %1$s requires PHP version %2$s or higher and MySQL version %3$s or higher. You are running PHP version %4$s and MySQL version %5$s.'=>'Atnaujinimas negali būti įdiegtas, nes WordPress %1$s sistemos darbui reikia %2$s ar naujesnės PHP ir %3$s ar naujesnės MySQL. Jūs naudojate %4$s PHP ir %5$s MySQL versijas.','The update cannot be installed because WordPress %1$s requires PHP version %2$s or higher. You are running version %3$s.'=>'Atnaujinimas negali būti įdiegtas, nes WordPress %1$s sistemos darbui reikia %2$s ar naujesnės PHP versijos. Jūs naudojate PHP %3$s.','The update cannot be installed because WordPress %1$s requires the %2$s PHP extension.'=>'Šis atnaujinimas negali būti įdiegtas, nes WordPress versijai %1$s būtinas PHP plėtinys %2$s.','The update cannot be installed because some files could not be copied. This is usually due to inconsistent file permissions.'=>'Atnaujinimo instaliuoti neįmanoma, nes nepavyksta nukopijuoti kai kurių failų. Dažniausiai taip yra dėl netinkamų failų leidimų serveryje.','The update cannot be installed because your site is unable to copy some files. This is usually due to inconsistent file permissions.'=>'Atnaujinimo instaliuoti neįmanoma, nes nepavyksta nukopijuoti kai kurių failų. Dažniausiai taip yra dėl netinkamų failų leidimų serveryje.','The update could not be unpacked'=>'The update could not be unpacked','The update of %s failed.'=>'Bandymas atnaujinti „%s“ nepavyko.','The update process is starting. This process may take a while on some hosts, so please be patient.'=>'Pradedamas atnaujinimo procesas. Būkite kantrūs, nes jis gali užtrukti.','The upgrade directory cannot be created'=>'Atnaujinimo direktorijos sukurti neįmanoma','The upgrade directory exists but is not writable'=>'Atnaujinimo direktorija egzistuoja, bet į ją negalima įrašyti','The uploaded file could not be moved to %s.'=>'Įkelto failo nepavyko perkelti į %s.','The uploaded file exceeds the %1$s directive in %2$s.'=>'Įkeltas failas viršyja %1$s nustatymą %2$s faile.','The uploaded file exceeds the %s directive that was specified in the HTML form.'=>'Įkelto failo dydis viršija HTML formoje nurodytą %s direktyvą.','The uploaded file has expired. Please go back and upload it again.'=>'Baigėsi įkelto failo galiojimo laikas. Grįžkite ir įkelkite iš naujo.','The uploaded file is not a valid image. Please try again.'=>'Įkeltas failas nėra tinkamas paveikslėlis. Bandykite dar kartą.','The uploaded file was only partially uploaded.'=>'The uploaded file was only partially uploaded.','The uploads directory'=>'Failų direktorija','The username you provided has invalid characters.'=>'Įvestas vartotojo vardas turi neleistinų simbolių.','The value, %1$s, has either been enabled by %2$s or added to your configuration file. This will make errors display on the front end of your site.'=>'Jūsų tinklalapyje aktyvus %1$s, tai padaryta arba įjungus %2$s arba pridėjus jį į konfigūracijos failą. Dėl to Jūsų tinklalapio techninės klaidos yra matomos lankytojams.','The value, %s, has been added to this website&#8217;s configuration file. This means any errors on the site will be written to a file which is potentially available to all users.'=>'Jūsų tinklalapio konfigūracijos faile įrašyta reikšmė %s. Tai reiškia, kad bet kokios tinklalapio klaidos bus įrašytos į failą, kuris galimai prieinamas paprastiems vartotojams.','The wp-content directory'=>'wp-content direktorija','Theme File Editor'=>'Temos failų redaktorius','Theme Files'=>'Temos failai','Theme Footer'=>'Temos poraštė','Theme Functions'=>'Theme Functions','Theme Header'=>'Temos antraštė','Theme Installation'=>'Temos diegimas','Theme InstallerTag'=>'Žyma','Theme Location'=>'Meniu vieta temoje','Theme Options'=>'Temos nuostatos','Theme Styles & Block Settings'=>'Temos stiliaus ir blokų nustatymai','Theme Versions'=>'Temų versijos','Theme could not be deleted.'=>'Temos ištrinti nepavyko.','Theme could not be resumed because it triggered a <strong>fatal error</strong>.'=>'Tema negali būti įjungta, nes sukelia <strong>kritinę klaidą</strong>.','Theme deleted.'=>'Tema ištrinta.','Theme directory location'=>'Temų direktorijos vieta','Theme downgrade failed.'=>'Išvaizdos temos pasendinti nepavyko.','Theme downgraded successfully.'=>'Išvaizdos tema sėkmingai pasendinta.','Theme features'=>'Temų informacija','Theme installation failed.'=>'Temos diegimas nepavyko.','Theme installed successfully.'=>'Tema įdiegta sėkmingai.','Theme name'=>'Išvaizdos temos pavadinimas','Theme resumed.'=>'Tema vėl veikia.','Theme temporary backup directory exists but is not writable'=>'Temos laikinosios atsarginės kopijos direktorija egzistuoja, bet į ją negalima įrašyti','Theme update failed.'=>'Temos atnaujinimas nepavyko.','Theme updated successfully.'=>'Tema atnaujinta sėkmingai.','Theme will be auto-updated.'=>'Išvaizdos tema bus atnaujinama automatiškai.','Theme will no longer be auto-updated.'=>'Išvaizdos tema daugiau nebus atnaujinama automatiškai.','Theme zip file'=>'Temos zip failas','Themes %s'=>'Temos %s','Themes add your site&#8217;s look and feel. It&#8217;s important to keep them up to date, to stay consistent with your brand and keep your site secure.'=>'Temos nustato, kaip Jūsų tinklalapis atrodo. Svarbu nuolat atnaujinti naudojamas temas, kad Jūsų tinklalapis išliktų vientiso stiliaus bei būtų saugesnis.','Themes directory location'=>'Temų direktorijos vieta','Themes directory size'=>'Temų direktorijos dydis','Themes list'=>'Išvaizdos temų sąrašas','There appear to be no issues with plugin and theme auto-updates.'=>'Nėra problemų su įskiepių ir temų automatiniu atnaujinimu.','There are no events scheduled near %1$s at the moment. Would you like to <a href="%2$s">organize a WordPress event</a>?'=>'Šiuo metu Jūsų ieškotame mieste (%1$s) nėra suplanuotų renginių. Gal norite <a href="%2$s">suorganizuoti</a>?','There are no events scheduled near you at the moment. Would you like to <a href="%s">organize a WordPress event</a>?'=>'Šiuo metu arti Jūsų nėra suplanuotų renginių. Gal norite <a href="%s">suorganozuoti</a>?','There are no pages.'=>'Puslapių nėra.','There are no valid users selected for deletion.'=>'Nepasirinkta vartotojų, kuriuos būtų galima ištrinti.','There are no valid users selected for removal.'=>'Nepasirinktas nei vienas vartotojas, kurį būtų galima pašalinti.','There are some invalid menu items. Please check or delete them.'=>'Meniu yra neteisingų punktų. Pakeiskite arba ištrinkite juos.','There are unsaved changes that will be lost. \'OK\' to continue, \'Cancel\' to return to the Image Editor.'=>'Yra neišsaugotų pakeitimų, kurie bus prarasti jei išeisite. Paspauskite "Taip" norėdami išeiti, arba "Cancel" jei norite sugrįžti į paveikslėlių redaktorių.','There is a new kind of WordPress theme, called a block theme, that lets you build the site you&#8217;ve always wanted &#8212; with blocks and styles.'=>'Yra nauja WordPress temų rūšis, vadinamosios blokų temos, kurios leidžia lengviau sukurti tinklalapį, kokio visada norėjote &#8212; naudojant blokus ir stilius.','There is a new version of %1$s available, but it does not work with your version of PHP. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s">learn more about updating PHP</a>.'=>'Yra nauja %1$s versija, tačiau ji neveikia su Jūsų naudojama PHP versija. <a href="%2$s" %3$s>Peržiūrėkite versijos %4$s informaciją</a> arba <a href="%5$s">sužinokite daugiau apie PHP atnaujinimą</a>.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s" %6$s>update now</a>.'=>'Yra nauja %1$s versija. <a href="%2$s" %3$s>Peržiūrėkite versijos %4$s informaciją</a> arba <a href="%5$s" %6$s>atnaujinkite dabar</a>.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'Yra nauja %1$s versija. <a href="%2$s" %3$s>Peržiūrėkite versijos %4$s informaciją</a>.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'Yra nauja %1$s versija. <a href="%2$s" %3$s>Peržiūrėkite versijos %4$s informaciją</a>. <em>Šio įskiepio negalima atnaujinti automatiškai.</em>','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'Yra nauja %1$s versija. <a href="%2$s" %3$s>Peržiūrėkite versijos %4$s informaciją</a>. <em>Šios temos negalima atnaujinti automatiškai.</em>','There is a pending change of the admin email to %s.'=>'Yra numatytas administravimo el. pašto adreso pakeitimas į %s.','There is a pending change of your email to %s.'=>'Yra numatytas jūsų el. pašto keitimas į %s.','There is a static %s file in your installation folder. WordPress cannot dynamically serve one.'=>'Jūsų diegimo aplanke yra statinis %s failas. WordPress negali jo dinamiškai pateikti.','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'Šis įrašas turi naujesnę automatiškai išsaugotą versiją nei esanti rašyklėje žemiau. <a href="%s">Peržiūrėti auto-versiją</a>','There is no need to change your CSS here &mdash; you can edit and live preview CSS changes in the <a href="%s">built-in CSS editor</a>.'=>'Nėra reikalo keisti CSS čia &mdash; galite redaguoti ir gyvai matyti pasikeitimus naudojant <a href="%s">vidinį CSS redaktorių</a>.','There is not enough free disk space to complete the update.'=>'Diske nėra pakankamai vietos sėkmingai atlikti atnaujinimą.','There was %d client caching response header detected:'=>'Buvo aptikta %d kliento spartinančioji atsakymo antraštė:' . "\0" . 'Buvo aptiktos %d kliento spartinančiosios atsakymo antraštės:' . "\0" . 'Buvo aptikta %d kliento spartinančiųjų atsakymo antraščių:','There was an error while trying to update the file. You may need to fix something and try updating again.'=>'Išsaugant failą pastebėta klaida. Patikrinkite kodą ir bandykite vėl.','These plugins are now up to date:'=>'Šie įskiepiai yra naujausių versijų:','These plugins may be active on other sites in the network.'=>'Šie įskiepiai gali būti aktyvūs kituose Jūsų tinklo tinklalapiuose.','These settings alter where and how parts of WordPress are loaded.'=>'Šiais nustatymais keičiama iš kur ir kaip užkraunami WordPress komponentai.','These suggestions are based on the plugins you and other users have installed.'=>'Šie pasiūlymai yra generuojami pagal Jūsų ir kitų vartotojų instaliuotus įskiepius.','These themes are now up to date:'=>'Šios temos yra naujausių versijų:','These themes failed to update:'=>'Šios temos nebuvo atnaujintos:','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'Šie tinklalapiai gali rinkti duomenis apie Jus, naudoti slapukus (cookies), trečiųjų šalių sekimo paslaugas ir stebėti Jūsų veiksmus su įkeltu turiniu, įskaitant ir tuos atvejus, kai turite paskyrą ir esate prisijungęs prie minėtų tinklalapių.','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'Šiai <a href="%1$s">potemei</a> būtina jos tėvinė tema, %2$s.','This address is used for admin purposes. If you change this, an email will be sent to your new address to confirm it. <strong>The new address will not become active until confirmed.</strong>'=>'Šis adresas naudojamas administravimo reikmėms. Jei pakeisite el. pašto adresą, jums bus išsiųstas laiškas, kad patvirtintumėte šį savo pasirinkimą. <strong>Naujas el. pašto adresas nebus aktyvuotas, kol jo nepatvirtinsite.</strong>','This child theme inherits templates from a parent theme, %s.'=>'Potemė paveldi tėvinės temos šabloną, %s.','This comment is already approved.'=>'Šis komentaras jau patvirtintas.','This comment is already in the Trash.'=>'Šis komentaras jau šiukšlinėje.','This comment is already marked as spam.'=>'Šis komentaras jau pažymėtas kaip šlamštas.','This comment is currently approved.'=>'Šis komentaras patvirtintas.','This comment is currently in the Trash.'=>'Šis komentaras yra šiukšlinėje.','This comment is currently marked as spam.'=>'Šis komentaras pažymėtas kaip šlamštas.','This comment is in the Trash. Please move it out of the Trash if you want to edit it.'=>'Šis komentaras yra šiukšlinėje, iškelkite jį iš ten, jei norite redaguoti.','This could mean that connections are failing to WordPress.org.'=>'Tai gali reikšti, kad nepavyksta prisijungti prie WordPress.org.','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'Šie duomenys yra naudojami WordPress tobulinimui, o taip pat saugumo užtikrinimui automatiškai surandant ir įdiegiant naujausius atnaujinimus. Duomenyst taip pat naudojami apibendrintai statistikai, tokiai kaip matoma <a href="%s">WordPress.org statistikos puslapyje</a>.','This draft comes from your <a href="%s">unpublished customization changes</a>. You can edit, but there is no need to publish now. It will be published automatically with those changes.'=>'Šis juodraštis yra iš jūsų <a href="%s">nepublikuotų vaizdžiojo režimo pakeitimų</a>. Galite redaguoti, tačiau nereikia jo dabar publikuoti. Šis įrašas bus automatiškai paskelbtas, kai bus paskelbti vaizdžiojo režimo pakeitimai.','This feature will create a temporary backup of a plugin or theme before it is upgraded. This backup is used to restore the plugin or theme back to its previous state if there is an error during the update process.'=>'Ši funkcija sukurs laikiną įskiepio ar temos atsarginę kopiją prieš ją atnaujinant. Ši atsarginė kopija naudojama norint atkurti ankstesnę įskiepio ar temos būseną, jei atnaujinimo proceso metu įvyksta klaida.','This format, which is called WordPress eXtended RSS or WXR, will contain your posts, pages, comments, custom fields, categories, and tags.'=>'Šis formatas, kuris vadinamas WordPress eXtended RSS, arba WXR, apima įrašus, puslapius, komentarus, vartotojo laukus, kategorijas ir žymas.','This importer is not installed. Please install importers from <a href="%s">the main site</a>.'=>'Importeris neinstaliuotas. Prašome instaliuoti imporetrį iš <a href="%s">pagrindinio tinklalapio</a>.','This information is being used to create a %s file.'=>'Ši informacija naudojama kuriant %s failą.','This is a child theme of %s.'=>'Tai temos „%s“ potemė.','This is a file in your current parent theme.'=>'Tai dabartinėje tėvinėje temoje esantis failas.','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'Tai yra puslapio pavyzdys. Puslapis šiek tiek skiriasi nuo įrašo, nes išlieka vienoje vietoje ir daugelyje temų rodomas meniu juostoje. Dažniausiai pirmasis sukurtas puslapis yra „Apie“, kuriame tinklalapis pristatomas lankytojams. Šis puslapis gali atrodyti taip:','This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.'=>'Tai ne paprastas įskiepis - kartu jis yra visos kartos vilties ir ryžto simbolis, sudėtas į du žodžius, kurie geriausiai žinomi kaip Louis Armstrong daina <cite>Hello, Dolly</cite>. Kai šis įskiepis aktyvuotas, Jūsų administravimo aplinkoje, kiekvieno puslapio viršutiniame dešiniąjame kampe bus rodoma atsitiktinė eilutė iš šios dainos.','This is the final release of WordPress %s'=>'Tai paskutinė WordPress %s versija','This item has already been deleted.'=>'Šis įrašas jau ištrintas.','This localized version contains both the translation and various other localization fixes.'=>'Ši lokalizuota versija turi vertimus ir kitus lokalizavimo pataisymus.','This means your site may be offline or broken. Don\'t panic; this can be fixed.'=>'Tai reiškia, kad Jūsų tinklalapis yra nepasiekiamas arba neveikia. Nesijaudinkite - tai sutvarkoma.','This meta box is not compatible with the block editor.'=>'Šis laukas nesuderinamas su blokų redaktoriumi.','This meta box, from the %s plugin, is not compatible with the block editor.'=>'Šis laukelis, kurį aktyvuoja įskiepis %s, nėra suderinamas su blokų redaktoriumi.','This page allows direct access to your site settings. You can break things here. Please be cautious!'=>'Šiame puslapyje turite tiesioginę prieigą prie tinklalapio nustatymų. Pakeitimus atlikite itin atsargiai, galite pakenkti tinklalapiui.','This page can show you every detail about the configuration of your WordPress website. For any improvements that could be made, see the <a href="%s">Site Health Status</a> page.'=>'Šiame puslapyje pateikiama išsami informacija apie Jūsų WordPress tinklalapio konfigūraciją. Jei kažką galima pagerinti, tai bus surašyta  <a href="%s">Tinklalapio būklės statuso</a> puslapyje.','This password will not be stored on the server.'=>'Šis slaptažodis nebus saugomas serveryje.','This plugin cannot be activated because required plugins are missing or inactive.'=>'Šio įskiepio įjungti negalima, nes nėra reikiamų įskiepių arba jie yra neaktyvūs.','This plugin does not work with your version of PHP.'=>'Šis įskiepis neveikia su Jūsų naudojama PHP versija.','This plugin does not work with your version of WordPress.'=>'Šis įskiepis neveikia su Jūsų naudojama WordPress versija.','This plugin does not work with your versions of WordPress and PHP.'=>'Šis įskiepis neveikia su Jūsų naudojamomis WordPress ir PHP versijomis.','This plugin failed to load properly and is paused during recovery mode.'=>'Šio įskiepio nepavyko tinkamai užkrauti atstatymo režimo metu, todėl jis yra sustabdytas.','This plugin is already installed.'=>'Šis įskiepis jau įdiegtas.','This plugin may be active on other sites in the network.'=>'Šie įskiepiai gali būti įjungti kituose tinklo tinklalapiuose.','This post is being backed up in your browser, just in case.'=>'Šio įrašo kopija atsargumo dėlei išsaugoma ir jūsų naršyklėje.','This preview is unavailable in the editor.'=>'Ši peržiūra negalima redaktoriuje.','This resulted in an error message: %s'=>'This resulted in an error message: %s','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'Šiame puslapyje Jūs galite pasirinkti savo nuorodų struktūrą. Galite pasirinkti iš siūlomų nustatymų arba sukurti savo URL struktūrą.','This screen allows you to edit fields for metadata in a file within the media library.'=>'Čia galite redaguoti failo, esančio Failų saugykloje, metaduomenų eilutes.','This screen allows you to obtain a health diagnosis of your site, and displays an overall rating of the status of your installation.'=>'Šiame puslapyje galite atlikti tinklalapio būklės diagnostiką ir pamatyti bendrą jo būklės įvertinimą.','This screen contains the settings that affect the display of your content.'=>'Šiame puslapyje pateikiami nustatymai, kurios lemia, kaip jūsų kurtas turinys bus pateikiamas skaitytojams.','This screen includes suggestions to help you write your own privacy policy. However, it is your responsibility to use these resources correctly, to provide the information required by your privacy policy, and to keep this information current and accurate.'=>'Šiame puslapyje pateikiami pasiūlymai, kurie padės jums parašyti savo privatumo politiką. Tačiau už tinkamą privatumo politikos tekstą esate atsakingas j9s pats - privalote pateikti joje reikalaujamą informaciją ir užtikrinti, kad ši informacija būtų nauja ir tiksli.','This screen is used for globally assigning menus to locations defined by your theme.'=>'Šiame puslapyje galite priskirti konkrečius meniu į jiems numatytas vietas Jūsų temoje.','This screen is used for managing your content revisions.'=>'Ši skiltis naudojama turinio versijoms tvarkyti.','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'Šiame puslapyje Jūs galite instaliuoti ir tvarkyti jau instaliuotas temas. Šalie numatytųjų temų, kurios būna pridėtos į standartinę WordPress instaliaciją, Jūs galite naudoti ir kitas temas, sukurtas ir palaikomas trečiųjų šalių.','This screen is used for managing your navigation menus.'=>'Ši skiltis naudojama Jūsų sukurtų meniu tvarkymui.','This screen is used to customize the header section of your theme.'=>'Šiame puslapyje galite keisti savo tinklalapio temos antraštės vaizdą.','This screen is where you manage requests for an export of personal data.'=>'Šiame puslapyje galite tvarkyti prašymus eksportuoti asmens duomenis.','This screen is where you manage requests to erase personal data.'=>'Šiame puslapyje galite tvarkyti prašymus ištrinti asmens duomenis.','This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.'=>'Šiame puslapyje rodomi visi su jūsų tinklalapiu susiję vartotojai. Kiekvienas vartotojas turi savo rolę: Administratorius (turi visas administravimo galimybes). Redaktorius (gali skelbti ir redaguoti savo ir kitų įrašus ir puslapius). Autorius (gali skelbti ir redaguoti tik savo įrašus). Pagalbininkas (gali rašyti ir redaguoti savo įrašus, bet negali savarankiškai jų paskelbti). Skaitytojas (gali tik redaguoti savo profilio informaciją). Priklausomai nuo rolės, skirsis ir vartotojui matomų nuostatų kiekis.','This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.'=>'Čia pateikiami įskiepiai, skirti importuoti turinį iš kitų tinklaraščių ar panašių platformų. Pasirinkite platformą, iš kurios norite importuoti, ir atsidariusiame lange paspauskite „Įdiegti“. Jei žemiau pateiktame sąraše nėra jūsų naudotos platformos, pabandykite rasti tinkamą įskiepį žemiau esančioje nuorodoje į įskiepių katalogą.','This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.'=>'Šiame puslapyje matysite visus savo įrašus. Puslapio išdėstymą ir rodomus elementus galite nusistatyti taip, kaip Jums patogiausia.','This screen provides many options for controlling the management and display of comments and links to your posts/pages. So many, in fact, they will not all fit here! :) Use the documentation links to get information on what each discussion setting does.'=>'Šiame puslapyje rasite daugybę nustatymų, kuriais valdomas komentarų bei atgalinių nuorodų į Jūsų įrašus/puslapius rodymas. Iš tikrųjų, tų nustatymų čia tiek daug, kad visa informacija apie juos čia net netilpo. Norėdami sužinoti, ką tiksliai kiekvienas komentarų nustatymas reiškia, pasinaudokite nuorodomis į dokumentaciją.','This screen shows an individual user all of their sites in this network, and also allows that user to set a primary site. They can use the links under each site to visit either the front end or the dashboard for that site.'=>'Šiame puslapyje vartotojui rodomi visi jo tinklalapiai šiame tinkle, taip pat leidžiama nustatyti pirminį tinklalapį. Prie kiekvieno tinklalapio yra nuorodos - į to tinklalapio skydelį ir į jį patį.','This sidebar is no longer available and does not show anywhere on your site. Remove each of the widgets below to fully remove this inactive sidebar.'=>'Ši šoninė sritis nenaudojama ir nerodoma niekur Jūsų tinklalapyje. Pašalinkite iš jos visus valdiklius, ir ji nebus rodoma visiškai.','This site appears to be under version control. Automatic updates are disabled.'=>'Šio tinklalapio kodas versijuojamas. Automatiniai atnaujinimai išjungti.','This site is automatically kept up to date with each new version of WordPress.'=>'Šis tinklalapis automatiškai atnaujinamas visomis naujomis WordPress versijomis.','This site is automatically kept up to date with maintenance and security releases of WordPress only.'=>'Šis tinklalapis automatiškai atnaujinamas tik saugumo ir priežiūros WordPress versijomis.','This site will not receive automatic updates for new versions of WordPress.'=>'Šiame tinklalapyje WordPress nebus automatiškai atnaujinamas.','This text template will help you to create your website&#8217;s privacy policy.'=>'Šis teksto šablonas padės Jums sukurti Jūsų tinklalapio privatumo politiką.','This theme has not been rated yet.'=>'Ši tema dar nebuvo įvertinta.','This theme is already installed.'=>'Ši tema jau įdiegta.','This theme is broken.'=>'Ši tema neveikia.','This theme requires a parent theme. Checking if it is installed&#8230;'=>'Šiai temai būtina tėvinė tema. Tikrinama, ar ji įdiegta&#8230;','This timezone does not observe daylight saving time.'=>'Šioje laiko zonoje negalioja vasaros-žiemos laikas.','This timezone is currently in daylight saving time.'=>'Šiuo metu galioja vasaros laikas.','This timezone is currently in standard time.'=>'Šiuo metu galioja žiemos laikas.','This tool helps site owners comply with local laws and regulations by deleting or anonymizing known data for a given user.'=>'Šis įrankis tinklalapio savininkams padeda laikytis vietinių įstatymų, ištrindamas arba nuasmenindamas vartotojo duomenis.','This tool helps site owners comply with local laws and regulations by exporting known data for a given user in a .zip file.'=>'Šis įrankis padeda tinklalapio savininkams laikytis vietinių įstatymų ir reguliavimų eksportuodamas naudotojo informaciją .zip faile.','This update does not work with your version of PHP.'=>'Šis atnaujinimas neveikia su Jūsų naudojama PHP versija.','This update does not work with your version of WordPress.'=>'Šis atnaujinimas neveikia su jųsų WordPress versija.','This update does not work with your versions of WordPress and PHP.'=>'Šis atnaujinimas neveikia su Jūsų naudojamomis WordPress ir PHP versijomis.','This user has super admin privileges.'=>'Šis vartotojas turi tinklo administratoriaus (super admin) teises.','This widget requires JavaScript.'=>'Šiam valdikliui reikia JavaScript.','This will be shown when someone hovers over the link in the blogroll, or optionally below the link.'=>'Bus rodoma užvedus pelę ant nuorodos.','This will clear all items from the inactive widgets list. You will not be able to restore any customizations.'=>'Šis veiksmas išvalys visus valdiklius iš neaktyvių valdiklių sąrašo. Nebegalėsite atgaminti jų nustatymų.','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'Tai apima visus jūsų įrašus, puslapius, komentarus, vartotojo laukus, vartotojo meniu, žymas, kategorijas ir pan.','This will grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'Tai duos leidimą prieiti prie  <a href="%1$s">%2$s tinklalapio šioje sistemoje, kur turite prieigos teises</a>.' . "\0" . 'Tai duos leidimą prieiti prie  <a href="%1$s">%2$s tinklalapių šioje sistemoje, kur turite prieigos teises</a>.' . "\0" . 'Tai duos leidimą prieiti prie  <a href="%1$s">%2$s tinklalapių šioje sistemoje, kur turite prieigos teises</a>.','This will grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'Tai duos leidimą prieiti prie  <a href="%1$s">%2$s tinklalapio šiame tinkle, nes turite superadministratoriaus teises</a>.' . "\0" . 'Tai duos leidimą prieiti prie  <a href="%1$s">%2$s tinklalapių šiame tinkle, nes turite superadministratoriaus teises</a>.' . "\0" . 'Tai duos leidimą prieiti prie  <a href="%1$s">%2$s tinklalapių šiame tinkle, nes turite superadministratoriaus teises</a>.','This will remove the background image. You will not be able to restore any customizations.'=>'Bus panaikintas fono paveikslėlis. Jūs negalėsite susigrąžinti pakeitimų.','This will remove the header image. You will not be able to restore any customizations.'=>'Šis veiksmas panaikins antraštės paveikslėlį. Jūs negalėsite susigrąžinti jam padarytų pakeitimų','This will replace the current editor content with the last backup version. You can use undo and redo in the editor to get the old content back or to return to the restored version.'=>'Tai pakeis dabartinį rašyklės turinį į šviežiausią atsarginę kopiją. Jūs galite naudoti veiksmo atšaukimo ir grąžinimo komandas (undo/redo) rašyklėje, jei norite susigrąžinti senąjį turinį arba grįžti prie atstatytosios versijos.','This will restore the original background image. You will not be able to restore any customizations.'=>'Bus atstatytas originalus fono paveikslėlis. Jūs negalėsite susigrąžinti pakeitimų.','This will restore the original header image. You will not be able to restore any customizations.'=>'Šis veiksmas sugrąžins numatytąjį antraštės paveikslėlį. Jūs negalėsite susigrąžinti jam padarytų pakeitimų.','Though the terms refer to two different concepts, in practice, they can be the same address or different. For example, you can have the core WordPress installation files in the root directory (<code>https://example.com</code>), in which case the two URLs would be the same. Or the <a href="%s">WordPress files can be in a subdirectory</a> (<code>https://example.com/wordpress</code>). In that case, the WordPress URL and the site URL would be different.'=>'Nors šios dvi reikšmės nurodo du skirtingus dalykus, jos gali būti tiek vienodos, tiek skirtingos. Pavyzdžiui, pagrindinius WordPress failus galite turėti šakninėje direktorijoje (<code>https://example.com</code>), tokiu atveju abu URL adresai bus vienodi. Arba <a href="%s">WordPress failai gali būti dukterinėje direktorijoje</a> (<code>https://example.com/wordpress</code>). Tokiu atveju WordPress URL ir svetainės URL bus skirtingi.','Three Columns'=>'Trys skiltys','Thumbnail Settings'=>'Miniatiūros nuostatos','Thumbnail Settings Help'=>'Miniatiūrų nustatymų pagalba','Thumbnail size'=>'Miniatiūra','Timezone'=>'Laiko juosta','Title and Post Editor'=>'Pavadinimo ir įrašo redaktorius','To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.'=>'Norėdami aktyvuoti valdiklį, tiesiog nutempkite jį į norimą sritį ir paspauskite ant jo. Norėdami išjungti valdiklį ir ištrinti jo nustatymus, nutempkite jį atgal.','To add a custom link, <strong>expand the Custom Links section, enter a URL and link text, and click Add to Menu</strong>'=>'Norėdami pridėti savo nuorodą, <strong> išskleiskite skyrelį Interneto nuorodos, įveskite URL ir nuorodos tekstą, o tuomet paspauskite Pridėti į meniu</strong>','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'Norėdami pridėti naują meniu, vietoj esamo priskyrimo, <strong>paspauskite nuorodą "Naudoti naują meniu"</strong>. Naujai sukurtas meniu bus iš karto priskirtas pasirinktai vietai temoje','To add a new user for your site, click the Add User button at the top of the screen or Add User in the Users menu section.'=>'Jei norite savo tinklalapiui priskirti daugiau vartotojų, paspauskite mygtuką „Pridėti naują vartotoją“ ekrano viršuje arba „Pridėti naują“ meniu skiltyje „Vartotojai“.','To add a new user to your site, fill in the form on this screen and click the Add User button at the bottom.'=>'Norėdami pridėti naują vartotoją savo tinklalapyje, užpildykite laukelius šiame ekrane ir paspauskite mygtuką "Pridėti naują vartotoją" ekrano apačioje.','To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.'=>'Automatiniam duomenų bazės problemų sprendimui reikia, kad įterpti žemiau pateiktą eilutę į jūsų %s failą. Kai tai padarysite, perkraukite šį puslapį.','To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s dropdown</strong>. When you are finished, <strong>click Save Changes</strong>'=>'Norėdami priskirti meniu į vieną ar kelias vietas temoje, <strong>pasirinkite meniu iš kiekvienos vietos išskleidžiamojo laukelio</strong>. Kai baigsite, <strong> paspauskite "Saugoti pakeitimus"</strong>','To crop the image, click on it and drag to make your selection.'=>'Norėdami apkirpti paveikslėlį, spustelėkite ant jo ir nustatykite apkerpamą zoną.','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'Norėdami ištrinti failus, paspauskite mygtuką "Masinis pasirinkimas" puslapio viršuje. Tuomet pasirinkite failus, kuriuos norite ištrinti, ir paspauskite mygtuką "Ištrinti pasirinktus". Paspaudus mygtuką "Atšaukti pasirinkimą", būsite perkeltas atgal į failų peržiūros puslapį.','To distribute copies of your modified versions to others.'=>'Jūs galite platinti savo pakeistą kodo versiją.','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'Norėdami redaguoti meniu, kuris jau priskirtas konkrečiai vietai temoje, <strong>paspauskite šalia esančią nuorodą "Redaguoti"</strong>','To edit an existing menu, <strong>choose a menu from the dropdown and click Select</strong>'=>'Norėdami redaguoti egzistuojantį meniu, <strong>pasirinkite jį išskleidžiamame laukelyje ir spauskite "Rinktis"</strong>','To enhance your site&#8217;s security, you should consider removing any themes you are not using. You should keep %1$s, the default WordPress theme, %2$s, your active theme, and %3$s, its parent theme.'=>'Jūsų tinklalapis bus saugesnis, jei pašalinsite temas, kurių nenaudojate. Rekomenduojame palikti tik %1$s, numatytąją WordPress temą, %2$s - Jūsų naudojamą temą, ir %3$s, jos tėvinę temą.','To enhance your site&#8217;s security, you should consider removing any themes you are not using. You should keep your active theme, %1$s, and %2$s, its parent theme.'=>'Jūsų tinklalapis bus saugesnis, jei pašalinsite temas, kurių nenaudojate. Rekomenduojame palikti tik Jūsų naudojamą temą %1$s ir %2$s, jos tėvinę temą.','To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.'=>'Norėdami instaliuoti temą ir peržiūrėti kaip Jūsų tinklalapis atrodytų ją įjungus, pirmiausia turite paspausti mygtuką "Instaliuoti" kairiojoje viršutinėje skiltyje. Temos failai bus parsiųsti į Jūsų serverį automatiškai. Kai baigsime siųsti, tema bus paruošta aktyvavimui - tai galėsite padaryti paspaudę nuorodą "Aktyvuoti" arba nuėję į puslapį "Tvarkyti temas" ir paspaudę "Reali peržiūra" ant bet kurios instaliuotos temos pavyzdinio paveikslėlio.','To manage plugins on your site, visit the Plugins page: %s'=>'Norėdami valdyti įskiepius, aplankykite Įskiepių puslapį: %s','To manage themes on your site, visit the Themes page: %s'=>'Norėdami valdyti išvaizdos temas, aplankykite Temų puslapį: %s','To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.'=>'Norėdami pamatyti visas versijas, <strong>traukite slankikį į kairę ar dešinę</strong>, arba <strong>naudokite mygtukus Ankstesnė ir Naujesnė</strong>.','To perform the requested action, WordPress needs to access your web server.'=>'Norint įvykdyti šį veiksmą, WordPress turi prisijungti prie jūsų serverio.','To post to WordPress by email, you must set up a secret email account with POP3 access. Any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret. Here are three random strings you could use: %1$s, %2$s, %3$s.'=>'Jei norite skelbti įrašus el. paštu, privalote sukurti slaptą el. pašto paskyrą su POP3 galimybe. Bus paskelbti visi šiuo adresu gauti įrašai, taigi laikykite jį paslaptyje. Štai trys atsitiktiniai variantai, kuriuos galite naudoti: %1$s, %2$s, %3$s.','To redistribute.'=>'Jūs galite platinti WordPress kodą.','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'Norėdami perdėlioti meniu punktus, <strong>tiesiog vilkite su pele arba naudokite klaviatūrą</strong>. Norėdami sukurti sub-meniu punktą, patraukite jau pridėtą meniu punktą šiek tiek į dešinę.','To restore a revision, <strong>click Restore This Revision</strong>.'=>'Norėdami atstatyti konkrečią versiją, <strong>paspauskite "Atstatyti šią versiją"</strong>.','To run the program for any purpose.'=>'Jūs galite naudoti WordPress bet kokiam tikslui.','To study how the program works and change it to make it do what you wish.'=>'Jūs galite nagrinėti, kaip jis veikia bei keisti jį taip, kaip Jums patinka.','To the top'=>'Į viršų','To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.'=>'Norėdami naudoti fono paveikslėlį, paprasčiausiai jį įkelkite arba pasirinkite iš seniau įkeltų į Failų Saugyklą - tai daroma paspaudus mygtuką "Pasirinkti paveikslėlį". Paveikslėlį galima rodyti vieną kartą, arba sudėlioti jį daug kartų, kad būtų užpildytas visas ekranas. Taip pat Jūsų fonas gali būti fiksuotas, kai tinklalapyje slenkate žemyn bei aukštym, arba judėti kartu su turiniu.','To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.'=>'Jei norite naudoti subdomenų konfiguraciją, jums reikia įjungti „wildcard DNS“ režimą. Paprastai tam reikia pridėti %s įrašą rodantį į Jūsų serverį Jūsų domeno DNS valdymo įrankyje.','Toggle extra menu items'=>'Perjungti papildomus meniu elementus','Toggle panel: %s'=>'Perjungti skydelį: %s','Tomorrow'=>'Rytoj','Total installation size'=>'Visas dydis','Total size is not available. Some errors were encountered when determining the size of your installation.'=>'Bendras dydis nežinomas. Įvyko klaidų bandant nustatyti Jūsų tinklalalpio dydį.','Track %1$s of %2$s.'=>'Audio įrašas: %1$s (viso yra %2$s audio įrašų).','Track %s.'=>'Garso takelis %s.','Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.'=>'Atgalinės citatos (trackbacks) yra būdas pranešti senoms tinklaraščių sistemoms, kad įkėlėte nuorodą į jų puslapį. Jei dėsite nuorodas į kitus Word Press tinklaraščius, jų autoriams bus pranešta automatiškai, naudojant <a href="%s">atgalinius pranešimus (pingbacks)</a>; Jums patiems nieko daryti nereikia.','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'Lietuvių kalbos vertėjai','Translation update failed.'=>'Nepavyko atnaujinti vertimų.','Translation updated successfully.'=>'Vertimai atnaujinti sėkmingai.','Translations'=>'Vertimai','Translations for %s'=>'Vertimai %s','Triage Lead'=>'Darbų paskirstymo vadovas','Troubleshooting'=>'Trikčių šalinimas','Try Again'=>'Bandykite vėl','Tumblr'=>'Tumblr','Tweak your site, or give it a whole new look! Get creative &#8212; how about a new color palette or font?'=>'Keiskite savo tinklalapį arba suteikite jam visiškai naują išvaizdą! Būkite kūrybingi &#8212; galbūt norite pakeisti spalvas ar šriftą?','Two Columns'=>'Dvi skiltys','Two terms you will want to know are the WordPress URL and the site URL. The WordPress URL is where the core WordPress installation files are, and the site URL is the address a visitor uses in the browser to go to your site.'=>'Reikia žinoti du dalykus: WordPress URL ir tinklalapio URL. WordPress URL - tai vieta serveryje, kurioje saugomi pagrindiniai WordPress failai, o tinklalapio URL - tai adresas, kurį lankytojas įrašo naršyklėje, norėdamas patekti į jūsų tinklalapį.','Type of search'=>'Paieškos tipas','Type the new password again.'=>'Dar kartą įveskite naująjį slaptažodį.','Type the password again.'=>'Dar kartą įveskite slaptažodį.','Type your new password again.'=>'Dar