>'Atnaujinimo paketas yra nepasiekiamas.','Update progress'=>'Atnaujinimo progresas','Update to %s'=>'Atnaujinti į %s','Update to latest %s nightly'=>'Naujinti į naujausią "naktinę" versiją - %s','Update to version %s'=>'Atnaujinti į %s versiją','Update your plugins'=>'Atnaujinkite įskiepius','Update your site to use HTTPS'=>'Atnaujinkite savo tinklalapį, kad galėtumėte naudoti HTTPS','Updated %s.'=>'Atnaujinta %s.','Updates %s'=>'Atnaujinimai %s','Updates may take several minutes to complete. If there is no feedback after 5 minutes, or if there are errors please refer to the Help section above.'=>'Atnaujinimai gali užtrukti kelias minutes. Jei negaunate jokių pranešimų praėjus 5 minutėms arba, jei gavote klaidų pranešimus, žr. aukščiau esantį pagalbos skyrių.','Updating Plugin %1$s (%2$d/%3$d)'=>'Atnaujinamas įskiepis %1$s (%2$d/%3$d)','Updating Theme %1$s (%2$d/%3$d)'=>'Atnaujinama tema %1$s (%2$d/%3$d)','Updating is easy and only takes a few moments:'=>'Atnaujinti WordPress yra lengva ir trunka tik kelias akimirkas:','Updating plugin: %s'=>'Atnaujinamas įskiepis: %s','Updating the plugin&#8230;'=>'Įskiepis atnaujinamas&#8230;','Updating the theme&#8230;'=>'Išvaizdos tema atnaujinama&#8230;','Updating theme: %s'=>'Atnaujinama tema: %s','Updating to WordPress %s'=>'Atnaujinama į WordPress %s','Updating translations for %1$s (%2$s)&#8230;'=>'Atnaujinami vertimai %1$s (%2$s)&#8230;','Upgrading database&#8230;'=>'Atnaujinama duomenų bazė&#8230;','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'Atnaujinant temą į jos naujesnę versiją, visi pokyčiai, atlikti čia, bus perrašyti ir išnyks. Norint to išvengti, turėtumėte sukurti ir redaguoti <a href="%s">dukterinę temą</a>.','Upload New Media'=>'Įkelti naują failą','Upload Plugin'=>'Įkelti įskiepį','Upload Theme'=>'Įkelti temą','Upload date:'=>'Įkėlimo data.','Upload failed. Please reload and try again.'=>'Įkėlimas nepavyko. Perkraukite ir pabandykite dar kartą.','Upload file and import'=>'Įkelti failą ir importuoti','Upload max filesize'=>'Upload max filesize (maksimalus įkeliamo failo dydis)','Uploaded Images'=>'Įkelti paveikslėliai','Uploaded on: %s'=>'Įkelta: %s','Uploading Files'=>'Failų įkėlimas','Uploading Files allows you to choose the folder and path for storing your uploaded files.'=>'Čia galite pasirinkti direktoriją ir adresą, kur bus laikomi Jūsų įkelti failai.','Uploads'=>'Įkelta','Uploads directory location'=>'Failų direktorijos vieta','Uploads directory size'=>'Failų direktorijos dydis','Use This Page'=>'Naudoti šį puslapį','Use https'=>'Naudokite https','Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.'=>'Naudokite rodyklių mygtukus puslapio viršuje, arba klaviatūros rodyklių klavišus - taip galėsite greitai pereiti nuo vieno failo iki kito.','Used: %1$s%% of %2$s'=>'Išnaudota: %1$s%% iš %2$s','User %s added'=>'Pridėtas vartotojas %s','User Language'=>'Tinklalapio kalba','User Roles'=>'Vartotojų rolės','User added.'=>'Vartotojas pridėtas.','User already exists. Password inherited.'=>'Vartotojas jau egzistuoja. Slaptažodis išlaikomas.','User count'=>'Vartotojų kiekis','User deleted.'=>'Vartotojas ištrintas.','User deletion is not allowed from this screen.'=>'Iš šio puslapio vartotojų ištrinti negalima.','User has been added to your site.'=>'Į jūsų tinklalapį pridėtas narys.','User has been created, but could not be added to this site.'=>'Vartotojas buvo sukurtas, tačiau jo nepavyko pridėti prie šio tinklalapio.','User has no sites or content and will be deleted.'=>'Vartotojas neturi tinklalapių ar turinio ir bus ištrintas.','User removed from this site.'=>'Vartotojas ištrintas iš šio tinklalapio.','User updated.'=>'Vartotojo profilis atnaujintas.','User(s) already exists.'=>'Vartotojas(ai) jau egzistuoja.','Username or email address'=>'Vartotojo vardas arba el.paštas','Username/Password incorrect for %s'=>'Klaidingas %s vartotojo vardas arba slaptažodis','Usernames can have only alphanumeric characters, spaces, underscores, hyphens, periods, and the @ symbol.'=>'Vartotojo vardas gali būti sudarytas tik iš raidinių ir skaitinių ženklų, tarpų, apatinių brūkšnelių, trumpųjų brūkšnelių, taškų ir @ simbolio.','Usernames cannot be changed.'=>'Vartotojo vardo keisti negalima.','Users list'=>'Vartotojų sąrašas','Users list navigation'=>'Vartotojų sąrašo navigacija','Users must be registered and logged in to comment'=>'Komentuoti gali tik užsiregistravę ir prisijungę vartotojai','Verifying the unpacked files&#8230;'=>'Tikrinami išarchyvuoti failai&#8230;','Version %1$s by %2$s'=>'Versija %1$s, autorius %2$s','Version %s'=>'Versija %s','Version:'=>'Versija:','Version: %s'=>'Versija: %s','Video Attachment Template'=>'Video failo šablonas','View %1$s version %2$s details'=>'Peržiūrėti %1$s versijos %2$s detales','View &#8220;%s&#8221;'=>'Peržiūrėti &#8222;%s&#8220;','View &#8220;%s&#8221; archive'=>'Peržiūrėti &#8220;%s&#8221; archyvą','View All'=>'Peržiūrėti viską','View Privacy Policy Guide.'=>'Privatumo politikos rekomendacijos.','View Site'=>'Peržiūrėti tinklalapį','View Trash'=>'Peržiūrėti šiukšlinę','View all'=>'Visi','View all drafts'=>'Žiūrėti visus juodraščius','View details'=>'Peržiūrėti detales','View mode'=>'Žiūrėjimo režimas','View more comments'=>'Peržiūrėti daugiau komentarų','View page'=>'Peržiūrėti puslapį','View posts by %s'=>'Peržiūrėti autoriaus %s įrašus','View this comment'=>'Žiūrėti šį komentarą','View version %s details.'=>'Peržiūrėti versijos %s informaciją.','Visible'=>'Matomas','Visit'=>'Aplankyti','Visit Dashboard'=>'Į skydelį','Visit Link'=>'Aplankyti puslapį','Visit plugin site'=>'Aplankyti įskiepio puslapį','Visit plugin site for %s'=>'Aplankykite įskiepio %s tinklalapį','Visit site'=>'Aplankyti puslapį','Visitor comments may be checked through an automated spam detection service.'=>'Lankytojų komentarai gali būti tikrinami naudojant automatinę brukalų paieškos paslaugą.','Visual Editor'=>'Raiškioji rašyklė','Visual Editor RTL Stylesheet'=>'Raiškiosios rašyklės stilius (RTL stylesheet)','Visual Editor Stylesheet'=>'Raiškiosios rašyklės stilius (stylesheet)','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.'=>'Vaizdinis režimas leidžia jums dirbti panašiai kaip įprastuose teksto redaktoriuose. Spustelėkite „Perjungti įrankių juostą“ mygtuką, jei norite pamatyti antrą įrankių juostą.','Waiting for confirmation'=>'Laukti patvirtinimo','Want more events? <a href="%s">Help organize the next one</a>!'=>'Norite daugiau renginių?  <a href="%s">Padėkite juos organizuoti</a>!','Want to see your name in lights on this page?'=>'Norite matyti savo vardą šiame puslapyje?','Warning'=>'Įspėjimas!','Warning! User %s cannot be deleted.'=>'Įspėjimas! Vartotojas %s negali būti ištrintas.','Warning! User cannot be deleted. The user %s is a network administrator.'=>'Įspėjimas! Vartotojas negali būti ištrintas. Vartotojas %s yra tinklo administratorius.','Warning! Wildcard DNS may not be configured correctly!'=>'Warning! Wildcard DNS may not be configured correctly!','Warning:'=>'Įspėjimas:','Wavatar (Generated)'=>'Wavatar','Web Address'=>'Interneto adresas','Web server'=>'Serverio PĮ','Week Starts On'=>'Savaitės pradžia','Welcome panelWelcome'=>'Sveiki atvykę','Welcome to %s. This is your first post. Edit or delete it, then start writing!'=>'Sveikiname sukūrus %s. Tai pirmasis Jūsų tinklalapio įrašas. Redaguokite arba ištrinkite jį, pradėkite rašyti dabar!','Welcome to WordPress %1$s. <a href="%2$s">Learn more</a>.'=>'Dėkojame kad atnaujinote į WordPress %1$s. <a href="%2$s">Sužinokite daugiau apie šią versiją</a>.','Welcome to WordPress %1$s. You will be redirected to the About WordPress screen. If not, click <a href="%2$s">here</a>.'=>'Dėkojame, kad atnaujinote į WordPress %1$s. Netrukus būsite perkelti į "Apie WordPress" skilį. Jei kartais taip neatsitiktų, paspauskite <a href="%2$s">čia</a>.','Welcome to WordPress!'=>'Dėkojame, kad naudojate WordPress!','Welcome to WordPress. Before getting started, you will need to know the following items.'=>'Sveikiname pradėjus dirbti su WordPress. Prieš pradėdami, turite žinoti kai kuriuos dalykus.','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'Sveikiname pasirinkus WordPress. Tai pirmasis Jūsų įrašas, galite jį redaguoti arba ištrinti, o tuomet pradėkite kurti!','Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.'=>'Pradėsime įžymiąją WordPress penkių minučių instaliaciją! Jums reikia tik užpildyti žemiau pateiktus laukelius ir netrukus galėsite pradėti naudotis galingiausia ir labiausiai išplėtota turinio valdymo sistema pasaulyje.','Welcome to your WordPress Dashboard!'=>'Sveiki prisijungę  į WordPress valdymo skydelį!','What automated decision making and/or profiling we do with user data'=>'Kokius automatinius sprendimus ir/ar profiliavimą mes atliekame naudodami Jūsų duomenis','What data breach procedures we have in place'=>'Kokias duomenų apsaugos procedūras mes naudojame','What is PHP and how does it affect my site?'=>'Kas yra PHP ir kaip tai įtakoja mano tinklalapį?','What personal data we collect and why we collect it'=>'Kokius asmeninius duomenis mes renkame ir kodėl tai darome','What rights you have over your data'=>'Jūsų teisės','What should be done with content owned by %s?'=>'Kas turėtų būti atlikta su turiniu priklausančiu %s?','What should be done with content owned by these users?'=>'Ką norite daryti su šių vartotojų sukurtu turiniu?','What should be done with content owned by this user?'=>'Ką norėtumėte daryti su turiniu, sukurtu šio vartotojo?','What third parties we receive data from'=>'Iš kokių trečiųjų šalių mes gauname duomenis','What&#8217;s New'=>'Kas naujo','What&#8217;s on your mind?'=>'Ką norite užsirašyti?','What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.'=>'Kuo skiriasi žymos ir kategorijos? Žymos išskiria svarbiausią įrašo informaciją (vardai, miestai, tam tikri subjektai ir pan.), kurios dažniausiai nėra kituose jūsų įrašuose. Tuo tarpu kategorija yra bendresnė sąvoka. Ji apjungia panašios tematikos įrašus į grupes.','When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be held in the <a href="edit-comments.php?comment_status=moderated">moderation queue</a>. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.'=>'Jei komentare bus kas nors iš šių žodžių, vardų, URL, el. paštų arba IP adresų, jis bus sulaikomas <a href="edit-comments.php?comment_status=moderated">priežiūros eilėje</a>. Vienoje eilutėje veskite tik vieną žodį, IP ar pan. Bus tikrinami ir žodžių fragmentai. Jei žemiau įvesite „press“, tai bus sulaikomi ir komentarai su žodžiu „WordPress“.','When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be put in the Trash. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.'=>'Jei komentare bus kas nors iš šių žodžių, vardų, URL, el. paštų arba IP adresų, jis bus perkeltas į šiukšlinę. Vienoje eilutėje veskite tik vieną žodį, IP ar pan. Bus tikrinami ir žodžių fragmentai. Jei žemiau įvesite „press“, tai komentarai su žodžiu „WordPress“ taip pat bus pažymėti.','When adding a new category on this screen, you&#8217;ll fill in the following fields:'=>'Šiame puslapyje kurdami naują kategoriją, užpildysite šiuos laukelius:','When adding a new tag on this screen, you&#8217;ll fill in the following fields:'=>'Šiame puslapyje kurdami naują žymą, užpildysite šiuos laukelius:','When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.'=>'Kai keičiate temas, turite atsiminti, kad jų šoninių/valdiklių sričių išdėstymas bei kiekis gali skirtis, dėl to kartais dėl šių konfliktų temos pakeitimas vyksta ne itin sklandžiai. Jei Jūs pakeitėte temą, ir nematote kai kurių savo valdiklių, paeikite žemyn šiame ekrane, kol pamatysite Neaktyvių valdiklių skiltį - būtent ten bus išsaugoti visi Jūsų valdikliai bei jų nustatymai.','When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.'=>'Kai peržiūrinėjate mažame monitoriuje, Jūs galite naudoti suskleidimo funkciją - jos piktograma yra kairiojo skydelio apačioje. Ją paspaudus, ši sritis pasislėps, ir Jūs galėsite atidžiau apžiūrėti savo tinklalapį su nauja tema. Norėdami vėl išskleisti minėtą sritį, paspauskite ant tos pačios piktogramos.','When testing the REST API, an error was encountered:'=>'Testuojant REST API buvo pastebėta klaida:','When testing the REST API, an unexpected result was returned:'=>'Testuojant REST API buvo gautas netikėtas rezultatas:','When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search engines discouraged&#8221;, to remind you that you have directed search engines to not crawl your site.'=>'Kai šis nustatymas įjungtas, Skydelio skiltyje "Trumpai" bus rodomas priminimas "Paieškos sistemos prašomos neindeksuoti" - taip primenant Jums, kad paieškos sistemoms yra rodomas Jūsų pageidavimas neindeksuoti šio tinklalapio.','When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the %s<span class="screen-reader-text">remove</span> button next to its name in the Bulk Edit area that appears.'=>'Naudojant Masinį redagavimą, galite pakeisti visų pasirinktų įrašų meta-informaciją (kategorijas, autorių, ir pan,) iš karto. Norėdami pašalinti įrašą iš pasirinktųjų, tiesiog paspauskite %s<span class="screen-reader-text">pašalinimo</span>mygtuką ties jo pavadinimu Masinio Redagavimo lauke.','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'Kai lankytojai rašo komentarus tinklalapyje, mes renkame duomenis, matomus komentaro paskelbimo formoje, o taip pat lankytojo IP adresą bei naršyklės vartotojo įrašą, kad apsisaugotume nuo brukalų.','When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.'=>'Įrašo nuorodoje gali būti rodoma tik viena kategorija ar žyma. Jeigu pasirinkote nuorodų struktūrą su %1$s arba %2$s, į nuorodą bus įkelta tik viena (su mažiausia numeracija).','When you click the button below WordPress will create an XML file for you to save to your computer.'=>'Kai paspausite žemiau esantį mygtuką, WordPress sukurs XML failą, kurį galėsite išsaugoti kompiuteryje.','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'Kai Jūs prisijungiate, mes taip pat sukuriame kelis slapukus, kuriuose saugoma Jūsų prisijungimo informacija ir Jūsų ekrano rodymo pasirinkimai. Prisijungimo slapukai galioja 2 dienas, o ekrano nustatymų - vienerius metus. Jei Jūs pažymite pasirinkimą &quot;Prisiminti mane&quot;, Jūsų prisijungimo slapukas galios 2 savaites. Kai atsijungiate iš savo paskyros, prisijungimo slapukai ištrinami.','When you publish a new post, WordPress automatically notifies the following site update services. For more about this, see the <a href="%s">Update Services</a> documentation article. Separate multiple service URLs with line breaks.'=>'Kai paskelbiate įrašą, WordPress automatiškai praneša šioms tarnyboms. Daugiau informacijos rasite <a href="%s">šiame puslapyje</a>. Kiekvienos tarnybos URL įveskite naujoje eilutėje.','When you\'ve been able to update using the "Update now" button on Dashboard > Updates, this error will be cleared for future update attempts.'=>'Kai Jums pavyks atlikti atnaujinimą paspaudus mygtuką "Atnaujinti dabar", esantį Skydelio puslapyje Atnaujinimai, ši klaida bus ištrinta ir daugiau netestuojama ateityje.','Where your data is sent'=>'Kur siunčiami jūsų duomenys','While trying to test your site&#8217;s scheduled events, the following error was returned: %s'=>'Testuojant suplanuotų veiksmų atlikimą Jūsų tinklalapyje, įvyko klaida: %s','While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.'=>'Redaguodami savo %1$s failą, patikrinkite, kad visi 8 raktai būtų unikalūs. Jūs galite juos sugeneruoti iš naujo, naudodami <a href="%2$s">WordPress.org slaptųjų raktų paslaugą</a>.','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, this mode will be deactivated.'=>'Atnaujinimo metu bus įjungta techninės priežiūros būsena. Kai tik jis bus baigtas, jūsų tinklalapis vėl bus pasiekiamas skaitytojams.','Who we are'=>'Kas mes esame','Who we share your data with'=>'Su kuo mes dalinamės Jūsų duomenimis','Wide Blocks'=>'Platūs blokai','Widget %s'=>'Valdiklis %s','Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.'=>'Valdikliai yra turinio sekcijos, kurios gali būti rodomos bet kurioje tinklalapio vietoje priklausomai nuo naudojamos temos. Tokia sritis vadinama valdiklių sritimi (arba šonine juosta, jei ji patalpinta kairėje arba dešinėje temos pusėje). Jei norite, kad kuris nors iš galimų valdiklių būtų rodomas valdiklių srityje, nutempkite jį į dešinėje pusėje esančią pasirinktą sritį.','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'Tokie patys valdikliai gali būti naudojami daugiau nei vienoje vietoje. Be to, kiekvienam valdikliui galite priskirti pavadinimą, bet tai nėra būtina.','With a block theme, you can place and edit blocks without affecting your content by customizing or creating new templates.'=>'Naudodami blokų temą galite talpinti ir redaguoti blokus nedarydami įtakos turiniui, pritaikydami arba kurdami naujus šablonus.','Word count: %s'=>'Žodžių kiekis: %s','WordCamps'=>'WordCamp\'ai','WordPress'=>'WordPress','WordPress %1$s running %2$s theme.'=>'WordPress versija: %1$s, naudojama tema: %2$s.','WordPress %s'=>'WordPress %s','WordPress %s Field Guide'=>'WordPress %s gidas','WordPress %s Release Notes'=>'WordPress %s versijos pastabos','WordPress %s is also now available.'=>'Jau galite atnaujinti į WordPress %s.','WordPress &rsaquo; Database Repair'=>'WordPress &rsaquo; Database Repair','WordPress &rsaquo; Installation'=>'WordPress &rsaquo; Diegimas','WordPress &rsaquo; Setup Configuration File'=>'WordPress &rsaquo; Paruošti konfigūracijos failą','WordPress &rsaquo; Update'=>'WordPress &rsaquo; Atnaujinimas','WordPress 6.8 packs a wide range of performance fixes and enhancements to speed up everything from editing to browsing. Beyond speculative loading, WordPress 6.8 pays special attention to the block editor, block type registration, and query caching. Plus, imagine never waiting longer than 50 milliseconds—for any interaction. In WordPress 6.8, the Interactivity API takes a first step toward that goal.'=>'WordPress 6.8 įdiegta daugybė našumo pataisymų ir patobulinimų, kurie pagreitina viską - nuo redagavimo iki naršymo. Be spekuliacinio krovimo, WordPress 6.8 ypatingas dėmesys skiriamas blokų redaktoriui, blokų tipų registracijai ir užklausų spartinimui. Be to, siekiame, kad niekada nereiktų jokio atsako laukti ilgiau nei 50 milisekundžių. WordPress 6.8 versijoje pridėtas interaktyvumo API yra pirmas žingsnis šio tikslo link.','WordPress Blog'=>'WordPress tinklalapis','WordPress Constants'=>'WordPress konstantos','WordPress Core and Block Editor: HTML, CSS, PHP, SQL, JavaScript, and React.'=>'WordPress pagrindinis kodas ir blokų redaktorius: HTML, CSS, PHP, SQL, JavaScript ir React.','WordPress Events and News'=>'WordPress renginiai ir naujienos','WordPress Updates'=>'WordPress atnaujinimai','WordPress Version'=>'WordPress versija','WordPress app: Kotlin, Java, Swift, Objective-C, Vue, Python, and TypeScript.'=>'WordPress programėlė: Kotlin, Java, Swift, Objective-C, Vue, Python ir TypeScript.','WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.'=>'WordPress taip pat gali pabandyti optimizuoti duomenų bazę. Tvarkinga duomenų bazė kai kuriose situacijoje pagerina tinklalapio veikimą. Kartais duomenų bazės optimizavimas ir problemų joje šalinimas gali užtrukti, be to, tuo metu duomenų bazė bus užrakinta bet kokiems kitiems pakeitimams.','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'WordPress gali automatiškai surasti kai kurias dažnai pasitaikančias duomenų bazės problemas ir jas pašalinti. Šis procesas gali užtrukti, prašome kantriai palaukti.','WordPress cannot dynamically serve a %s file due to a lack of rewrite rule support'=>'WordPress negali dinamiškai pateikti %s failo, nes nepalaikomos perrašymo taisyklės','WordPress collects (but <em>never</em> publishes) a limited amount of data from logged-in users but then deletes it or anonymizes it. That data can include:'=>'WordPress renka (bet <em>niekada</em> neskelbia) ribotą kiekį prisijungusių vartotojų duomenų, bet tada juos ištrina arba anonimizuoja. Šiuos duomenis gali sudaryti:','WordPress collects (but <em>never</em> publishes) a limited amount of data from registered users who have logged in to the site. Generally, these users are people who contribute to the site in some way -- content, store management, and so on. With rare exceptions, these users do not include occasional visitors who might have registered to comment on articles or buy products. The data WordPress retains can include:'=>'WordPress renka (bet <em>niekada</em> neskelbia) ribotą kiekį registruotų vartotojų, kurie jungėsi prie tinklalapio, duomenų. Paprastai šie vartotojai yra žmonės, kurie kokiu nors būdu prisideda prie tinklalapio kūrimo - turinio, parduotuvės valdymo ir pan. Išskyrus retas išimtis, tarp šių vartotojų nėra atsitiktinių lankytojų, kurie užsiregistravę per komentarus arba norėdami pirkti produktus. WordPress saugomi duomenys gali apimti:','WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.'=>'WordPress turi nuostabių teisių, kurias suteikia jo <a href="%s">licencija</a>, GPL.','WordPress database repair'=>'WordPress duomenų bazės taisymas','WordPress development updates are blocked by the %s constant.'=>'WordPress naujų versijų diegimas yra išjungtas konstanta %s.','WordPress development updates are blocked by the %s filter.'=>'WordPress naujų versijų diegimas yra išjungtas filtru %s.','WordPress directory location'=>'WordPress direktorijos vieta','WordPress directory size'=>'WordPress direktorijos dydis','WordPress embraces new technologies, while being committed to backward compatibility. The WordPress project uses the following languages and libraries:'=>'WordPress naudoja naujausias technologijas, tačiau įsipareigoja užtikrinti atgalinį suderinamumą. WordPress projekte naudojamos šios kalbos ir bibliotekos:','WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. The WordPress community is flattered every time someone spreads the good word, just make sure to <a href="%s">check out the WordPress Foundation trademark guidelines</a> first.'=>'WordPress vystosi, kai žmonės papasakoja apie jį savo draugams, o daugybė verslo atstovų ir paslaugų tiekėjų, kurie jį naudoja, dalinasi informaciją apie tai su savo vartotojais. WordPress bendruomenė džiaugiasi kiekvienu geru žodžiu, tik prašome visuomet pirmiausiai įsitinkint, kad nepažeidžiate <a href="%s">WordPress Foundation prekės ženklo nuosavybės teisių</a>.','WordPress has been installed. Thank you, and enjoy!'=>'WordPress įdiegtas. Ačiū ir gero naudojimo!','WordPress has been updated! Next and final step is to update your database to the newest version.'=>'WordPress sistema atnaujinta! Liko tik atnaujinti duomenų bazės versiją.','WordPress is at the latest version.'=>'Naudojate naujausią WordPress versiją.','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals.'=>'WordPress kuria <a href="%1$s">pasaulinė atsidavusių profesionalų komanda</a>.','WordPress is free and open source software'=>'WordPress yra nemokama ir atviro kodo programinė įranga','WordPress is not notifying any <a href="%1$s">Update Services</a> because of your site&#8217;s <a href="%2$s">visibility settings</a>.'=>'WordPress nesiunčia pranešimų <a href="%1$s">atnaujinimų tarnyboms</a> dėl jūsų tinklalapio <a href="%2$s">matomumo nustatymų</a>.','WordPress may thrive on technical contributions, but you don&#8217;t have to code to contribute. Here are some of the ways you can make an impact without writing a single line of code:'=>'Patį WordPress kuria programuotojai, tačiau norint prisidėti, nebūtina programuoti. Štai keletas būdų, kaip galite padėti neparašę nė vienos kodo eilutės:','WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.'=>'WordPress leidžia Jums kurti nestandartines nuorodų struktūras. Jos gali pagerinti nuorodų estetiką, naudojamumą ir suderinamumą. Kurdami savo struktūrą galite naudoti <a href="%s">daug skirtingų žymų</a>, o čia rasite kelis pavyzdžius kurie padės jums pradėti darbą.','WordPress requires %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'WordPress reikalinga %2$s ar naujesnė %1$s versija. Susisiekite su savo hostingo tiekėju ir jis padės Jums tai ištaisyti.','WordPress security and maintenance releases are blocked by %s.'=>'WordPress saugumo ir palaikymo versijų diegimas yra išjungtas su %s.','WordPress security and maintenance releases are blocked by the %s filter.'=>'WordPress saugumo ir palaikymo versijų diegimas yra išjungtas filtru %s.','WordPress should correct invalidly nested XHTML automatically'=>'WordPress turi automatiškai pataisyti netaisyklingą XHTML kodą','WordPress site: %s'=>'WordPress tinklalapis: %s','WordPress update available (%s)'=>'Yra nauja WordPress versija (%s)','WordPress updated successfully.'=>'WordPress atnaujintas sėkmingai.','WordPress will only receive automatic security and maintenance releases from now on.'=>'Nuo šio WordPress automatiškai gaus tik saugumo ir priežiūros versijas.','WordPress.org Plugin Page &#187;'=>'WordPress.org Įskiepių Puslapis &#187;','WordPress.org is reachable'=>'WordPress.org yra pasiekiamas','Work continues on optimizing cache key generation in the <code>WP_Query</code> class. The goal is, as ever, to boost your site&#8217;s performance, in this case by taking some more of the load off your database. This is especially good if you get a lot of traffic.'=>'Toliau dirbame optimizuojant cache raktų generavimą <code>WP_Query</code> klasėje. Tikslas, kaip visada, yra padidinti tinklalapių inės našumą, šiuo atveju dar šiek tiek sumažinant duomenų bazės apkrovą. Tai ypač naudinga, jei jūsų duomenų srautas didelis.','Would you like to give the application identifying itself as %s access to your account? You should only do this if you trust the application in question.'=>'Ar norite aplikacijai, save pristatančiai kaip %s, duoti teisę prieiti prie jūsų paskyros? Taip elkitės tik tuomet, jei pasitikite šia aplikacija.','Would you like to give this application access to your account? You should only do this if you trust the application in question.'=>'Ar norite šiai aplikacijai duoti teisę prieiti prie jūsų paskyros? Taip elkitės tik tuomet, jei pasitikite šia aplikacija.','Writable'=>'Yra įrašymo prieiga','Writing'=>'Rašymas','Writing Settings'=>'Rašymo nuostatos','X &#8212; Even more mature than above'=>'X &#8212; Dar brandesniems asmenims nei R','XFN stands for <a href="https://gmpg.org/xfn/">XHTML Friends Network</a>, which is optional. WordPress allows the generation of XFN attributes to show how you are related to the authors/owners of the site to which you are linking.'=>'XFN reiškia „<a href="http://gmpg.org/xfn/">XHTML draugų tinklas</a>“, tai neprivaloma nuostata. WordPress leidžia pažymėti, kokie jūsų tarpusavio ryšiai su šių tinklalapių ar kitų tinklalapių autoriais.','XML Error: %1$s at line %2$s'=>'XML klaida: %1$s eilutėje %2$s','Yes, I approve of this connection'=>'Leidžiu šį prisijungimą.','Yes, delete these files'=>'Taip, noriu ištrinti šiuos failus','Yes, delete these files and data'=>'Taip, noriu ištrinti šiuos failus ir duomenis','Yes, take me to my profile page'=>'Taip, atidarykite mano profilio puslapį','You also have some plugins or themes with updates available. Update them now:'=>'Kai kuriuos Jūsų naudojamus įskiepius ar temas taip pat galima atnaujinti. Atnaujinkite dabar:','You appear to be making direct edits to your plugin in the WordPress dashboard. Editing plugins directly is not recommended as it may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'Panašu, kad tiesiogiai redaguojate įskiepio kodą per WordPress valdymo skydelį. Rekomenduojama to nedaryti! Tiesioginis įskiepių kodo redagavimas gali sugadinti jūsų tinklalapį, o pakeitimai gali būti perrašyti atnaujinimo metu.','You appear to be making direct edits to your theme in the WordPress dashboard. It is not recommended! Editing your theme directly could break your site and your changes may be lost in future updates.'=>'Panašu, kad tiesiogiai redaguojate temos kodą per WordPress valdymo skydelį. Rekomenduojama to nedaryti! Tiesioginis temos kodo redagavimas gali sugadinti Jūsų tinklalapį, o pakeitimai gali būti prarasti ateityje atnaujinimo metu.','You are about to approve the following comment:'=>'Jūs norite patvirtinti šį komentarą:','You are about to delete %s.'=>'Jūs rengiatės ištrinti %s.','You are about to delete the following comment:'=>'Jūs norite ištrinti šį komentarą:','You 