audokite mygtuką Išjungti.  <a href="%s">Išjungti atstatymo režimą</a> ','You are now logged out everywhere else.'=>'Jūs jau atjungtas iš visų kitų sesijų.','You are only logged in at this location.'=>'Jūs esate prisijungęs tik šiame kompiuteryje.','You are updating a plugin. Be sure to <a href="%s">back up your database and files</a> first.'=>'Atnaujinate įskiepį. Būtinai pirmiausia pasidarykite<a href="%s">savo failų ir dumenų bazės atsargines kopijas</a>.','You are updating a theme. Be sure to <a href="%s">back up your database and files</a> first.'=>'Atnaujinate išvaizdos temą. Būtinai pirmiausia pasidarykite<a href="%s">savo failų ir dumenų bazės atsargines kopijas</a>.','You are uploading an older version of a current plugin. You can continue to install the older version, but be sure to <a href="%s">back up your database and files</a> first.'=>'Įkėlėte senesnę įskiepio versiją. Galite tęsti senesnės versijos diegimą, tačiau būtinai pirmiausia pasidarykite<a href="%s">savo failų ir dumenų bazės atsargines kopijas</a>.','You are uploading an older version of the installed theme. You can continue to install the older version, but be sure to <a href="%s">back up your database and files</a> first.'=>'Įkėlėte senesnę jau įdiegtos išvaizdos temos versiją. Galite tęsti senesnės versijos diegimą, tačiau būtinai pirmiausia pasidarykite<a href="%s">savo failų ir duomenų bazės atsargines kopijas</a>.','You are using a %1$s drop-in which might mean that a %2$s database is not being used.'=>'Jūs naudojate įkėlą %1$s todėl gali būti, kad duomenų bazė %2$s yra nenaudojama.','You are using a development version (%1$s). Cool! Please <a href="%2$s">stay updated</a>.'=>'Jūs naudojate bandomąją versiją (%1$s). Šaunu! Visada naudokite <a href="%2$s">naujausią versiją</a>.','You are using a development version of WordPress.'=>'Naudojate tobulinimui skirtą WordPress versiją.','You are using a development version of WordPress. These feature plugins are also under development. <a href="%s">Learn more</a>.'=>'Naudojate WordPress vystymo versiją. Šie funkcijų įskiepiai taip pat yra vystomi. <a href="%s">Plačiau</a>','You are using an insecure browser!'=>'Naudojate nesaugią naršyklę!','You are using the auto-generated password for your account. Would you like to change it?'=>'Savo paskyrai Jūs naudojate automatiškai sugeneruotą slaptažodį. Ar norėtumėte jį pakeisti?','You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.'=>'Jūs naudojate naršyklės įkėlimo įrankį. WordPress įkėlimo įrankis leidžia vienu metu įkelti kelis failus, juos tiesiog atvelkant pele. <a href="#">Įjungti multi-failų įkėlimo įrankį</a>.','You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.'=>'Jūs naudojate multi-failų įkėlimo įrankį. Nesklandumai? Pabandykite naudoti <a href="%1$s" %2$s>įkėlimą per naršyklę</a>.','You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.'=>'Jūs bandėte patekti į "%1$s" skydelį, tačiau tam Jūs neturite reikiamų leidimų. Jei visgi manote, kad turėtumėte turėti priėjimą prie "%1$s" skydelio, susisiekite su tinklo administratoriumi.','You attempted to edit an item that does not exist. Perhaps it was deleted?'=>'Jūs norite redaguoti elementą, kuris neegzistuoja. Gal jis buvo ištrintas?','You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.'=>'Gali ieškoti temų pagal raktažodį, autorių ar žymą, arba ieškoti dar tiksliau pagal kriterijus, sudėtus žemiau esančiame savybių filtre.','You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.'=>'Jei atsisiuntėte temą iš kur nors kitur, galite įdiegti ją įkeldami ZIP archyvą. Tik būkite tikri, jog temą atsisiuntėte iš patikimo šaltinio! Žinoma, galite temą įdiegti ir senuoju būdu, įkeldami jos failus per FTP į %s katalogą.','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'Čia galite susikurti įvairių nuorodų sąrašą, kurį vėliau galėsite rodyti viename iš savo tinklalapio <a href="%s">valdiklių</a>. Kelios WordPress bendruomenės nuorodos yra įtrauktos pagal nutylėjimą.','You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.'=>'Galite pridėti naują arba redaguoti esamą nuorodą įvesdami informaciją į pateikiamus laukelius. Privaloma užpildyti nuorodos pavadinimo ir interneto adreso laukelius.','You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.'=>'Jūs taip pat galite naršyti po savo mėgstamiausius įskiepius naudodami nuorodą Mėgstamiausi, kurią rasite ekrano viršuje ir įvesdami savo WordPress.org vartotoją vardą.','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'Fono spalvą taip pat galite pasirinkti paspaudę ant mygtuko "Pasirinkti spalvą" ir tuomet įvedę tinkamą HTML hex vertę, pvz.: &#8220;#ff0000&#8221; raudonai spalvai, arba tiesiog pasirinkę norimą spalvą su specialiu įrankiu.','You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or an excerpt. <a href="%s">Learn more about feeds</a>.'=>'Taip pat galite keisti savo turinio rodymą RSS sraute, įskaitant maksimalų rodomų įrašų skaičių ir galimybę rodyti pilnus įrašus arba tik jų ištraukas. <a href="%s">Sužinokite daugiau apie RSS srautus</a>.','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'Primename, kad galite kurti įrašus su naršyklės adresyno programėle <a href="%s">„Press This“</a>.','You can also delete individual items and access the extended edit screen from the details dialog.'=>'Jūs taip pat galite išrinti failus po vieną arba atidaryti išplėstojo redagavimo režimą (į jį patenkama iš failo infomacijos lango)','You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk actions menu and click Apply.'=>'Taip pat galima kelis įrašus redaguoti arba perkelti į šiukšlinę vienu metu. Pasirinkite įrašus kuriuos Jūs norite keisti žymėdami varneles šalia jų, tuomet pasirinkite norimą veiksmą iš Masinių veiksmų meniu ir paspauskite "Taikyti".','You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. <a href="https://wordpress.org/documentation/article/embeds/">Learn more about embeds</a>.'=>'Taip pat galima lengvai įkelti turinį iš tokių populiarių tinklalapių kaip Twitter, YouTube, Flickr ir kitų. Tam tereikia į Jūsų įrašo ar puslapio turinį įdėti failo nuorodą, kuri būtų viena naujoje eilutėje. Sužinokite<a href="https://wordpress.org/documentation/article/embeds/">daugiau apie įkeliamą turinį</a>.','You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.'=>'Taip pat čia galite moderuoti komentarus ir pakeisti jų laiko žymas, panaudodami valdiklį „Būsena“.','You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk actions menu to edit the metadata for multiple pages at once.'=>'Čia taip pat galite atlikti tokius pačius veiksmus, įskaitant sąrašo filtravimą, veiksmų nurodų, kurios atsiranda užėjus pele, naudojimą ar Masinius veiksmus, kurias redaguosite kelių puslapių meta-informaciją iš karto.','You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there is no relationship from one tag to another.'=>'Įrašams galite priskirti raktažodžius - tam naudojamos <strong>žymos</strong>. Skirtingai nei kategorijos, žymos neturi hierarchijos, o tai reiškia, kad jos niekaip viena su kita nesusijusios.','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'Jūs galite priskirti konkrečius meniu į skirtingas vietas savo temoje, <strong>pasirinkę atitinkamus nustatymus</strong> meniu redagavimo puslapio apačioje. Norėdami priskirti meniu į visas įmanomas vietas temoje iš karto, <strong>atidarykite skiltį "Nustatyti meniu vietas"</strong> šio ekrano viršuje.','You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.'=>'Skiltyje „Ekrano nustatymai“ galėsite pasirinkti, kiek elementų rodyti ekrane ir kuriuos lentelės duomenis rodyti/slėpti.','You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.'=>'Be viso kito, būtent čia Jūs galite pakeisti savo slaptažodį, įjungti klaviatūros šaukinius, pakeisti savo WordPress administravimo skydelio spalvų schemą, išjungti WYSIWYG (raiškiąją) rašyklę. Taip pat galite paslėpti Įrankių juostą tinklalapyje (tačiau ji vistiek bus rodoma administravimo dalyje).','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'Galite pasirinkti iš numatytųjų savo temos antraštės paveikslėlių arba naudoti savo. Taip pat galite pakeisti kaip rodomas Jūsų tinklalapio pavadinimas ir apibūdinimas.','You can choose one of your previously uploaded headers, or show a random one.'=>'Jūs galite pasirinkti vieną iš anksčiau įkeltų antraščių arba rodyti atsitiktinę.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.'=>'Galite pasirinkti, ką rodyti pagrindiniame tinklalapio puslapyje. Tai gali būti jūsų naujausi įrašai (pagal nutylėjimą) arba statinis puslapis. Jei norite statinio pradžios puslapio, pirma sukurkite du <a href="%s">puslapius</a>. Vienas taps pradžios puslapiu, o kitame bus rodomi jūsų įrašai.','You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen.'=>'Jūs galite pasirinkti, ar norėtumėte, kad Jūsų tinklalapyje lankytųsi robotai, atgalinių nuorodų servisai ir interneto vorai. Jei norite, kad šie servisai ignoruotų Jūsų tinklalapį, pažymėkite varnelę šalia "Paieškos sistemos prašomos neindeksuoti" ir paspauskite mygtuką "Išsaugoti pakeitimus" puslapio apačioje.','You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.'=>'Jūs galite sukurti nuorodų grupes, naudojant Nuorodų kategorijas. Nuorodų kategorijų pavadinimai turi būti unikalūs, o šios kategorijos yra visiškai nesusijusios su įrašų kategorijomis.','You can create the %s file manually and paste the following text into it.'=>'Galite sukurti %s failą rankiniu būdu ir jame įterpti žemiau esantį kodą.','You can customize the display of this screen in a number of ways:'=>'Galite pakeisti šio puslapio išvaizdą keliais būdais:','You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.'=>'Galite keisti šio puslapio vaizdą pasirinkdami skiltį „Ekrano nustatymai“ ir/arba panaudodami filtravimo funkciją.','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'Galite keisti šio puslapio vaizdą keliais būdais:','You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.'=>'Galite pakeisti tinklalapio išvaizdą neredaguodami naudojamos temos kodo. Tam yra skirtas pasirinktinis fonas (paveikslėlis arba spalva).','You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.'=>'Jūs galite masiškai ištrinti nuorodų kategorijas naudodami Masinių veiksmų išskleidžiamajį sąrašą, tačiau tokiu būdu ištrinsite tik pačias kategorijas, o ne nuorodas jose. Jose buvusios nuorodos perkeliamos į numatytają Nuorodų kategoriją.','You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.'=>'Jūs galite redaguoti paveikslėlį, tačiau išlaikyti jo miniatiūrą originalią. Pavyzdžiui, jei norėtumėte turėti kvadratinę miniatiūrą, kuri rodytų tik dalį paveikslėlio.','You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.'=>'Čia galite redaguoti komentaro informaciją ir turinį. Tai ypač naudinga, kai pastebite, jog komentaro autorius padarė teksto rinkimo klaidą.','You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.'=>'Dėmesio neblaškantis režimas įjungiamas naudojant piktogramą dešinėje. Ši funkcija neveiks senose naršyklių versijose bei įrenginiuose su mažais ekranais, taip pat jai reikalingas įjungtas pilno aukščio nustatymas Ekrano Nustatymuose.','You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.'=>'Jūs galite eksportuoti visą savo tinklalapio turinį, o vėliau jį importuoti į kitą WordPress tinklalapį ar net kitą turinio valdymo sistemą. Eksporto failas bus XML formatas WXR. Į eksportą gali būti įtraukti įrašai, puslapiai, komentarai, vartotojo laukai, kategorijos ir žymos. Generuodami WXR failą, galėsite pasirinkti, kad į jį būtų įtraukti tik konkretūs įrašai ar puslapiai - tereikės išskleidžiamajame sąraše pasirinkti norimą kategoriją, autorių, laikotarpį mėnesiais arba statusą.','You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.'=>'Galite filtruoti įrašus pagal jų statusus, naudodami tekstines nuorodas virš įrašų sąrašo. Numatytasis pasirinkimas yra rodyti visus įrašus.','You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.'=>'Jūs galite filtruoti vartotojų sąrašą pagal jų rolę - matyti visus, administratorius, redaktorius, autorius, kūrėjus ir skaitytojus. Numatytasis vaizdas yra visų vartotojų rodymas. Nenaudojamos rolės nėra rodomos filtravimo pasirinkime.','You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.'=>'Daugiau temų savo tinklalapiui galite rasti per Temų paiešką/Instaliavimą, matomą šiame ekrane - čia rodomos temos iš <a href="%s">WordPress.org temų katalogo</a>. Šias temas sukūrė ir plėtoja tretieji asmenys, jos yra nemokamos bei tinkamos naudoti pagal WordPress naudojamą licenciją.','You can find more details and make changes on the Plugins screen.'=>'Įskiepių puslapyje rasite daugiau informacijos ir galėsite atlikti norimus pakeitimus.','You can find more details and make changes on the Themes screen.'=>'Temų puslapyje rasite daugiau informacijos ir galėsite atlikti norimus pakeitimus.','You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.'=>'Naujus įskiepius galite rasti per paiešką arba naršydami katalogą šioje įskiepių skiltyje.','You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.'=>'Skiltyje „Ekrano nustatymai“ pagal poreikius galite pasirinkti, kuriuos lentelės elementus rodyti/slėpti, taip pat, kiek įrašų rodyti viename puslapyje.','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'Naudodami Ekrano nustatymų skiltį, galite slėpti/rodyti stulpelius pagal savo poreikius bei nuspręsti, po kiek vartotojų rodyti viename puslapyje.','You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.'=>'Įvairius failus į rašyklę galite įterpti paspaudę mygtuką virš redaktoriaus ir sekdami duodamais nurodymais. Nuo šiol paveikslėlius galite sulygiuoti ar redaguoti su specialiais paveikslėlių formatavimo įrankiais, matomais raiškiąjame redaktoriaus režime.','You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.'=>'Jūs galite atsijungti kituose įrenginiuose, pavyzdžiui savo telefone arba viešai naudojamame kompiuteryje, paspaudę mygtuką "Atsijungti iš visų kitų sesijų".','You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the bulk actions.'=>'Tinklalapio lankytojų paskelbtus komentarus galite tvarkyti panašiai, kaip įrašus ar bet kokį kitą turinį. Šis puslapis turi keičiamą išdėstymą, lygiai kaip ir kiti administravimo puslapiai, o visi veiksmai, kuriuos galite atlikti su komentarais, yra matomi Masinių veiksmų išskleidžiamąjame sąraše arba užėjus pele ant konkretaus komentaro.','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'Galite filtruoti sąrašą pagal failo tipą/statusą ar datą, naudojant išskleidžiamus pasirinkimus virš failų lentelės.','You can now manage and live-preview Custom Backgrounds in the <a href="%s">Customizer</a>.'=>'Nuo šiol Jūs galite tvarkyti ir peržiūrėti tinklalapio foną <a href="%s">Vaizdžiąjame režime</a>.','You can now manage and live-preview Custom Header in the <a href="%s">Customizer</a>.'=>'Nuo šiol Jūs galite tvarkyti ir peržiūrėti tinklalapio antraštę <a href="%s">Vaizdžiąjame režime</a>.','You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.'=>'Jūs galite proporcingai sumažinti originalų įkeltą paveikslėlį. Geriausiai pavyks, jei sumažinimas bus atliktas prieš apkirpimą, apvertimą ar pasukimą. Taip pat paveikslėliai gali būti tik sumažinami, ne padidinami.','You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.'=>'Išskleidžiamuosiuose langeliuose galite filtruoti įrašus pagal kategoriją arba paskelbimo datą. Įrašų lentelėje taip pat galite atlikti filtravimą pagal įrašo autorių, kategoriją ar žymą.','You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.'=>'Jūs galite nustatyti, kad konkretus paveikslėlis būtų rodomas Jūsų tinklalapio viršutinėje dalyje - tereikia jį įkelti iš kompiuterio arba pasirinkti iš Failų saugyklos. Kai pasirinkite konkretų paveikslėlį, galėsite jį apkarpyti.','You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.'=>'Jūs galite pasirinkti kalbą, kuria bus rodoma WordPress administravimo dalis, tinklalapio kalba lankytojams nepasikeis.','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'Jūsų tinklalapis gali turėti antraštę su Jums patinkančiu paveikslėliu. Paprasčiausiai įkelkite paveikslėlį, apkirpkite jį ir Jūsų nauja antraštė jau paruošta. Vietoje to taip pat galite naudoti paveikslėlį kuris jau seniau yra įkeltas į Jūsų Failų saugyklą - tuomet reikia paspausti ant mygtuko "Pasirinkti paveikslėlį".','You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.'=>'Galite nustatyti maksimalius į įrašus įterpiamų paveikslėlių dydžius. Taip pat galite įkelti ir viso dydžio paveikslėlius.','You can set the language, and WordPress will automatically download and install the translation files (available if your filesystem is writable).'=>'Jūs galite nustatyti kalbą, ir vertimo failai bus automatiškai parsiųsti bei instaliuoti (tik jei Jūsų failų sistemos leidimai leidžia įrašymą).','You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.'=>'You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.','You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.'=>'Skelbti turinį savo tinklalapyje Jūs galite keliais skirtingais būdais; šiame puslapyje yra visų šių būdų nustatymai. Viršutinėje skiltyje matote skydelio rašyklės nustatymus, o žemiau esantys nustatymai skirti išoriniams turinio skelbimo metodams. Daugiau informacijos apie šiuos metodus rasite dokumentacijoje.','You can update from WordPress %1$s to <a href="%2$s">WordPress %3$s</a> manually:'=>'Galite atnaujinti WordPress %1$s į <a href="%2$s">WordPress %3$s</a> rankiniu būdu:','You can update to the latest nightly build manually:'=>'Galite atsinaujinti į naujausią naktinę versiją rankiniu būdu:','You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.'=>'Paspaudę mygtuką "Įkelti failus" galite įdėti įvairaus tipo failus (paveikslėlius, audio, dokumentus ir pan.). Pridedant galite išsirinkti iš seniau į Failų saugyklą įkeltų failų, arba įkelti naują failą. Norėdami sukurti galeriją, pasirinkite paveikslėlius, kurie joje turėtų būti ir paspauskite mygtuką "Sukurti naują galeriją".','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'Čia Jūs galite pirmiau įkelti norimus failus, prieš kuriant įrašą. Tuomet vėliau, rašydami įrašus bei kurdami puslapius, galėsite naudoti čia įkeltus failus. Įkelti failus galite trim būdais:','You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.'=>'Naudodami kategorijas, galite suskirstyti panašius įrašus į tam tikras grupes. Numatytoji kategorija yra pavadinta „Be kategorijos“. Ją galite pakeisti <a href="%s">rašymo nuostatose</a>.','You can use one of these cool headers or show a random one on each page.'=>'Jūs galite naudoti vieną iš šių puikių antraščių arba kiekviename atsitiktinai puslapyje rodyti vis kitą.','You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.'=>'Norėdami susidėlioti Skydelio vaidą kaip Jums patogiau, galite naudoti čia matomus įrankius. Tokius pačius įrankius rasite daugumoje administravimo sąsajos puslapių.','You can use the plugin file editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.'=>'Jei norite redaguoti įskiepio failus, galite pasinaudoti šiuo redagavimo įrankiu. Atminkite, kad visi pakeitimai pradings, jei atnaujinsite įskiepio versiją.','You can use the theme file editor to edit the individual CSS and PHP files which make up your theme.'=>'Šiame puslapyje galite redaguoti įdiegtų temų CSS ir PHP failus.','You can view all posts made by a user by clicking on the number under the Posts column.'=>'Pamatyti visus konkretaus vartotojo įrašus galite spustelėję ant numeriuko stulpelyje Įrašai.','You can view posts in a simple title list or with an excerpt using the Screen Options tab.'=>'Galite peržiūrėti įrašų antraščių sąrašą arba sąrašą su santraukomis, keisdami nustatymus „Ekrano nustatymuose“.','You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.'=>'Jūs galite peržiūrėti savo failus išdėstytus tinkleliu arba sąraše su su keliais stulpeliais. Išdėstymą galite lengvai pakeisti paspaudus ant piktogramų viršutiniame kairiąjame kampe, virš visų failų.','You cannot activate this plugin as it has unmet requirements.'=>'Šio įskiepio įjungti negalima, nes neįvykdyti jam keliami reikalavimai.','You cannot deactivate this plugin as other plugins depend on it.'=>'Šio įskiepio negalima išjungti, nes nuo jo priklauso kiti įskiepiai.','You cannot deactivate this plugin as other plugins require it.'=>'Negalite išjungti šio įskiepio, kadangi jis yra reikalingas kitiems įskiepiams.','You cannot delete a plugin while it is active on the main site.'=>'Jūs negalite ištrinti įskiepio, kol jis yra įjungtas pagrindiniame tinklalapyje.','You cannot delete a theme while it has an active child theme.'=>'Negalima ištrinti temos, 