ed for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.'=>'Yra tik viena šiam tinklalapiui įjungta tema. Aplankykite tinklo administravimo puslapį ir <a href="%1$s">įjunkite</a> arba <a href="%2$s">įdiekite</a> daugiau temų.','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.'=>'Yra tik viena šiam tinklalapiui galima tema. Užeikite į tinklo administratoriaus nuostatas ir <a href="%s">įjunkite</a> daugiau temų.','You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.'=>'Jūs esate įdiegę tik vieną temą. Primename, kad WordPress.org temų kataloge yra daugiau nei 1000 nemokamų temų. Tiesiog paspauskite viršuje esančią kortelę „<a href="%s">Įdiegti temą</a>“ ir išsirinkite sau patinkančią.','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'Taip pat turite aprašyti bet kokį jautrių asmens duomenų rinkimą ir saugojimą, pavyzdžiui, susijusių su asmens sveikata.','You should also review your privacy policy from time to time, especially after installing or updating any themes or plugins. There may be changes or new suggested information for you to consider adding to your policy.'=>'Rekomenduojame periodiškai peržiūrėti savo privatumo politiką, ypač įdiegus ar atnaujinus temas bei įskiepius. Ateityje gali būti pakeitimų ar naujos rekomenduojamos informacijos, kurią galbūt norėtumėte pridėti į savo politiką.','You should be able to get this info from your web host, if %s does not work.'=>'Jūsų talpinimo tiekėjas turėtų jums pateikti šią informaciją, jeigu %s neveikia.','You should consider removing any unused themes to enhance your site&#8217;s security.'=>'Rekomenduojame pašalinti visas nenaudojamas temas, taip bus sustiprint